s and proposed features for the Block Editor.'=>'<strong>Testējiet</strong> jaunas versijas un ierosinātās bloka redaktora funkcijas.','Be part of a global open source community.'=>'Esiet daļa no globālas atvērtā pirmkoda kopienas.','Apply your skills or learn new ones.'=>'Pielietojiet savas prasmes vai apgūstiet jaunas.','Grow your network and make friends.'=>'Paplašiniet savu tīklu un iegūstiet draugus.','No-code contribution'=>'Ieguldījums bez koda','<strong>Share</strong> your knowledge in the WordPress support forums.'=>'<strong>Dalieties ar savām zināšanām</strong> WordPress atbalsta forumos.','Do you use WordPress for work, for personal projects, or even just for fun? You can help shape the long-term success of the open source project that powers millions of websites around the world.'=>'Vai jūs izmantojat WordPress darbam, personīgiem projektiem vai tikai izklaidei? Jūs varat palīdzēt veicināt ilgtermiņa panākumus atvērtā pirmkoda projektam, kas nodrošina miljoniem vietņu visā pasaulē.','WordPress may thrive on technical contributions, but you don&#8217;t have to code to contribute. Here are some of the ways you can make an impact without writing a single line of code:'=>'WordPress, iespējams, ir veiksmīgs, pateicoties tehniskajiem ieguldījumiem, taču, lai sniegtu savu ieguldījumu, jums nav jāprot programmēt. Lūk, daži no veidiem, kā jūs varat sniegt savu ieguldījumu, neuzrakstot nevienu koda rindiņu:','<strong>Write</strong> or improve documentation for WordPress.'=>'<strong>Rakstiet</strong> vai uzlabojiet WordPress dokumentāciju.','<strong>Translate</strong> WordPress into your local language.'=>'<strong>Tulkojiet</strong> WordPress savā valodā.','<strong>Create</strong> and improve WordPress educational materials.'=>'<strong>Veidojiet</strong> un uzlabojiet WordPress mācību materiālus.','<strong>Promote</strong> the WordPress project to your community.'=>'<strong>Reklamējiet</strong> WordPress projektu savā kopienā.','Join the diverse WordPress contributor community and connect with other people who are passionate about maintaining a free and open web.'=>'Pievienojieties daudzveidīgajai WordPress līdzstrādnieku kopienai un sazinieties ar citiem, kuri aizrautīgi uztur brīvu un atvērtu tīmekli.','Be the future of WordPress'=>'Esiet WordPress nākotne','<a href="%1$s">Learn WordPress</a> is a free resource for new and experienced WordPress users. Learn is stocked with how-to videos on using various features in WordPress, <a href="%2$s">interactive workshops</a> for exploring topics in-depth, and lesson plans for diving deep into specific areas of WordPress.'=>'<a href="%1$s">Learn WordPress</a> ir bezmaksas resurss jauniem un pieredzējušiem WordPress lietotājiem. Vietnē ir pieejami videoklipi par to, kā izmantot dažādas WordPress funkcijas, <a href="%2$s">interaktīvi semināri</a>, lai padziļināti izpētītu tematus, un mācību plāni, lai vispusīgi apgūtu konkrētās WordPress jomas.','<a href="https://wordpress.org/support/forums/">Support forums</a>'=>'<a href="https://wordpress.org/support/forums/">Atbalsta forumi</a>','<strong>View</strong> takes you to a public author archive which lists all the posts published by the user.'=>'Izmantojot funkciju <strong>Skats</strong>, tiek atvērts publisks autoru arhīvs, kurā ir uzskaitītas visas lietotāja publicētās ziņas.','<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Documentation on Widgets</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Logrīku dokumentācija</a>','<strong>Download file</strong> downloads the original media file to your device.'=>'<strong>Lejupielādē failu</strong> lejupielādē oriģinālo multivides failu ierīcē.','site editor title tagEditor'=>'Redaktors','<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Documentation on Auto-updates</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Automātisko atjauninājumu dokumentācija</a>','<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Documentation on date and time formatting</a>.'=>'<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Dokumentācija par datuma un laika formatēšanu</a>.','You can set the language, and WordPress will automatically download and install the translation files (available if your filesystem is writable).'=>'Varat iestatīt valodu, un WordPress automātiski lejupielādēs un instalēs tulkošanas failus (pieejams, ja failu sistēma ir rakstāma).','If you want site visitors to be able to register themselves, check the membership box. If you want the site administrator to register every new user, leave the box unchecked. In either case, you can set a default user role for all new users.'=>'Ja vēlaties, lai vietnes apmeklētāji varētu reģistrēties paši, atzīmējiet lodziņu dalībai. Ja vēlaties, lai vietnes administrators reģistrētu katru jaunu lietotāju, atstājiet šo izvēles rūtiņu neatzīmētu. Abos gadījumos iespējams iestatīt noklusējuma lietotāja lomu katram jaunam lietotājam.','Both WordPress URL and site URL can start with either %1$s or %2$s. A URL starting with %2$s requires an SSL certificate, so be sure that you have one before changing to %2$s. With %2$s, a padlock will appear next to the address in the browser address bar. Both %2$s and the padlock signal that your site meets some basic security requirements, which can build trust with your visitors and with search engines.'=>'Gan WordPress URL, gan vietnes URL var sākties ar %1$s vai %2$s. Vietrādim URL, kas sākas ar %2$s, ir nepieciešams SSL sertifikāts, tāpēc pirms maiņas uz %2$s pārliecinieties, ka jums tāds ir. Izmantojot %2$s, pārlūkprogrammas adreses joslā blakus adresei tiks parādīta piekaramā atslēga. Gan %2$s, gan piekaramā atslēga norāda, ka jūsu vietne atbilst dažām drošības pamatprasībām, kas var vairot apmeklētāju un meklētājprogrammu uzticību.','Though the terms refer to two different concepts, in practice, they can be the same address or different. For example, you can have the core WordPress installation files in the root directory (<code>https://example.com</code>), in which case the two URLs would be the same. Or the <a href="%s">WordPress files can be in a subdirectory</a> (<code>https://example.com/wordpress</code>). In that case, the WordPress URL and the site URL would be different.'=>'Lai gan termini attiecas uz diviem dažādiem jēdzieniem, praksē tie var būt vienādi vai atšķirīgi. Piemēram, WordPress instalācijas pamatfaili var būt saknes direktorijā (<code>https://example.com</code>), un tādā gadījumā abi vietrāži URL būs vienādi. Vai arī <a href="%s">WordPress faili var atrasties apakšdirektorijā</a> (<code>https://example.com/wordpress</code>). Šajā gadījumā WordPress URL un vietnes URL atšķirsies.','Two terms you will want to know are the WordPress URL and the site URL. The WordPress URL is where the core WordPress installation files are, and the site URL is the address a visitor uses in the browser to go to your site.'=>'Divi termini, kurus vēlaties zināt, ir WordPress URL un vietnes URL. WordPress URL ir vieta, kur atrodas galvenie WordPress instalācijas faili, un vietnes URL ir adrese, ko apmeklētājs izmanto pārlūkprogrammā, lai dotos uz jūsu vietni.','RoboHash (Generated)'=>'RoboHash (ģenerēts)','site editor menu itemEditor'=>'Redaktors','Expand or collapse the elements by clicking on their headings, and arrange them by dragging their headings or by clicking on the up and down arrows.'=>'Izvērsiet vai sakļaujiet elementus, klikšķinot uz to virsrakstiem, un sakārtojiet tos, velkot virsrakstu vai klikšķinot uz augšup un lejup vērstajām bultiņām.','The source and destination are the same.'=>'Avots un mērķis ir vienādi.','The destination folder already exists.'=>'Mērķa mape jau pastāv.','The destination directory already exists and could not be removed.'=>'Mērķa mape jau pastāv un to nevarēja dzēst.','%s expects a non-empty string.'=>'%s gaida virkni, kas nav tukša.','https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/'=>'https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/','https://wordpress.org/documentation/article/assign-custom-fields/'=>'https://wordpress.org/documentation/article/assign-custom-fields/','Allow <a href="%s">trackbacks and pingbacks</a>'=>'Atļaut <a href="%s">atsaites un atbalsojumus</a>','The "%s" argument must be a non-empty string.'=>'Arguments "%s" nedrīkst būt tukša virkne.','Download &#8220;%s&#8221;'=>'Lejupielādēt “%s”','<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Documentation on Keyboard Shortcuts</a>'=>'<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Dokumentācija par īsinājumtaustiņiem</a>','<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Documentation on Comment Spam</a>'=>'<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Dokumentācija par komentāru surogātpastu</a>','<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Documentation on Writing and Editing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Dokumentācija par ziņu rakstīšanu un rediģēšanu</a>','<a href="https://wordpress.org/documentation/article/customizer/">Documentation on Customizer</a>'=>'<a href="https://wordpress.org/documentation/article/customizer/">Pielāgošanas rīka dokumentācija</a>','This is the final release of WordPress %s'=>'Šis ir pēdējais WordPress %s laidiens','https://wordpress.org/download/'=>'https://wordpress.org/download/','Site Editor'=>'Vietnes redaktors','Hovering over a row reveals action links that allow you to manage media items. You can perform the following actions:'=>'Virzot kursoru virs rindas, tiek parādītas darbības saites, kas ļauj pārvaldīt multivides vienumus. Varat veikt šādas darbības:','<strong>Edit</strong> takes you to a simple screen to edit that individual file&#8217;s metadata. You can also reach that screen by clicking on the media file name or thumbnail.'=>'<strong>Rediģēt</strong> tiek atvērts vienkāršs ekrāns, lai rediģētu konkrētā faila metadatus. Varat arī sasniegt šo ekrānu, noklikšķinot uz multivides faila nosaukuma vai sīktēla.','<strong>Delete Permanently</strong> will delete the file from the media library (as well as from any posts to which it is currently attached).'=>'<strong>Neatgriezeniski dzēst</strong> fails tiks izdzēsts no multivides bibliotēkas (kā arī no visām ziņām, kurām tas pašlaik ir pievienots).','<strong>View</strong> will take you to a public display page for that file.'=>'<strong>Skatīt</strong> tiks atvērta šī faila publiska parādīšanas lapa.','<strong>Copy URL</strong> copies the URL for the media file to your clipboard.'=>'<strong>Kopēt URL starpliktuvē</strong> kopē multivides faila URL starpliktuvē.','https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type'=>'https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type','<strong>Send password reset</strong> sends the user an email with a link to set a new password.'=>'<strong>Sūtīt paroles atiestatīšanu</strong> lietotājam nosūta e-pasta ziņojumu ar saiti jaunas paroles iestatīšanai.','A block theme is a theme that uses blocks for all parts of a site including navigation menus, header, content, and site footer. These themes are built for the features that allow you to edit and customize all parts of your site.'=>'Bloku tēma ir tēma, kas izmanto blokus visām vietnes daļām, tostarp navigācijas izvēlnēm, galvenei, saturam un vietnes kājenei. Šīs tēmas ir veidotas ar funkcijām, kas ļauj rediģēt un pielāgot visas vietnes daļas.','With a block theme, you can place and edit blocks without affecting your content by customizing or creating new templates.'=>'Izmantojot bloku tēmu, varat izvietot un rediģēt blokus, pielāgojot vai izveidojot jaunas veidnes, neietekmējot saturu.','Block themes'=>'Bloku tēmas','themesBlock Themes'=>'Bloku tēmas','<a href="https://wordpress.org/documentation/article/block-themes/">Documentation on Block Themes</a>'=>'<a href="https://wordpress.org/documentation/article/block-themes/">Bloku tēmu dokumentācija</a>','Recommended items are considered beneficial to your site, although not as important to prioritize as a critical issue, they may include improvements to things such as; Performance, user experience, and more.'=>'Tiek uzskatīts, ka ieteiktie vienumi ir noderīgi jūsu vietnei, lai gan tie nav tik svarīgi, lai noteiktu prioritāti kā kritisku problēmu, tie var ietvert uzlabojumus tādām lietām kā: veiktspēja, lietotāja pieredze un daudz kas cits.','Configuration rules for %s:'=>'%s konfigurācijas noteikumi:','The theme you are currently using is not compatible with the Site Editor.'=>'Pašlaik izmantotā tēma nav saderīga ar vietnes redaktoru.','Critical issues are items that may have a high impact on your sites performance or security, and resolving these issues should be prioritized.'=>'Kritiskās problēmas ir vienumi, kas var būtiski ietekmēt jūsu vietņu veiktspēju vai drošību, un šo problēmu risināšanai ir jābūt prioritātei.','Site Health %s'=>'Vietnes veselība %s','%s removed from permalink structure'=>'%s noņemts no pastāvīgās saites struktūras','Select the permalink structure for your website. Including the %s tag makes links easy to understand, and can help your posts rank higher in search engines.'=>'Atlasiet savas vietnes pastāvīgās saites struktūru. Taga %s iekļaušana padara saites viegli saprotamas un var palīdzēt jūsu ziņām iegūt augstāku vietu meklētājprogrammās.','Customize permalink structure by selecting available tags'=>'Pielāgojiet pastāvīgās saites struktūru, atlasot pieejamos tagus','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance.'=>'PHP ir viena no programmēšanas valodām, ko izmanto, lai veidotu WordPress. Jaunākās PHP versijās tiek regulāri atjaunoti drošības uzlabojumi un tās var palielināt jūsu vietnes veiktspēju.','The minimum recommended version of PHP is %s.'=>'Senākā ieteicamā PHP versija ir %s.','Theme Styles & Block Settings'=>'Motīvu stili un bloku iestatījumi','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'Jūsu vietne darbojas ar novecojušu PHP versiju (%s), kuru drīzumā neatbalstīs WordPress. Nodrošiniet, lai PHP jūsu serverī tiktu atjaunots pēc iespējas ātrāk. Pretējā gadījumā jūs nevarēsit jaunināt WordPress.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress. Ensure that PHP is updated on your server as soon as possible. Otherwise you will not be able to upgrade WordPress.'=>'Jūsu vietne darbojas ar novecojušu PHP versiju (%s), kas nesaņem drošības atjauninājumus un drīzumā WordPress to neatbalstīs. Nodrošiniet, lai PHP jūsu serverī tiktu atjaunots pēc iespējas ātrāk. Pretējā gadījumā jūs nevarēsit jaunināt WordPress.','A persistent object cache makes your site&#8217;s database more efficient, resulting in faster load times because WordPress can retrieve your site&#8217;s content and settings much more quickly.'=>'Pastāvīga objektu kešatmiņa padara jūsu vietnes datubāzi efektīvāku, tādējādi paātrina ielādes laiku, jo WordPress var daudz ātrāk izgūt jūsu vietnes saturu un iestatījumus.','Learn more about persistent object caching.'=>'Uzziniet vairāk par pastāvīgu objektu kešatmiņu.','A persistent object cache is not required'=>'Pastāvīga objekta kešatmiņa nav nepieciešama','Your hosting provider can tell you if a persistent object cache can be enabled on your site.'=>'Jūsu mitināšanas pakalpojumu sniedzējs var jums pateikt, vai jūsu vietnē var iespējot pastāvīgu objektu kešatmiņu.','Your host appears to support the following object caching services: %s.'=>'Šķiet, ka jūsu resursdators atbalsta šādus objektu kešatmiņas pakalpojumus: %s.','You should use a persistent object cache'=>'Jums vajadzētu izmantot pastāvīgu objektu kešatmiņu','Page cache'=>'Lapas kešatmiņa','Persistent object cache'=>'Pastāvīga objektu kešatmiņa','A page cache plugin was detected.'=>'Tika konstatēts lapas kešatmiņas spraudnis.','A page cache plugin was not detected.'=>'Lapas kešatmiņas spraudnis netika atrasts.','A persistent object cache is being used'=>'Tiek izmantota pastāvīga objekta kešatmiņa','Page cache is detected by looking for an active page cache plugin as well as making three requests to the homepage and looking for one or more of the following HTTP client caching response headers:'=>'Lapas kešatmiņa tiek noteikta, meklējot aktīvu lapas kešatmiņas spraudni, kā arī veicot trīs pieprasījumus sākumlapai un meklējot vienu vai vairākas no šīm HTTP klienta kešatmiņas atbilžu galvenēm:','Learn more about page cache'=>'Uzziniet vairāk par lapas kešatmiņu','Unable to detect the presence of page cache'=>'Nevar noteikt lapas kešatmiņas klātbūtni','Unable to detect page cache due to possible loopback request problem. Please verify that the loopback request test is passing. Error: %1$s (Code: %2$s)'=>'Nevar noteikt lapas kešatmiņu iespējamas cilpas pieprasījuma problēmas dēļ. Lūdzu, pārbaudiet, vai cilpas pieprasījuma tests ir sekmīgs. Kļūda: %1$s (kods: %2$s)','Page cache is not detected but the server response time is OK'=>'Lapas kešatmiņa netiek konstatēta, bet servera atbildes laiks ir OK','Page cache is detected and the server response time is good'=>'Lapas kešatmiņa ir noteikta, un servera reakcijas laiks ir labs','Page cache is not detected and the server response time is slow'=>'Lapas kešatmiņa nav noteikta, un servera reakcijas laiks ir lēns','Page cache is detected but the server response time is still slow'=>'Lapas kešatmiņa ir noteikta, bet servera reakcijas laiks joprojām ir lēns','Server response time could not be determined. Verify that loopback requests are working.'=>'Servera reakcijas laiku nevarēja noteikt. Pārbaudiet, vai cilpas pieprasījumi darbojas.','Median server response time was %1$s milliseconds. This is less than the recommended %2$s milliseconds threshold.'=>'Vidējais servera atbildes laiks bija %1$s milisekundes. Tas ir mazāks par ieteicamo %2$s milisekundes slieksni.','Median server response time was %1$s milliseconds. It should be less than the recommended %2$s milliseconds threshold.'=>'Vidējais servera atbildes laiks bija %1$s milisekundes. Tam ir jābūt mazākam par ieteicamo %2$s milisekundes slieksni.','No client caching response headers were detected.'=>'Netika konstatēta neviena klienta kešatmiņas atbilžu galvene.','There was %d client caching response header detected:'=>'Tika konstatēta %d klienta kešatmiņas atbildes galvenes:' . "\0" . 'Tika konstatēta %d klienta kešatmiņas atbildes galvene:' . "\0" . 'Tika konstatēta %d klienta kešatmiņas atbildes galvenes:','When testing the REST API, an error was encountered:'=>'Pārbaudot REST API, radās kļūda:','REST API Endpoint: %s'=>'REST API galapunkts: %s','REST API Response: (%1$s) %2$s'=>'REST API atbilde: (%1$s) %2$s','When testing the REST API, an unexpected result was returned:'=>'Pārbaudot REST API, tika atgriezts negaidīts rezultāts:','The Authorization header is used by third-party applications you have approved for this site. Without this header, those apps cannot connect to your site.'=>'Autorizācijas galveni izmanto trešo pušu lietojumprogrammas, kuras esat apstiprinājis šai vietnei. Bez šīs galvenes šīs lietotnes nevar izveidot savienojumu ar jūsu vietni.','If you are still seeing this warning after having tried the actions below, you may need to contact your hosting provider for further assistance.'=>'Ja pēc tālāk norādīto darbību veikšanas joprojām tiek rādīts šis brīdinājums, iespējams, jums būs jāsazinās ar mitināšanas pakalpojumu sniedzēju, lai saņemtu papildu palīdzību.','Page cache enhances the speed and performance of your site by saving and serving static pages instead of calling for a page every time a user visits.'=>'Lapas kešatmiņa uzlabo jūsu vietnes ātrumu un veiktspēju, saglabājot un apkalpojot statiskas lapas, nevis izsaucot lapu katru reizi, kad lietotājs to apmeklē.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance. The minimum recommended version of PHP is %s.'=>'PHP ir viena no programmēšanas valodām, ko izmanto, lai izveidotu WordPress. Jaunākās PHP versijās tiek regulāri atjaunoti drošības jauninājumi, un tās var palielināt jūsu vietnes veiktspēju. Minimālā ieteicamā PHP versija ir %s.','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress.'=>'Jūsu vietne darbojas ar novecojušu PHP versiju (%s), kuru drīzumā neatbalstīs WordPress.','Requirements'=>'Prasības','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress.'=>'Jūsu vietne darbojas ar novecojušu PHP versiju (%s), kas nesaņem drošības atjauninājumus un drīzumā to neatbalstīs WordPress.','Your site is running on an outdated version of PHP (%s), which does not receive security updates. It should be updated.'=>'Jūsu vietne darbojas ar novecojušu PHP versiju (%s), kas nesaņem drošības atjauninājumus. Tas ir jāatjaunina.','Reach out to WordPress Core developers to ensure you\'ll never have this problem again.'=>'Sazinieties ar WordPress Core izstrādātājiem, lai nodrošinātu, ka jums nekad vairs nebūs šīs problēmas.','- %1$s (from version %2$s to %3$s)%4$s'=>'- %1$s (no versijas %2$s uz %3$s)%4$s','- %1$s version %2$s%3$s'=>'- %1$s versija %2$s%3$s','The %s argument must be an array.'=>'Argumentam %s ir jābūt masīvam.','The %1$s argument must be a non-empty string for %2$s.'=>'Arguments %1$s nedrīkst būt tukšs %2$s.','The %1$s constant is defined as %2$s'=>'Konstante %1$s ir definēta kā %2$s','Another attempt will be made with the next release.'=>'Vēl viens mēģinājums tiks veikts ar nākamo izlaidumu.','Your site does not have any active plugins.'=>'Jūsu vietnei nav neviena aktīva spraudņa.','Your site does not have any installed themes.'=>'Jūsu vietnē nav instalētu motīvu.','Important! Your version of WordPress (%1$s) will stop receiving security updates in the near future. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Svarīgi! Jūsu WordPress versija (%1$s) tuvākajā nākotnē pārtrauks saņemt drošības atjaunojumus. Lai nodrošinātu vietnes drošību, lūdzu, <a href="%2$s">atjauniniet uz jaunāko WordPress versiju</a>.','Important! Your version of WordPress (%1$s) is no longer supported, you will not receive any security updates for your website. To keep your site secure, please <a href="%2$s">update to the latest version of WordPress</a>.'=>'Svarīgi! Jūsu WordPress versija (%1$s) vairs netiek atbalstīta, jūs vairs nesaņemsiet drošības atjauninājumus savai vietnei. Lai nodrošinātu vietnes drošību, lūdzu, <a href="%2$s">atjauniniet uz jaunāko WordPress versiju</a>.','Learn more about WordPress %s'=>'Uzziniet vairāk par WordPress %s','Please type your comment text.'=>'Lūdzu, ierakstiet komentāra tekstu.','You cannot remove users.'=>'Jūs nevarat noņemt lietotājus.','Application passwords grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Lietojumprogrammu paroles nodrošina piekļuvi <a href="%1$s">vietnēm %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.' . "\0" . 'Lietojumprogrammu paroles nodrošina piekļuvi <a href="%1$s">vietnei %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.' . "\0" . 'Lietojumprogrammu paroles nodrošina piekļuvi <a href="%1$s">vietnēm %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.','WordPress has been updated! Next and final step is to update your database to the newest version.'=>'WordPress ir atjaunināts! Nākamais un pēdējais solis ir datu bāzes atjaunināšana uz jaunāko versiju.','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Documentation on Managing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Tēmu pārvaldības dokumentācija</a>','Welcome to WordPress. Before getting started, you will need to know the following items.'=>'Laipni lūdzam WordPress. Pirms sākat darbu, jums būs jāzina tālāk norādītās lietas.','This information is being used to create a %s file.'=>'Šī informācija tiek izmantota, lai izveidotu %s failu.','Settings save failed.'=>'Iestatījumu saglabāšana neizdevās.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. These are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all.'=>'<strong>Kļūda:</strong> jūsu %1$s fails nav <a href="%2$s">rakstāms</a>, tāpēc nebija iespējams to automātiski atjaunot. Šie ir mod_rewrite noteikumi, kam ir jābūt jūsu %1$s failā. Noklikšķiniet laukā un nospiediet %3$s (vai %4$s operētājsistēmā Mac), lai atlasītu visu.','After your Privacy Policy page is set, you should edit it.'=>'Kad jūsu Privātuma politikas lapa ir iestatīta, rediģējiet to.','<strong>Error:</strong> Your %1$s file is not <a href="%2$s">writable</a>, so updating it automatically was not possible. This is the URL rewrite rule you should have in your %1$s file. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this rule inside of the %5$s element in %1$s file.'=>'<strong>Kļūda:</strong> jūsu %1$s fails nav <a href="%2$s">rakstāms</a>, tāpēc nebija iespējams to automātiski atjaunot. Šis ir URL pārrakstīšanas noteikums, kam ir jābūt failā %1$s. Noklikšķiniet laukā un nospiediet %3$s (vai %4$s operētājsistēmā Mac), lai atlasītu visu. Pēc tam ievietojiet šo noteikumu %5$s elementā failā %1$s.','An avatar is an image that can be associated with a user across multiple websites. In this area, you can choose to display avatars of users who interact with the site.'=>'Avatārs(tēls) ir attēls, ko var saistīt ar lietotāju vairākās vietnēs. Šajā apgabalā varat izvēlēties rādīt to lietotāju avatārus, kuri mijiedarbojas ar vietni.','Howdy ###USERNAME###,

