####SITEURL####','Change Permalink Structure'=>'Mainīt pastāvīgās saites struktūru','Where your data is sent'=>'Kur tiek nosūtīti jūsu dati','Some data that describes the error your site encountered has been put together.'=>'Ir apkopoti daži dati, kas apraksta jūsu vietnē konstatēto kļūdu.','Copy &#8220;%s&#8221; URL to clipboard'=>'Kopēt “%s” URL uz starpliktuvi','An attempt was made, but your site could not be updated automatically.'=>'Mēģinājums tika veikts, taču jūsu vietni nevarēja automātiski atjaunināt.','themeActive'=>'Aktīvs','The update cannot be installed because some files could not be copied. This is usually due to inconsistent file permissions.'=>'Atjauninājumu nevar instalēt, jo dažus failus nevarēja nokopēt. Parasti tas ir saistīts ar nekonsekventām failu atļaujām.','<strong>Media</strong> &mdash; A list of URLs for media files the user uploads.'=>'<strong>Multivide</strong> — Lietotāja augšupielādēto multivides failu vietrāžu URL saraksts.','<strong>Community Events Location</strong> &mdash; The IP Address of the user, which populates the Upcoming Community Events dashboard widget with relevant information.'=>'<strong>Kopienas notikumu vieta</strong> — Lietotāja IP adrese, kas aizpilda gaidāmo kopienas notikumu informācijas paneļa logrīku ar atbilstošu informāciju.','WordPress collects (but <em>never</em> publishes) a limited amount of data from registered users who have logged in to the site. Generally, these users are people who contribute to the site in some way -- content, store management, and so on. With rare exceptions, these users do not include occasional visitors who might have registered to comment on articles or buy products. The data WordPress retains can include:'=>'WordPress apkopo (bet <em>nekad</em> nepublicē) ierobežotu datu apjomu no reģistrētajiem lietotājiem, kuri ir pieteikušies vietnē. Parasti šie lietotāji ir cilvēki, kas kaut kādā veidā veicina vietnes izveidi — saturu, veikala pārvaldību utt. Ar retiem izņēmumiem šie lietotāji neietver neregulārus apmeklētājus, kuri varētu būt reģistrējušies, lai komentētu rakstus vai iegādātos produktus. Dati, ko WordPress saglabā, var ietvert:','Note: Since this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with export requests. For example, you should also send the requester some of the data collected from or stored with the 3rd party services your organization uses.'=>'Piezīme. Tā kā šis rīks apkopo datus tikai no WordPress un iesaistītajiem spraudņiem, iespējams, jums būs jādara vairāk, lai izpildītu eksporta pieprasījumus. Piemēram, jums arī jānosūta pieprasītājam daži dati, kas savākti no jūsu organizācijā izmantotajiem trešās puses pakalpojumiem vai saglabāti tajos.','Privacy Laws around the world require businesses and online services to provide an export of some of the data they collect about an individual, and to deliver that export on request. The rights those laws enshrine are sometimes called the "Right of Data Portability". It allows individuals to obtain and reuse their personal data for their own purposes across different services. It allows them to move, copy or transfer personal data easily from one IT environment to another.'=>'Konfidencialitātes likumi visā pasaulē nosaka, ka uzņēmumiem un tiešsaistes pakalpojumiem ir jānodrošina dažu datu, ko tie apkopo par personu, eksportēšana un pēc pieprasījuma jāpiegādā šis eksports. Tiesības, kas noteiktas šajos likumos, dažreiz tiek sauktas par "datu pārnesamības tiesībām". Tas ļauj personām iegūt un atkārtoti izmantot savus personas datus saviem mērķiem dažādos pakalpojumos. Tas ļauj ērti pārvietot, kopēt vai pārsūtīt personas datus no vienas IT vides uz citu.','<strong>Comments</strong> &mdash; WordPress does not delete comments. The software does anonymize (but, again, <em>never</em> publishes) the associated Email Address, IP Address, and User Agent (Browser/OS).'=>'<strong>Komentāri</strong> — WordPress neizdzēš komentārus. Programmatūra anonimizē (bet atkal <em>nekad</em> nepublicē) saistīto e-pasta adresi, IP adresi un lietotāja aģentu (pārlūku/OS).','WordPress collects (but <em>never</em> publishes) a limited amount of data from logged-in users but then deletes it or anonymizes it. That data can include:'=>'WordPress apkopo (bet <em>nekad</em>nepublicē) ierobežotu datu apjomu no lietotājiem kas pieteikušies, bet pēc tam datus dzēš vai anonimizē. Šie dati var ietvert:','Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with erasure requests. For example, you are also responsible for ensuring that data collected by or stored with the 3rd party services your organization uses gets deleted.'=>'Piezīme. Tā kā šis rīks apkopo datus tikai no WordPress un iesaistītajiem spraudņiem, iespējams, jums būs jādara vairāk, lai izpildītu dzēšanas pieprasījumus. Piemēram, jūs esat atbildīgs arī par to, lai tiktu dzēsti dati, ko savākuši vai glabā ar trešās puses pakalpojumi, kurus izmanto jūsu organizācija.','Privacy Laws around the world require businesses and online services to delete, anonymize, or forget the data they collect about an individual. The rights those laws enshrine are sometimes called the "Right to be Forgotten".'=>'Privātuma likumi visā pasaulē nosaka, ka uzņēmumiem un tiešsaistes pakalpojumiem ir jādzēš, jāanonimizē vai jāaizmirst savāktie dati par personu. Tiesības, kas noteiktas šajos likumos, dažreiz tiek sauktas par "tiesībām tikt aizmirstam".','This screen is where you manage requests to erase personal data.'=>'Šajā ekrānā jūs pārvaldāt personas datu dzēšanas pieprasījumus.','This post is being backed up in your browser, just in case.'=>'Katram gadījumam šī ziņa tiek dublēta jūsu pārlūkprogrammā.','This will grant access to <a href="%1$s">the %2$s site on the network as you have Super Admin rights</a>.'=>'Tādējādi tiks piešķirta piekļuve <a href="%1$s">vietnēm %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.' . "\0" . 'Tādējādi tiks piešķirta piekļuve <a href="%1$s">vietnei %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.' . "\0" . 'Tādējādi tiks piešķirta piekļuve <a href="%1$s">vietnēm %2$s tīklā, jo jums ir galvenā administratora tiesības</a>.','Learn about block themes'=>'Uzziniet par bloku tēmām','There is a new kind of WordPress theme, called a block theme, that lets you build the site you&#8217;ve always wanted &#8212; with blocks and styles.'=>'Ir jauna veida WordPress tēma, ko sauc par bloku tēmu, kas ļauj izveidot vietni tā, kā vienmēr esat vēlējies &#8212; ar blokiem un stiliem.','Learn more about the %s version.'=>'Uzziniet vairāk par %s versiju.','Author rich content with blocks and patterns'=>'Radiet bagātīgu saturu, izmantojot blokus un modeļus','Add a new page'=>'Pievienojiet jaunu lapu','Customize your entire site with block themes'=>'Pielāgojiet visu savu vietni, izmantojot bloku tēmas','Design everything on your site &#8212; from the header down to the footer, all using blocks and patterns.'=>'Izveidojiet visu savā vietnē — no galvenes līdz kājenei, izmantojot blokus un modeļus.','Open site editor'=>'Atveriet vietnes redaktoru','Start Customizing'=>'Sāciet pielāgošanu','Configure your site&#8217;s logo, header, menus, and more in the Customizer.'=>'Pielāgošanas rīkā iestatiet savas vietnes logotipu, galveni, izvēlnes un daudz ko citu.','Open the Customizer'=>'Atveriet pielāgotāju','Tweak your site, or give it a whole new look! Get creative &#8212; how about a new color palette or font?'=>'Uzlabojiet savu vietni vai piešķiriet tai pilnīgi jaunu izskatu! Esiet radošs — kā būtu ar jaunu krāsu paleti vai fontu?','Discover a new way to build your site.'=>'Atklājiet jaunu veidu, kā izveidot savu vietni.','Block patterns are pre-configured block layouts. Use them to get inspired or create new pages in a flash.'=>'Bloku modeļi ir iepriekš konfigurēti bloku izkārtojumi. Izmantojiet tos, lai gūtu iedvesmu vai zibenīgi veidotu jaunas lapas.','Switch up your site&#8217;s look & feel with Styles'=>'Izmantojot stilus, mainiet vietnes izskatu un noskaņu','WordPress is free and open source software'=>'WordPress ir bezmaksas un atvērtā pirmkoda programmatūra','Theme File Editor'=>'Tēmas failu redaktors','Plugin File Editor'=>'Spraudņa failu redaktors','g:i a T'=>'G:i T','The application password feature requires HTTPS, which is not enabled on this site.'=>'Lietojumprogrammas paroles funkcijai ir nepieciešams HTTPS, kas šajā vietnē nav iespējots.','<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Documentation on Editing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Tēmu rediģēšanas dokumentācija</a>','<a href="https://wordpress.org/documentation/article/site-health-screen/">Documentation on Site Health tool</a>'=>'<a href="https://wordpress.org/documentation/article/site-health-screen/">Dokumentācija par vietnes veselības rīku</a>','In the Info tab, you will find all the details about the configuration of your WordPress site, server, and database. There is also an export feature that allows you to copy all of the information about your site to the clipboard, to help solve problems on your site when obtaining support.'=>'Cilnē Informācija atradīsit visu informāciju par savas WordPress vietnes, servera un datu bāzes konfigurāciju. Ir arī eksportēšanas funkcija, kas ļauj kopēt visu informāciju par jūsu vietni starpliktuvē, lai palīdzētu atrisināt problēmas jūsu vietnē, saņemot atbalstu.','In the Status tab, you can see critical information about your WordPress configuration, along with anything else that requires your attention.'=>'Cilnē Statuss varat skatīt svarīgu informāciju par savu WordPress konfigurāciju, kā arī visu citu, kam jāpievērš uzmanība.','This screen allows you to obtain a health diagnosis of your site, and displays an overall rating of the status of your installation.'=>'Šis ekrāns ļauj iegūt jūsu vietnes veselības diagnozi un parāda kopējo instalācijas statusa novērtējumu.','<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Documentation on Privacy Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Konfidencialitātes iestatījumu dokumentācija</a>','This screen includes suggestions to help you write your own privacy policy. However, it is your responsibility to use these resources correctly, to provide the information required by your privacy policy, and to keep this information current and accurate.'=>'Šajā ekrānā ir ietverti ieteikumi, kas palīdzēs jums izveidot savu privātuma politiku. Tomēr jūsu pienākums ir pareizi izmantot šos resursus, sniegt informāciju, kas prasīta jūsu privātuma politikā, un nodrošināt šīs informācijas aktualitāti un precizitāti.','The Privacy screen lets you either build a new privacy-policy page or choose one you already have to show.'=>'Ekrānā Konfidencialitāte varat izveidot jaunu konfidencialitātes politikas lapu vai izvēlēties jau izveidoto lapu, kuru vēlaties parādīt.','Individual posts may override these settings. Changes here will only be applied to new posts.'=>'Atsevišķas ziņas var ignorēt šos iestatījumus. Šeit veiktās izmaiņas tiks piemērotas tikai jaunajām ziņām.','The Dashboard is the first place you will come to every time you log into your site. It is where you will find all your WordPress tools. If you need help, just click the &#8220;Help&#8221; tab above the screen title.'=>'Informācijas panelis ir pirmā vieta, kur jūs nonāksit ikreiz, kad piesakāties savā vietnē. Šeit jūs atradīsiet visus savus WordPress rīkus. Ja jums nepieciešama palīdzība, vienkārši noklikšķiniet uz “Palīdzība” cilni virs ekrāna nosaukuma.','Menu item removed'=>'Izvēlnes vienums ir noņemts','Menu item moved to the top'=>'Izvēlnes vienums ir pārvietots uz augšu','The application ID must be a UUID.'=>'Lietojumprogrammas ID ir jābūt UUID.','Welcome to your WordPress Dashboard!'=>'Laipni lūdzam jūsu WordPress informācijas panelī!','Select location'=>'Izvēlieties atrašanās vietu','Max allowed packet size'=>'Maksimālais atļautais paketes lielums','Max connections number'=>'Maksimālais savienojumu skaits','pluginCannot Activate'=>'Nevar aktivizēt','Visit plugin site for %s'=>'Apmeklējiet %s spraudņa vietni','Your website appears to use Basic Authentication, which is not currently compatible with application passwords.'=>'Šķiet, ka jūsu vietnē tiek izmantota pamata autentifikācija, kas pašlaik nav saderīga ar lietojumprogrammu parolēm.','%1$s &#8220;%2$s&#8221;'=>'%1$s “%2$s”','Template Editing'=>'Veidnes rediģēšana','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals.'=>'WordPress ir izveidojusi <a href="%1$s">aizrautīgu cilvēku vispasaules komanda</a>.','Get involved in WordPress.'=>'Iesaistieties WordPress','Want to see your name in lights on this page?'=>'Vai vēlaties redzēt savu vārdu šajā lapā?','WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'WordPress ir aprīkots ar dažām lieliskām, pasaules uzskatus mainošām tiesībām, ko nodrošina tā <a href="%s">licence</a>, GPL.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s, please upgrade to %1$s %4$s or later.'=>'%1$s %2$s tika deaktivizēts nesaderības dēļ ar WordPress %3$s, lūdzu, atjaunojiet to uz %1$s %4$s vai jaunāku.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s.'=>'%1$s %2$s tika deaktivizēts nesaderības dēļ ar WordPress %3$s.','%s plugin deactivated during WordPress upgrade.'=>'%s spraudnis deaktivizēts WordPress jaunināšanas laikā.','The Four Freedoms'=>'Četras brīvības','We take privacy and transparency very seriously'=>'Mēs ļoti nopietni izturamies pret privātumu un pārredzamību','themeView Theme Details for %s'=>'Skatīt detalizētu informāciju par tēmu %s','themeCustomize %s'=>'Pielāgot %s','themeLive Preview %s'=>'Tiešraides priekšskatījums %s','themeDelete %s'=>'Dzēst %s','You need to make the file %1$s writable before you can save your changes. See <a href="%2$s">Changing File Permissions</a> for more information.'=>'Pirms izmaiņu saglabāšanas fails %1$s ir jāpadara rakstāms. Lai iegūtu vairāk informācijas, skatiet <a href="%2$s">Faila atļauju maiņa</a>.','Site Health - %s'=>'Vietnes veselība - %s','Toggle extra menu items'=>'Pārslēdziet papildu izvēlnes vienumus','Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.'=>'Internet Explorer nesniedz vislabāko WordPress pieredzi. Pārejiet uz Microsoft Edge vai citu modernāku pārlūkprogrammu, lai vietni izmantotu pēc iespējas labāk.','Learn how to <a href="%s" class="update-browser-link">browse happy</a>'=>'Uzzini, kā <a href="%s" class="update-browser-link">browse happy</a>','Your site has a critical issue that should be addressed as soon as possible to improve its performance and security.'=>'Jūsu vietnē ir kritiska problēma, kas jārisina pēc iespējas ātrāk, lai uzlabotu tās veiktspēju un drošību.','Your site&#8217;s health is looking good, but there is still one thing you can do to improve its performance and security.'=>'Jūsu vietnes stāvoklis ir labs, taču ir vēl viena lieta, ko varat darīt, lai uzlabotu tās veiktspēju un drošību.','The %s post meta must be an array.'=>'Parametram %s post meta jābūt masīvam.','Unable to encode the personal data for export. Error: %s'=>'Nav iespējams kodēt personas datus eksportam. Kļūda: %s','Themes %s'=>'Tēmas %s','item %s'=>'vienums %s','Deleted menu item: %s.'=>'Dzēsts izvēlnes vienums: %s.','Bulk Select'=>'Lielapjoma atlase','Remove Selected Items'=>'Noņemt atlasītos vienumus','List of menu items selected for deletion:'=>'Dzēšanai atlasīto izvēlnes vienumu saraksts:','Rewrite rules:'=>'Pārrakstiet noteikumus:','pluginCurrent'=>'Pašreizējais','pluginUploaded'=>'Augšupielādēts','pluginReplace current with uploaded'=>'Aizstāt pašreizējo ar augšupielādēto','themeUploaded'=>'Augšupielādēta','Imagick version'=>'Imagick versija','ImageMagick supported file formats'=>'ImageMagick atbalstītie failu formāti','Please activate the <a href="%s">Link Manager plugin</a> to use the link manager.'=>'Lūdzu, aktivizējiet <a href="%s"> saišu pārvaldnieka spraudni </a>, lai izmantotu saišu pārvaldnieku.','Unable to determine'=>'Nevar noteikt','GD supported file formats'=>'GD atbalstītie failu formāti','Create a new Privacy Policy page'=>'Izveidot jaunu konfidencialitātes politikas lapu','This tool helps site owners comply with local laws and regulations by exporting known data for a given user in a .zip file.'=>'Šis rīks palīdz vietņu īpašniekiem ievērot vietējos likumus un noteikumus, eksportējot zināmus datus par konkrētu lietotāju .zip failā.','Send personal data export confirmation email.'=>'Nosūtiet personas datu eksportēšanas apstiprinājuma e-pastu.','<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Documentation on Export Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Dokumentācija par personas datu eksportēšanu</a>','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Export Personal Data request should include data from plugins as well.'=>'Daudzi spraudņi var apkopot vai uzglabāt personas datus vai nu WordPress datu bāzē, vai attālināti. Jebkurā personas datu eksportēšanas pieprasījumā jāiekļauj arī dati no spraudņiem.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Ja neesat pārliecināts, pārbaudiet spraudņa dokumentāciju vai sazinieties ar spraudņa autoru, lai uzzinātu, vai spraudnis apkopo datus un vai tas atbalsta datu eksportētāja r