onimizējot zināmus datus par konkrētu lietotāju.','Confirmation email'=>'Apstiprinājuma e-pasts','Send personal data erasure confirmation email.'=>'Nosūtiet personas datu dzēšanas apstiprinājuma e-pastu.','Re-install version %s'=>'Atkārtoti instalējiet versiju %s','Update to latest %s nightly'=>'Atjaunināt uz jaunāko %s nakts būvējumu','<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Documentation on Erase Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Dokumentācija par personas datu dzēšanu</a>','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Erase Personal Data request should delete data from plugins as well.'=>'Daudzi spraudņi var apkopot vai uzglabāt personas datus vai nu WordPress datu bāzē, vai attālināti. Jebkuram personas datu dzēšanas pieprasījumam vajadzētu izdzēst datus arī no spraudņiem.','Plugin Data'=>'Spraudņa dati','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'Ja neesat pārliecināts, pārbaudiet spraudņa dokumentāciju vai sazinieties ar spraudņa autoru, lai uzzinātu, vai spraudnis apkopo datus un vai tas atbalsta rīku Data Eraser. Šī informācija var būt pieejama <a href="%s">konfidencialitātes politikas ceļvedī</a>.','<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.'=>'<strong>Multivide</strong> &mdash; Visu lietotāja veikto multivides failu augšupielāžu vietrāžu URL saraksts.','<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.'=>'<strong>Sesijas marķieri</strong> &mdash; Lietotāja pieteikšanās informācija, IP adreses, derīguma termiņš, lietotāja aģents (pārlūks un OS) un pēdējā pieteikšanās.','<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.'=>'<strong>Kopienas notikumu atrašanās vieta</strong> &mdash; Lietotāja IP adrese, kas tiek izmantota gaidāmajos kopienas pasākumos, kas parādīti informācijas paneļa logrīkā.','<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.'=>'<strong>Informācija par profilu</strong> &mdash; lietotāja e-pasta adrese, lietotājvārds, parādāmais vārds, segvārds, vārds, uzvārds, apraksts / biogrāfija un reģistrācijas datums.','Default Data'=>'Noklusējuma dati','The tool associates data stored in WordPress with a supplied email address, including profile data and comments.'=>'Rīks WordPress saglabātos datus saista ar norādīto e-pasta adresi, ieskaitot profila datus un komentārus.','Want more events? <a href="%s">Help organize the next one</a>!'=>'Vai vēlaties vairāk pasākumu? <a href="%s">Palīdziet organizēt nākamo!</a>','https://make.wordpress.org/community/organize-event-landing-page/'=>'https://make.wordpress.org/community/organize-event-landing-page/','Cannot send password reset, permission denied.'=>'Nevar nosūtīt paroles atiestatīšanu, atļauja ir liegta.','A password reset link was emailed to %s.'=>'Paroles atiestatīšanas saite tika nosūtīta uz e-pasta adresi %s.','The setting for %1$s is currently configured as 0, this could cause some problems when trying to upload files through plugin or theme features that rely on various upload methods. It is recommended to configure this setting to a fixed value, ideally matching the value of %2$s, as some upload methods read the value 0 as either unlimited, or disabled.'=>'%1$s iestatījums pašlaik ir konfigurēts kā 0, tas var radīt dažas problēmas, mēģinot augšupielādēt failus, izmantojot spraudņa vai tēmas funkcijas, kas balstās uz dažādām augšupielādes metodēm. 