 jaunāko nakts versiju:','Enable automatic updates for all new versions of WordPress.'=>'Iespējot automātiskos jauninājumus visām jaunajām WordPress versijām.','Switch to automatic updates for maintenance and security releases only.'=>'Iespējot automātiskos jauninājumus tikai apkopes un drošības laidieniem.','Current version: %s'=>'Pašreizējā versija: %s','This site will not receive automatic updates for new versions of WordPress.'=>'Šī vietne nesaņems automātiskus jauninājumus jaunām WordPress versijām.','This site is automatically kept up to date with maintenance and security releases of WordPress only.'=>'Šajā vietnē automātiski tiek jaunināti vienīgi WordPress uzturēšanas un drošības laidieni.','This site is automatically kept up to date with each new version of WordPress.'=>'Šajā vietnē automātiski tiek jaunināta katra jaunā WordPress versija.','WordPress will only receive automatic security and maintenance releases from now on.'=>'Turpmāk WordPress saņems tikai automātiskus drošības un uzturēšanas izlaidumus.','Automatic updates for all WordPress versions have been enabled. Thank you!'=>'Ir iespējoti automātiskie jauninājumi visām WordPress versijām. Paldies!','<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.'=>'<strong>Vietnes veselības stāvoklis</strong> &mdash; Informē jūs par visiem iespējamiem jautājumiem, kas būtu jārisina, lai uzlabotu jūsu vietnes veiktspēju vai drošību.','Your new password for %s is:'=>'Jaunā parole lietotājam %s ir:','Add New Application Password'=>'Pievienot jaunu lietojumprogrammas paroli','Required to create an Application Password, but not to update the user.'=>'Nepieciešams, lai izveidotu lietojumprogrammas paroli, bet ne lietotāja atjaunināšanai.','Go to Updates'=>'Atvērt sadaļu Jauninājumi','&larr; Go to Users'=>'&larr; Atvērt sadaļu Llietotāji','&larr; Go to editor'=>'&larr; Atvērt redaktoru','Go to Plugin Installer