 indexing this site&#8221; and click the Save Changes button at the bottom of the screen.'=>'Jūs varat izvēlēties, vai jūsu vietni pārmeklēs roboti, ping pakalpojumi un zirnekļi. Ja vēlaties, lai šie pakalpojumi ignorētu jūsu vietni, klikšķiniet uz izvēles rūtiņas blakus &#8220;Atturēt meklētājprogrammas indeksēt šo vietni&#822; un ekrāna apakšdaļā klikšķiniet pogu Saglabāt izmaiņas.','The "%1$s" value is smaller than "%2$s"'=>'Vērtība "%1$s" ir mazāka par vērtību "%2$s".','Environment type'=>'Vides tips','Auto-updates are only available for plugins recognized by WordPress.org, or that include a compatible update system.'=>'Automātiskie jauninājumi ir pieejami tikai tiem spraudņiem, kurus ir atpazinis WordPress.org, vai kas ietver saderīgu atjaunināšanas sistēmu.','Update Incompatible'=>'Jaunināšana nav saderīga','This update does not work with your version of WordPress.'=>'Šis jauninājums nedarbojas ar jūsu WordPress versiju.','This update does not work with your versions of WordPress and PHP.'=>'Šis atjauninājums nedarbojas ar jūsu WordPress un PHP versijām.','Disallowed Comment Keys'=>'Neatļautās komentāru atslēgas','Plugin and theme auto-updates'=>'Spraudņa un tēmas automātiskā jaunināšana','There appear to be no issues with plugin and theme auto-updates.'=>'Šķiet, ka nav problēmu ar spraudņa un tēmu automātisko jaunināšanu.','Auto-updates for themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'Automātiskā tēmu jaunināšana, šķiet, ir atspējota. Tas neļaus jūsu vietnei automātiski saņemt jaunas versijas, kad tās būs pieejamas.','Auto-updates for plugins appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'Šķiet, ka spraudņu automātiskā jaunināšana ir atspējota. Tas neļaus jūsu vietnei automātiski saņemt jaunas versijas, kad tās būs pieejamas.','Auto-updates for plugins and themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'Šķiet, ka spraudņu un tēmu automātiskā jaunināšana ir atspējota. Tas neļaus jūsu vietnei automātiski saņemt jaunas versijas, kad tās būs pieejamas.','Auto-updates for plugins and/or themes appear to be disabled, but settings are still set to be displayed. This could cause auto-updates to not work as expected.'=>'Šķiet, ka spraudņu un / vai tēmu automātiskā jaunināšana ir atspējota, taču iestatījumos joprojām tiek rādīta. Tas var izraisīt automātiskās atjaunināšanas nedarbošanos, kā paredzēts.','Your site may have problems auto-updating plugins and themes'=>'Jūsu vietnei var būt problēmas ar spraudņu un tēmu automātisku jaunināšanu','Plugin and theme auto-updates ensure that the latest versions are always installed.'=>'Spraudņu un tēmu automātiskie jauninājumi nodrošina, ka vienmēr tiek instalētas jaunākās versijas.','Plugin and theme auto-updates appear to be configured correctly'=>'Šķiet, ka spraudņu un tēmu automātiskie jauninājumi ir konfigurēti pareizi ','themeActivate &#8220;%s&#8221;'=>'Aktivizēt &#8220;%s&#8221;','Sorry, you are not allowed to modify plugins.'=>'Diemžēl jums nav atļauts modificēt spraudņus.','The setting for %1$s is smaller than %2$s, this could cause some problems when trying to upload files.'=>' %1$s iestatījums ir mazāks par  %2$s, tas var radīt dažas problēmas, mēģinot augšupielādēt failus.','%1$s is set to %2$s. You won\'t be able to upload files on your site.'=>' %1$s ir iestatīts uz %2$s. Jūs nevarēsiet augšupielādēt failus savā vietnē.','The %s function has been disabled, some media settings are unavailable because of this.'=>'Funkcija %s ir atspējota, tāpēc daži multivides iestatījumi nav pieejami.','The %1$s directive in %2$s determines if uploading files is allowed on your site.'=>' %1$s direktīva  %2$s nosaka, vai failu augšupielāde ir atļauta jūsu vietnē.','Max effective file size'=>'Maksimālais faktiskais datnes lielums','Max size of an uploaded file'=>'Maksimālais augšupielādētā faila lielums','Max size of post data allowed'=>'Maksimālais atļauto ziņas datu lielums','File uploads'=>'Failu augšupielāde','File upload settings'=>'Failu augšupielādes iestatījumi','Files can be uploaded'=>'Failus var augšupielādēt.','themeCannot Install %s'=>'Nevar instalēt %s','pluginInstall %s'=>'Instalējiet %s','themeInstall %s'=>'Instalējiet %s','themeUpdate %s now'=>'Jaunināt %s tūlīt','- %1$s version %2$s'=>'- %1$s versija %2$s','themeActivated'=>'Aktivizēts','Sorry, you are not allowed to enable themes automatic updates.'=>'Diemžēl jums nav ļauts iespējot tēmu automātiskos jauninājumus.','This plugin is already installed.'=>'Šis spraudnis jau ir instalēts.','pluginUpdate %s now'=>'Jaunināt %s tūlīt','pluginInstall %s now'=>'Instalējiet %s tūlīt','Dismiss this notice.'=>'Noraidīt šo paziņojumu.','themeCannot Activate %s'=>'Nevar aktivizēt %s','Theme will be auto-updated.'=>'Tēma tiks automātiski atjaunināts.','Theme will no longer be auto-updated.'=>'Tēma vairs netiks automātiski atjaunināts.','Auto-updates can be enabled or disabled for each individual theme. Themes with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'Automātiskos jauninājumus var iespējot vai atspējot katrai tēmai atsevišķi. Tēmām ar iespējotu automātisko jaunināšanu tiks parādīts nākamās automātiskās jaunināšanas aptuvenais datums. Automātiskā jaunināšana ir atkarīga no WP-Cron uzdevumu plānošanas sistēmas.','Error in deleting the item.'=>'Dzēšot vienumu, radās kļūda.','Sorry, you are not allowed to manage plugins automatic updates.'=>'Diemžēl jums nav ļauts pārvaldīt spraudņu automātiskos jauninājumus.','Sorry, you are not allowed to disable themes automatic updates.'=>'Diemžēl jums nav ļauts atspējot tēmu automātiskos jauninājumus.','Error in restoring the item from Trash.'=>'Atjaunojot vienumu no atkritnes, radās kļūda.','Error in moving the item to Trash.'=>'Pārvietojot vienumu uz atkritni, radās kļūda.','Selected plugins will no longer be auto-updated.'=>'Atlasītie spraudņi vairs netiks automātiski jaunināti.','Selected plugins will be auto-updated.'=>'Atlasītie spraudņi tiks automātiski jaunināti.','Plugin will no longer be auto-updated.'=>'Spraudnis vairs netiks automātiski jaunināts.','Plugin will be auto-updated.'=>'Spraudnis tiks automātiski jaunināts.','Auto-updates can be enabled or disabled for each individual plugin. Plugins with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'Automātisko jaunināšanu var iespējot vai atspējot katram atsevišķam spraudnim. Spraudņi ar iespējotu automātisko jaunināšanu parādīs nākamās automātiskās jaunināšanas paredzamo datumu. Automātiskā jaunināšana ir atkarīga no WP-Cron uzdevumu plānošanas sistēmas.','Please connect to your network admin to manage plugins automatic updates.'=>'Lūdzu, izveidojiet savienojumu ar tīkla administratoru, lai pārvaldītu spraudņu automātiskos jauninājumus.','The admin email verification page will reappear after %s.'=>'Administratora e-pasta verifikācijas lapa atkal parādīsies pēc %s.','Auto-updates'=>'Automātiski jauninājumi','Please note: Third-party themes and plugins, or custom code, may override WordPress scheduling.'=>'Lūdzu, ņemiet vērā: trešo pušu tēmas un spraudņi vai pielāgots kods var ignorēt WordPress plānošanu.','Auto-updates can be enabled or disabled for WordPress major versions and for each individual theme or plugin. Themes or plugins with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'Automātiskos jauninājumus var iespējot vai atspējot WordPress galvenajām versijām un katrai atsevišķai tēmai vai spraudnim. Tēmās vai spraudņos ar iespējotu automātisko jaunināšanu tiks parādīts aptuvenais nākamās automātiskās jaunināšanas datums. Automātiskā jaunināšana ir atkarīga no WP-Cron uzdevumu plānošanas sistēmas.','<strong>Important:</strong> Before updating, please <a href="%1$s">back up your database and files</a>. For help with updates, visit the <a href="%2$s">Updating WordPress</a> documentation page.'=>'<strong>Svarīgi:</strong> pirms jaunināšanas, lūdzu, <a href="%1$s">dublējiet datu bāzi un failus</a>. Lai saņemtu palīdzību par jauninājumiem, apmeklējiet <a href="%2$s">WordPress jaunināšanas</a> dokumentācijas lapu.','themeCannot Activate'=>'Nevar aktivizēt','media itemSuccess'=>'Panākumi','You cannot edit this comment because the associated post is in the Trash. Please restore the post first, then try again.'=>'Jūs nevarat rediģēt šo komentāru, jo saistītā ziņa atrodas atkritnē. Lūdzu, vispirms atjaunojiet ziņu un pēc tam mēģiniet vēlreiz.','plugin<strong>Error:</strong> Current WordPress version (%1$s) does not meet minimum requirements for %2$s. The plugin requires WordPress %3$s.'=>'<strong>Kļūda:</strong> pašreizējā WordPress versija (%1$s) neatbilst minimālajām prasībām attiecībā uz %2$s. Spraudnim nepieciešama WordPress %3$s.','plugin<strong>Error:</strong> Current PHP version (%1$s) does not meet minimum requirements for %2$s. The plugin requires PHP %3$s.'=>'<strong>Kļūda:</strong> pašreizējā PHP versija (%1$s) neatbilst minimālajām prasībām attiecībā uz %2$s. Spraudnim nepieciešama PHP %3$s.','plugin<strong>Error:</strong> Current versions of WordPress (%1$s) and PHP (%2$s) do not meet minimum requirements for %3$s. The plugin requires WordPress %4$s and PHP %5$s.'=>'<strong>Kļūda:</strong> pašreizējā WordPress (%1$s) un PHP (%2$s) versijas neatbilst minimālajām prasībām attiecībā uz %3$s. Spraudnim nepieciešama WordPress %4$s un PHP %5$s.','Invalid data. The item does not exist.'=>'Dati nav derīgi. Vienums nepastāv.','Invalid data. Unknown type.'=>'Dati nav derīgi. Nezināms tips.','Invalid data. Unknown state.'=>'Dati nav derīgi. Nezināms stāvoklis.','Invalid data. No selected item.'=>'Dati nav derīgi. Nav atlasīta vi