our website does not use HTTPS'=>'Jūsu vietne neizmanto HTTPS','Your website is using an active HTTPS connection'=>'Jūsu vietne izmanto aktīvu HTTPS savienojumu.','You are accessing this website using HTTPS, but your <a href="%s">Site Address</a> is not set up to use HTTPS by default.'=>'Jūs piekļūstat šai vietnei, izmantojot HTTPS, bet jūsu <a href="%Vietnes adrese</a> nav iestatīta, lai pēc noklusējuma lietotu HTTPS.','Your site is set to display errors to site visitors'=>'Jūsu vietne iestatīta, lai parādītu kļūdas vietnes apmeklētājiem','The value, %s, has been added to this website&#8217;s configuration file. This means any errors on the site will be written to a file which is potentially available to all users.'=>'%s vērtība ir pievienota vietnes konfigurācijas datnei. Tas nozīmē, ka jebkura vietnes kļūda tiks ierakstīta datnē, kura potenciāli ir pieejama ikvienam lietotājam.','Debug mode is often enabled to gather more details about an error or site failure, but may contain sensitive information which should not be available on a publicly available website.'=>'Atkļūdošanas režīms bieži tiek iespējots, lai savāktu vairāk informācijas par kļūdu vai vietnes kļūmi, taču tas var saturēt sensitīvu informāciju, kurai nevajadzētu būt publiski pieejamai.','Your site is set to log errors to a potentially public file'=>'Jūsu vietne ir iestatīta tā, lai kļūdas tiktu reģistrētas potenciāli publiski pieejamā failā.','Your site is not set to output debug information'=>'Jūsu vietne nav iestatīta, lai izvadītu atkļūdošanas informāciju','Can communicate with WordPress.org'=>'Var komunicēt ar WordPress.org','Could not reach WordPress.org'=>'Nevarēja sasniegt WordPress.org','Your site is unable to reach WordPress.org at %1$s, and returned the error: %2$s'=>'Jūsu vietne nevar sasniegt WordPress.org caur %1$s un atgriež kļūdu %2$s','Severely outdated SQL server'=>'Spēcīgi novecojis SQL serveris','Communicating with the WordPress servers is used to check for new versions, and to bot