as!','or <a href="%s">create a new menu</a>. Do not forget to save your changes!'=>'vai <a href="%s">izveidojiet jaunu izvēlni</a>. Neaizmirstiet saglabāt jūsu veiktās izmaiņas!','Create your first menu below.'=>'Izveidojiet savu pirmo izvēlni','You cannot install because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.'=>'Jūs nevarat uzstādīt, jo <a href="%1$s">WordPress %2$s</a> nepieciešama vizmaz %3$s MySQL versija. Jūs izmantojat versiju %4$s.','You cannot install because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.'=>'Jūs nevarat uzstādīt, jo <a href="%1$s">WordPress %2$s</a> nepieciešama vizmaz %3$s PHP versija. Jūs izmantojat versiju %4$s.','Learn more about updating PHP'=>'Uzziniet vairāk par PHP atjaunināšanu','What is PHP and how does it affect my site?'=>'Kas ir PHP un kā tas ietekmē manu vietni?','<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.'=>'<strong>Kļūda:</strong> Šim spraudnim <strong>nepieciešama jaunāka WordPress versija</strong>.','<a href="%s" target="_blank">Click here to learn more about updating PHP</a>.'=>'<a href="%s" target="_blank">Klikšķiniet šeit, lai uzzinātu vairāk par PHP atjaunināšanu</a>.','<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.'=>'<strong>Kļūda:</strong> Šim spraudnim <strong>nepieciešama jaunāka PHP versija</strong>.','<a href="%s" target="_parent">Click here to update WordPress</a>.'=>'<a href="%s" target="_parent">Klikšķiniet šeit, lai atjauninātu WordPress dzini</a>.','Add widget: %s'=>'Pievienot logrīku: %s','Could not resume the plugin.'=>'Nevarēja spraudni atsāknēt.','PHP Update Required'=>'Nepieciešams atjaunināt PHP','You can find more details and make changes on the Plugins screen.'=>'Varat atrast vairāk detaļu un varēsiet veikt izmaiņas spraudņu ekrānā.','One or more plugins failed to load properly.'=>'Viens vai vairāki spraudņi nevarēja pareizi ielādēties.','Custom PHP error message.'=>'Pielāgots PHP kļūdas ziņojums.','Could not remove the old translation.'=>'Neizdevās noņemt veco tulkojumu.','Removing the old version of the translation&#8230;'=>'Tiek noņemta tulkojuma vecā versija&#8230;','Add to: %s'=>'Pievienot pie: %s','Track %s.'=>'%s celiņš.','Custom PHP fatal error handler.'=>'Pielāgota PHP fatāla kļūdas apstrāde.','My Network'=>'Mans tīkls','This plugin does not work with your version of PHP.'=>'Šis spraudnis nedarbojas ar jūsu PHP versiju.','This plugin does not work with your version of WordPress.'=>'Šis spraudnis nedarbojas ar jūsu WordPress versiju.','This plugin does not work with your versions of WordPress and PHP.'=>'Šis spraudnis nedarbojas ar jūsu WordPress un PHP versiju.','https://wordpress.org/documentation/wordpress-version/version-%s/'=>'https://wordpress.org/documentation/wordpress-version/version-%s/','pluginResume %s'=>'Atsāknēt spraudni %s','Could not resume the theme.'=>'Nevarēja atsāknēt tēmu.','Resume'=>'Atsāknēt','One or more themes failed to load properly.'=>'Viena vai vairākas tēmas nevarēja pareizi ielādēties.','You can find more details and make changes on the Themes screen.'=>'Varat atrast vairāk detaļu un varēsiet veikt izmaiņas tēmu ekrānā.','Deleting a category does not delete the posts in that category. Instead, posts that were only assigned to the deleted category are set to the default category %s. The default category cannot be deleted.'=>'Dzēšot kategoriju, netiks izdzēstas tai pievienotās ziņas. Tā vietā, ziņas, kas bija piesaistītas tikai izdzēstajai kategorijai, tiks piesaistītas noklusējuma kategorijai %s. Noklusējuma kategoriju nevar izdzēst.','The block widgets require JavaScript. Please enable JavaScript in your browser settings, or install the <a href="%s">Classic Widgets plugin</a>.'=>'Bloka logrīkiem ir nepieciešams JavaScript. Lūdzu, pārlūka iestatījumos iespējojiet JavaScript vai instalējiet <a href="%s">Klasisko logrīku spraudni</a>.','A post type mismatch has been detected.'=>'Tika noteikta ziņas tipa nesaderība.','A post ID mismatch has been detected.'=>'Tika noteikta ziņas ID nesaderība.','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'Lūdzu atveriet <a href="%s">klasisko redaktoru</a>, lai izmantotu šo meta datu lauku.','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'Lūdzu aktivizējiet <a href="%s">Klasiskā redaktora spraudni</a>, lai izmantotu šo meta datu lauku.','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'Lūdzu uzstādiet <a href="%s">Klasiskā redaktora spraudni</a>, lai izmantotu šo meta datu lauku.','This meta box is not compatible with the block editor.'=>'Šis meta datu lauks nav savietojams ar bloku redaktoru.','The 1st Freedom'=>'Pirmā brīvība','The 2nd Freedom'=>'Otrā brīvība','The 3rd Freedom'=>'Trešā brīvība','The 4th Freedom'=>'Ceturtā brīvība','To redistribute.'=>'Izplatīt tālāk.','To distribute copies of your modified versions to others.'=>'Izplatīt jūsu modificēto versiju kopijas citiem.','To run the program for any purpose.'=>'Lietot programmu jebkādam nolūkam.','To study how the program works and change it to make it do what you wish.'=>'Izpētīt, kā programma darbojas, un mainīt to, lai tā darītu to, ko vēlaties.','Created'=>'Izveidots','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'Esiet sveicināts WordPress. Šī ir jūsu pirmā ziņa. Rediģējiet vai dzēsiet to, un tad sāciet rakstīt!','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'Kā jaunam WordPress lietotājam, jums vajadzētu doties uz <a href="%s">jūsu administrācijas paneli</a>, lai dzēstu šo lapu un izveidotu jaunas lapas savam saturam. Izklaidējieties!','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'Uzņēmums XYZ Doohickey tika dibināts 1917. gadā, un kopš tā laika tas sabiedrībai nodrošina kvalitatīvas, sīkas ierīces. XYZ, kas atrodas Gothemas pilsētā, nodarbina vairāk nekā 2000 cilvēku un nodarbojas ar dažādu satriecošu lietu izpildīšanu Gothemas sabiedrībai.','...or something like this:'=>'... vai kas tāds:','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'Sveiki! Dienas laikā esmu velo kurjers, naktī cenšos kļūt par aktieri un šī ir mana vietne. Es dzīvoju Losandželosā, man ir lielisks suns vārdā Džeks un man patīk dzert pina koladas. (Un iekļūt lietū.)','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'Šī ir piemēra lapa. Tā atšķiras no emuāra ziņas, jo paliks vienā vietā un tiks izvadīta jūsu vietnes navigācijā (vairumā tēmu). Lielākā daļa cilvēku sāk ar "Par mums" lapas izveidošanu, kura iepazīstina ar potenciālajiem vietnes apmeklētājiem. Tā varētu saturēt kaut ko līdzīgu šim:','Export &#8220;%s&#8221; as JSON'=>'Eksportēt &#8220;%s&#8221; kā JSON','1 pattern not updated, somebody is editing it.'=>'1 modelis netika atjaunots, kāds to rediģē.','%s pattern restored from the Trash.'=>'%s modeļi atjaunoti no atkritnes.' . "\0" . '%s modelis atjaunots no atkritnes.' . "\0" . '%s modeļi atjaunoti no atkritnes.','<strong>Error:</strong> "Table Prefix" must not be empty.'=>'<strong>Kļūda</strong>: "Tabulas prefikss" nedrīkst būt tukšs.','This meta box, from the %s plugin, is not compatible with the block editor.'=>'Šis %s spraudņa meta datu lauks nav savietojams ar bloku redaktoru.','page titleAbout'=>'Par','personal data group labelAbout'=>'Par','Privacy Policy Page'=>'Privātuma politikas lapa','%s (Draft)'=>'%s (Melnraksts)','<a href="%1$s">Edit</a> or <a href="%2$s">preview</a> your Privacy Policy page content.'=>'<a href="%1$s">Rediģēt</a> vai <a href="%2$s">priekšskatīt</a> jūsu privātuma politikas lapas saturu.','Privacy Policy page updated successfully.'=>'Privātuma politikas lapa veiksmīgi atjaunināta.','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'Iesakāmo privātuma politikas saturu vajadzētu pievienot, izmantojot %s (vai jaunāku) darbību. Lūdzu skatiet iekļauto dokumentāciju.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'Iesakāmo privātuma politikas saturu vajadzētu pievienot tikai wp-admin, izmantojot %s (vai jaunāku) darbību. ','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'Iesakāmais privātuma politikas saturs ir mainījies. Lūdzu <a href="%s">pārskatiet rokasgrāmatu</a> un atjaunojiet savu privātuma politiku.','There are no pages.'=>'Nav nevienas lapas.','Need help putting together your new Privacy Policy page? <a href="%1$s" %2$s>Check out our privacy policy guide%3$s</a> for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Nepieciešama palīdzība jaunās privātuma politikas lapas izveidē? <a href="%1$s" %2$s>Iepazīstieties ar šo ceļvedi %3$s</a>, lai saņemtu ieteikumus, ko iekļaut, kā arī redzētu kādus politikas papildinājumus iesaka pievienot jūsu izmantoto spraudņu un tēmu autori.','Privacy Policy Guide'=>'Privātuma politikas lapa','Visitor comments may be checked through an automated spam detection service.'=>'Apmeklētāja komentāri var tikt pārbaudīti ar automatizētu mēstuļu atpazīšanas pakalpojumu.','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'Šajā apakšsadaļā jums vajadzētu norādīt, kādu analītikas pakalpojumu jūs izmantojat, kā lietotāji var atteikties no tās, kā arī norādīt saiti uz analītikas nodrošinātāja privātuma politiku, ja tāda pieejama.','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'Šajā apakšsadaļā jums vajadzētu norādīt kādu informāciju lietotāji var nodot un izpaust, augšupielādējot multivides datnes. Parasti visas augšupielādētās datnes ir publiski pieejamas.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'Šajā apakšsekcijā jums būtu jānorāda kāda informācija tiek ievākta ar komentāriem. Mēs esam minējuši, kādus datus WordPress ievāc pēc noklusējuma.','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'Šajā sekcijā jums būtu jānorāda, kādu privāto informāciju jūs apkopojat par lietotājiem un apmeklētājiem. Šie dati varētu iekļaut vārdu, e-pasta adresi, konta preferences, darījumu informāciju, piemēram, datus par iegādātām precēm, kā arī tehniskus datus, piemēram informāciju par sīkdatnēm.','Suggested text:'=>'Ieteiktais teksts:','The template contains a suggestion of sections you most likely will need. Under each section heading, you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.'=>'Mēs esam ieteikuši sekcijas, kas varētu jums noderēt. Zem katras sekcijas virsraksta jūs atradīsiet īsu pārskatu tam, kādu informāciju jums būtu jānorāda, kas palīdzēs jums iesākt darbu. Dažas sekcijas iekļauj ieteiktu politikas saturu, citas būs jāaizpilda ar informāciju no jūsu tēmām un spraudņiem.','Updated %s.'=>'Atjaunināts: %s','Introduction'=>'Ievads','Removed %s.'=>'Noņemts %s.','You deactivated this plugin on %s and may no longer need this policy.'=>'Jūs deaktivizējāt šo spraudni %s un, iespējams, jums šī politika vairs nav vajadzīgā.','Need help putting together your new Privacy Policy page? Check out our guide for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'Nepieciešama palīdzība jaunās privātuma politikas lapas izveidē? Iepazīstieties ar šo ceļvedi, lai saņemtu ieteikumus, ko iekļaut, kā arī redzētu kādus politikas papildinājumus iesaka pievienot jūsu izmantoto spraudņu un tēmu autori.','Erasing data...'=>'Dzēš datus...','Add Data Erasure Request'=>'Pievienot Datu dzēšanas pieprasījumu','Send export link'=>'Sūtīt eksportēšanas saiti','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'Ja esat regulētas nozares dalībnieks vai uz jums attiecas papildus privātuma likumi, iespējams, jums šī informācija jāpublisko šeit.','Industry regulatory disclosure requirements'=>'Industrijas regulatora normatīvās prasības','If your website provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.'=>'Ja jūsu vietne nodrošina pakalpojumu, kas ietver automātisku lēmumu pieņemšanu, piemēram, ļaujot klientiem pieteikties kredītam vai apkopojot savus datus reklāmas profilā - jums jānorāda, ka tas notiek, un jāapraksta kā šī informācija tiek izmantota, kādi lēmumi tiek pieņemti, izmantojot šos apkopotos datus, kā arī kādas ir lietotāju tiesības pār lēmumiem, kas tiek pieņemti bez cilvēka iejaukšanās.','What automated decision making and/or profiling we do with user data'=>'Kādu automatizētu lēmumu pieņemšanu un/vai profilēšanu mēs veicam ar lietotāju datiem','If your website receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.'=>'Ja jūsu vietne iegūst datus par lietotājiem no trešajām pusēm, tostarp, reklāmdevējiem, tad šī informācija ir jānorāda sekcijā, kas saistīta ar trešo pušu datiem.','What third parties we receive data from'=>'No kādiem trešo pušu avotiem mēs iegūstam datus','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'Šajā sadaļā jums jāpaskaidro, kādas procedūras paredzētas, lai novērstu potenciālos vai reālos drošības caurumus personas datos, piemēram, iekšējās apziņošanas sistēmas, kontaktu mehānismi vai samaksa par kļūdu atklāšanu','What data breach procedures we have in place'=>'Kādas procedūras paredzētas, lai novērstu drošības caurumus personas datos','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'Šajā sadaļā jums jāpaskaidro, kādus pasākumus esat ieviesis, lai aizsargātu savu lietotāju datus. Tas varētu ietvert tehniskus pasākumus, piemēram, šifrēšanu; drošības pasākumus, piemēram, divu faktoru autentifikāciju un tādus pasākumus kā personāla apmācība datu aizsardzībā. Ja esat veicis Privātuma ietekmes novērtējumu, arī to varat šeit minēt.','How we protect your data'=>'Kā mēs aizsargājam jūsu datus','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'Ja jūs savu vietni izmantojat komerciāliem nolūkiem un nodarbojaties ar sarežģītāku personas datu vākšanu vai apstrādi, jums papildus informācijai, kuru mēs jau esam apsprieduši, privātuma politikā jāiekļauj arī sekojošais.','Additional information'=>'Papildus informācija','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'Šajā sadaļā jums vajadzētu norādīt saziņas metodi ar privātumu saistītām problēmām. Ja jums ir nepieciešams datu aizsardzības speciālists, norādiet šeit arī viņa vārdu un pilnu kontaktinformāciju.','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'Eiropas datu aizsardzības likumā ir noteikts, ka dati par Eiropas iedzīvotājiem, kuri tiek pārsūtīti ārpus Eiropas Savienības, ir jāaizsargā ar tādiem pat drošības standartiem kādi tie ir Eiropā. Tas nozīmē, ka papildus aprakstam par datu nodošanas galamērķiem, jums jāapraksta, kā jūs garantējat, ka jūs pats vai trešās puses pakalpojumu sniedzēji ievēro šos standartus, izmantojot līgumu, kas ir kā Privātuma vairogs, paraugu klauzulas jūsu līgumos vai saistoši korporatīvie noteikumi.','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'Šajā sadaļā jums vajadzētu uzskaitīt visas jūsu vietnes datu nodošanas gadījumus ārpus Eiropas Savienības robežām un aprakstīt, kā šie dati tiek aizsargāti atbilstoši Eiropas datu aizsardzības standartiem. Apraksts varētu iekļaut informāciju par jūsu vietnes uzturēšanu, datu glabāšanu mākonī vai citus trešo pušu pakalpojumus.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'Ja jums ir konts šajā vietnē vai esat pievienojis kādus komentārus, jūs variet pieprasīt saņemt savu personas datu eksportu ,ali redzētu informāciju, kurus par jums glabājam, ieskaitot visus datus, ko esat mums sniedzis. Jūs variet pieprasīt arī visu savu personas datu dzēšanu, ko glabājam par jums. Tas neietver datus, kurus mums ir pienākums glabāt administratīvos, juridiskos vai drošības nolūkos.','What rights you have over your data'=>'Kādas ir tavas tiesības saistībā ar taviem datiem','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'Šajā sadaļā jums jāpaskaidro, kādas tiesības jūsu lietotājiem ir attiecībā uz viņu datiem un kā viņi var izmantot šīs tiesības.','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'Lietotājiem, kuri reģistrējas mūsu vietnē (ja tas iespējams), mēs saglabājam arī viņu personīgo informāciju, kuru viņi ievada savā lietotāja kontā. Visi lietotāji jebkurā laikā var redzēt, rediģēt vai izdzēst savu personisko informāciju (izņemot, nevar mainīt savu lietotājvārdu). Arī vietnes administratori var redzēt un rediģēt šo informāciju.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'Ja atstājat komentāru, komentārs un tā metadati tiek saglabāti uz nenoteiktu laiku. Tas ir tāpēc, lai mēs automātiski varam atpazīt un apstiprināt turpmākos šī paša lietotāja komentārus, nevis turēt tos rindā uz apstiprināšanu.','In this section you should explain how long you retain personal data collected or processed by the website. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.'=>'Šajā sadaļā jums jāpaskaidro, cik ilgi jūs glabājat personas datus, kurus saglabājusi vai apstrādājusi vietne. Lai arī tas ir jūsu pienākums noteikt laika periodu, cik ilgi personas dati tiks glabāti un kādēļ, taču šai informācijai jābūt šeit aprakstītai. Piemēram, jūs varētu norādīt, ka kontaktu veidlapas ierakstus glabājat sešus mēnešus, analītikas ierakstus - gadu un klientu pirkumu ierakstus - desmit gadus.','How long we retain your data'=>'Cik ilgi mēs uzglabājam jūsu datus','By default WordPress does not share any personal data with anyone.'=>'Pēc noklusējuma, WordPress nenodod privātos datus nevienam.','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'Šajā sadaļā jums vajadzētu nosaukt un uzskaitīt visus trešo pušu pakalpojumu sniedzējus, ar kuriem jūs apmaināties ar vietnes datiem, ieskaitot partnerus, mākonī bāzētus pakalpojumus, maksājumu apstrādātājus un trešo pušu pakalpojumu sniedzējus, kā arī atzīmēt, kādus datus jūs nododat viņiem un kādēļ. Pievienojiet saites uz viņu privātuma politikām, ja iespējams.','Who we share your data with'=>'Ar ko mēs dalāmies ar jūsu datiem','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'Pēc noklusējuma, WordPress neievāc analītikas datus. Taču, daudzi tīmekļa uzturētāji ievāc dažus, anonīmus analītikas datus. Iespējams, ka esat uzstādījis spraudni, kas piedāvā analītikas pakalpojumus. Tādā gadījumā, pievienojiet šeit informāciju par spraudni.','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'Šīs vietnes varētu apkopot datus par jums, varētu izmantot sīkdatnes, varētu iegult trešo pušu izsekošanas līdzekļus, kā arī varētu novērot jūsu veiktās darbības ar iegulto saturu, tostarp arī tad, ja jums ir konts un jūs esat pierakstījies tajā vietnē.','Analytics'=>'Analītika','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'Ziņas šajā vietnē var saturēt iegultu saturu (piemēram, video attēlus, rakstus utt.). No citām vietnēm iegultais saturs darbojas tā pat, it kā apmeklētājs būtu apmeklējis šīs citas vietnes.','Embedded content from other websites'=>'Iegultais saturs no citām vietnēm','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'Ja jūs rediģēsiet vai publicēsiet ziņu, vēl viena sīkdatne tiks saglabāta jūsu pārlūkā. Šī sīkdatne nesatur privātus datus, tā tikai satur jūsu rediģētās ziņas ID. Tai iestājas noilgums pēc vienas dienas.','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'Kad jūs pierakstāties, mēs uzstādīsim vairākas sīkdatnes, lai saglabātu pierakstīšanās informāciju, kā arī ekrāna iestatījumus. Pierakstīšanās sīkdatnes saglabājas divas dienas un ekrāna opciju sīkdatnes saglabājas vienu gadu. Ja pierakstoties izvēlaties "atcerēties mani" opciju, pierakstīšanās pastāvēs divas nedēļas. Izrakstoties no konta, pierakstīšanās sīkdatnes tiks noņemtas.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'Ja jūs apmeklēsiet pierakstīšanās lapu, mēs iestatīsim īslaicīgu sīkdatni, lai noteiktu vai jūsu pārlūkprogramma atbalsta sīkdatnes. Šī sīkdatne neuzglabā privātu informāciju un tā tiks atmesta, kad aizvērsiet pārlūkprogrammu.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'Ja jūs pievienojat komentāru mūsu vietnē, jūs varat piekrist vārda, e-pasta adreses un vietnes saglabāšanai, izmantojot sīkdatnes. Šīs sīkdatnes paredzētas jūsu ērtībai, lai jums nav nepieciešams ievadīt datus katru reizi, kad pievienojat komentāru. Tās pārlūkprogrammā saglabāsies vienu gadu.','In this subsection you should list the cookies your website uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.'=>'Šajā apakšsekcijā jums būtu jānorāda vietnes, spraudņu, sociālo mediju un analītikas pakalpojumu izmantotās sīkdatnes. Mēs norādījām sīkdatnes, kuras WordPress uzstāda pēc noklusējuma.','Cookies'=>'Sīkdatnes','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'Anonimizēta virkne, kas izveidota no jūsu e-pasta adreses (saukta arī par jaucējkodu), var tikt nodota Gravatar pakalpojumam, lai redzētu, vai jūs to izmantojat. Gravatar pakalpojuma privātuma politika ir pieejama šeit: https://automattic.com/privacy/. Pēc jūsu komentāra apstiprināšanas, jūsu profila attēls būs publiski redzams blakus jūsu pievienotajam komentāram.','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'Kad apmeklētājs pievieno komentāru vietnē, mēs apkopojam datus, kas norādīti komentāra formā un arī apmeklētāju IP adreses un pārlūkprogrammas lietotāja aģentu, lai uzlabotu mēstuļu atpazīšanu.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'Pēc noklusējuma, WordPress neiekļauj kontaktu formu. Ja jūs izmantojat kontaktu formas spraudni, šajā apakšsekcijā norādiet, kādi dati tiek saglabāti, kad kāds nosūta informāciju caur formu un cik ilgi dati tiek uzglabāti. Piemēram, varat minēt, ka uzglabājat datus klientu apkalpošanas nolūkos, bet neizmantojat informāciju mārketinga nolūkos.','Contact forms'=>'Kontaktu formas','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'Augšupielādējot attēlus vietnē, jums būtu jāizvairās no tādu attēlu augšupielādes, kas satur atrašanās (EXIF GPS) datus. Vietnes apmeklētāji var lejupielādēt un izvilkt jebkurus atrašanās vietas datus no šādiem attēliem.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'Pēc noklusējuma, WordPress neievāc apmeklētāju privātos datus  un par lietotāju, tas apkopo tikai tos datus, kas redzami reģistrēto lietotāju profila ekrānā. Taču, daži no jūsu izmantotajiem spraudņiem varētu apkopot privātos datus. Zemāk jums būtu jānorāda saistītā informācija.','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'Privātie dati neveidojas tikai lietotāja mijiedarbībā ar jūsu vietni. Privātos datus rada arī tehniski procesi, piemēram, kontaktu formas, komentāri, sīkdatnes, analītika un iegultais trešo pušu saturs.','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'Papildus tam, ka norādāt kādus datus jūs apkopojat, jums vajadzētu norādīt, kāpēc jūs tos apkopojat. Šim skaidrojumam jāmin vai nu likumīgu pamatu, datu ievākšanai un uzglabāšanai, vai arī faktu par lietotāja piekrišanu.','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'Jums arī būtu jāpiemin, ja uzglabājat sensitīvus datus, piemēram, datus par cilvēku veselības stāvokli.','Our website address is: %s.'=>'Mūsu vietnes adrese ir: %s.','What personal data we collect and why we collect it'=>'Kādus privātos datus mēs apkopojam un kāpēc mēs tos apkopojam','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'Tas, cik daudz informāciju nepieciešams norādīt būs atkarīgs no jūsu vietējām vai nacionālām uzņēmējdarbības regulām. Jums var nākties norādīt jūsu uzņēmuma fizisko, reģistrēto adresi vai arī uzņēmuma reģistrācijas numuru.','Who we are'=>'Kas mēs esam','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'Tā ir jūsu atbildība uzrakstīt aptverošu privātuma politiku, kas atbilst nacionālu un starptautisku privātuma likumu prasībām. Politikai jābūt akurātai un aktuālai.','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'Šajā sekcijā jums būtu jānorāda jūsu vietnes URL, kā arī uzņēmuma vai organizācijas nosaukumu, vai arī vietnes īpašnieka vārdu, kā arī detalizētu kontaktinformāciju.','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'Lūdzu, rediģējiet savu privātuma politikas saturu, dzēšot liekos pārskatus un pievienojot nepieciešamo informāciju no jūsu tēmas un spraudņiem. Kad publicēsiet savu politikas lapu, atcerieties to pievienot izvēlnei.','This text template will help you to create your website&#8217;s privacy policy.'=>'Šī teksta veidne palīdzēs jums izveidot jūsu vietnes privātuma politiku.','As a website owner, you may need to follow national or international privacy laws. For example, you may need to create and display a privacy policy.'=>'Jums, kā mājaslapas īpašniekam, varētu būt nepieciešams ievērot nacionālus vai starptautiskus privātuma likumus. Piemēram, jums varētu būt nepieciešams, izveidot un atspoguļot privātuma politiku.','Email could not be sent.'=>'Neizdevās nosūtīt e-pastu.','date/timeOn'=>'Laiks','website URLAt URL'=>'Adresē:','website nameFor site'=>'Lapai','Force erasure has failed.'=>'Piespiedu dzēšana neizdevās.','email addressReport generated for'=>'Atskaite izveidota','Exporter array at index %s does not include a friendly name.'=>'Eksportētāja masīva %s indekss nesatur draudzīgu vārdu.','Sorry, you are not allowed to erase personal data on this site.'=>'Diemžēl, jums nav atļauts dzēst datus šajā vietnē.','Sorry, you are not allowed to export personal data on this site.'=>'Diemžēl, šajā vietnē jums nav atļauts eksportēt datus.','Missing eraser index.'=>'Trūkst dzēšanas indekss.','Eraser index is out of range.'=>'Dzēšanas indekss ir ārpus paredzētā diapazona.','Expected done (boolean) in response array from exporter: %s.'=>'Sagaidāmais ir paveikts eksportētāja atbildes masīvā: %s.','Expected response as an arra