and to keep that information current and accurate.'=>'Tomēr, tas ir jūsu pienākums pareizi izmantot šos resursus, sniegt informāciju, kas nepieciešama jūsu privātuma politikā un uzturēt šo informāciju aktuālu un precīzu.','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'Ja jūs jau esat izveidojis privātuma politikas lapu, tad, lūdzu, atlasiet to zemāk. Ja neesat, tad, lūdzu, to izveidojiet.','The new page will include help and suggestions for your privacy policy.'=>'Jaunā lapa saturēs palīdzību un ieteikumus jūsu privātuma politikai.','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'Pašlaik atlasītā privātuma politikas lapa neeksistē. Lūdzu, izveidojiet vai atlasiet jaunu lapu.','Unable to create a Privacy Policy page.'=>'Nevar izveidot privātuma politikas lapu.','privacy-policy'=>'privatuma-politika','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'Privātuma politikas lapas iestatījumi veiksmīgi atjaunināti. Neaizmirstiet <a href="%s">atjaunināt izvēlnes</a>!','The currently selected Privacy Policy page is in the Trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'Šobrīd izvēlētā privātuma politikas lapa atrodas miskastē. Lūdzu izveidojiet vai izvēlieties jaunu privātuma politikas lapu vai <a href="%s">atjaunojiet esošo</a>.','Howdy,

