1$s dzēsēja (%2$d indekss).','Expected done flag in response array from %1$s eraser (index %2$d).'=>'Sagaidāmā padarītā karodziņš atbildes masīvā no %1$s dzēsēja (%2$d indekss).','Expected messages key in response array from %1$s eraser (index %2$d).'=>'Sagaidāmā ziņojuma karodziņš masīvā no %1$s dzēsēja (%2$d indekss).','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'Sagaidāmā items_retained atslēga atbildes masīvā no %1$s dzēsēja (%2$d indekss).','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'Sagaidāmā items_removed atslēga atbildes masīvā no %1$s dzēsēja (%2$d indekss).','Did not receive array from %1$s eraser (index %2$d).'=>'Netika saņemts masīvs no %1$s dzēsēja (%2$d indekss).','Eraser array at index %d does not include a friendly name.'=>'Dzēsēja masīva %d indekss nesatur draudzīgu vārdu.','Expected an array describing the eraser at index %d.'=>'Tika sagaidīts masīvs, kurš aprakstītu dzēsēja indeksu %d.','Page index cannot be less than one.'=>'Lapas indekss nevar būt mazāks par vienu.','Eraser index cannot be less than one.'=>'Dzēsēja indekss nevar būt mazāks par vienu.','Requires PHP Version:'=>'Nepieciešama PHP versija:','This changeset cannot be further modified.'=>'Šī izmaiņu kopa turpmāk vairs nevar tikt mainīta.','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'Šie dati tiek izmantoti, lai nodrošinātu vispārējus WordPress uzlabojumus, tostarp palīdzētu aizsargāt jūsu vietni, atrodot un automātiski instalējot atjaunojumus. Tie tiek izmantoti arī, lai aprēķinātu statistiku, piemēram, statistiku, kas parādīta vietnē <a href="%s">WordPress.org statistikas lapa</a>.','There is no need to change your CSS here &mdash; you can edit and live preview CSS changes in the <a href="%s">built-in CSS editor</a>.'=>'Nav vajadzības mainīt CSS kodu šeit - jūs varat rediģēt un priekšskatīt CSS izmaiņas, <a href="%s">iebūvētajā CSS redaktorā</a>.','Did you know?'=>'Vai jūs zinājāt?','Noteworthy Contributors'=>'Ievērības cienīgi dalībnieki','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Ja jūs tomēr nolemjat veikt tiešus labojumus kodā, lūdzu izmantojiet failu pārvaldnieku, lai izveidotu kopiju ar jaunu nosaukumu saglabājot oriģinālo versiju neskartu. Tādā veidā jūs varat atgriezt strādājošo versiju, ja kaut kas noiet greizi.','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'Ja jums absolūti nepieciešams veikt tiešas izmaiņas šajā spraudnī, izmantojiet datņu pārvaldnieku, lai izveidotu kopiju ar jaunu vārdu un saglabātu oriģinālu. Tādā veidā jūs varēsiet atgriezties pie strādājošās versijas gadījumā, ja kaut kas nosies greizi.','You appear to be making direct edits to your plugin in the WordPress dashboard. Editing plugins directly is not recommended as it may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'Šķiet, ka jūs veicat tiešus spraudņa rediģējumus no WordPress paneļa. Tiešā veidā rediģēt spraudņus nav ieteicams, jo tas var radīt nesaderību, kas var sabojāt jūsu vietni, un izmaiņas var tikt zaudētas turpmākajos jauninājumos.','WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.'=>'WordPress neziņo nevienam <a href="%1$s">Atjaunināšanas pakalpojumam</a> jūsu vietnes <a href="%2$s">redzamības iestatījumu</a> dēļ.','<strong>Error:</strong> The root directory of your site is not <a href="%1$s">writable</a>, so creating a file automatically was not possible. This is the URL rewrite rule you should have in your %2$s file. Create a new file called %2$s in the root directory of your site. Click in the field and press %3$s (or %4$s on Mac) to select all. Then insert this code into the %2$s file.'=>'<strong>Kļūda:</strong> Jūsu vietnes saknes direktorija nav <a href="%1$s">rakstāma</a>, tāpēc faila automātiska izveide nebija iespējama. Šis ir URL pārrakstīšanas noteikums, kas jāievada failā %2$s. Izveidojiet jaunu failu ar nosaukumu %2$s savas vietnes saknes direktorijā. Noklikšķiniet uz lauka un nospiediet %3$s (vai %4$s uz Mac), lai atlasītu visus. Pēc tam ievietojiet šo kodu failā %2$s.','Enter the same address here unless you <a href="%s">want your site home page to be different from your WordPress installation directory</a>.'=>'Ievadiet adresi šeit, ja <a href="%s">vēlaties, ka sākumlapas adrese atšķiras no jūsu WordPress direktorija</a>.','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">our Privacy Policy</a>.'=>'Jūsu privātumu mēs uztveram ļoti nopietni. Lai uzzinātu vairāk, kādus datus mēs apkopojam un kā mēs tos izmantojam, apmeklējiet saiti <a href="%s">Mūsu privātuma politika</a>.','https://wordpress.org/about/license/'=>'https://lv.wordpress.org/about/license/','From time to time, your WordPress site may send data to WordPress.org &#8212; including, but not limited to &#8212; the version you are using, and a list of installed plugins and themes.'=>'Ik pa laikam, jūsu WordPress vietne var nosūtīt datus uz WordPress.org &#8212; tostarp, bet ne tikai, jūsu izmantoto WordPress versiju un sarakstu ar izmantotajiem spraudņiem un tēmām.','Uploaded on: %s'=>'Augšupielādēts: %s','Downloading translation from %s&#8230;'=>'Lejupielādē tulkojumu no %s&#8230;','Downloading update from %s&#8230;'=>'Lejupielādē atjauninājumu no %s&#8230;','Downloading installation package from %s&#8230;'=>'Lejupielādē instalēšanas paciņu no %s&#8230;','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'Visdrīzākais notikusi tieša %1$s iekļaušana, lai izmantotu %2$s. Tas ir ļoti nepareizi. Tā vietā piesaistiet %2$s izsaukumu %3$s darbībai.','Customization Draft'=>'Pielāgošanas melnraksts','This draft comes from your <a href="%s">unpublished customization changes</a>. You can edit, but there is no need to publish now. It will be published automatically with those changes.'=>'Šis melnraksts nāk no jūsu <a href="%s">nepublicētajām pielāgošanas izmaiņām</a>. Jūs variet rediģēt, taču nav nepieciešamības tagad publicēt. Tas tiks publicēts automātiski kopā ar tām izmaiņām.','folder'=>'mape','Theme Files'=>'Tēmas faili','Unable to communicate back with site to check for fatal errors, so the PHP change was reverted. You will need to upload your PHP file change by some other means, such as by using SFTP.'=>'Nevarēja komunicēt ar vietni, lai pārbaudītu vai nav fatālu PHP kļūdu. Jums būs nepieciešams augšupielādēt PHP faila izmaiņas, izmantojot citus līdzekļus, piemēram, SFTP.','Installation Required'=>'Uzstādīšana obligāta','Could not fully remove the plugin %s.'=>'Nevarēja pavisam noņemt spraudni %s.','User has been created, but could not be added to this site.'=>'Lietotājs ir izveidots, bet to nevarēja pievienot vietnei.','That user could not be added to this site.'=>'To lietotāju nevarēja pievienot šai vietnei.','Syntax Highlighting'=>'Sintakses izcelšana','Disable syntax highlighting when editing code'=>'Atspējot sintakses izcelšanu, kad tiek rediģēts kods.','Run the installation'=>'Sākt uzstādīšanu','https://wordpress.org/about/privacy/'=>'https://lv.wordpress.org/about/privacy/','Press This is not available. Please contact your site administrator.'=>'Press This nav pieejams. Lūdzu sazinieties ar savu vietnes administratoru','Press This is not installed. Please install Press This