 rediģē šo ziņu. Vai vēlaties pārņemt?','Theme Installation'=>'Tēmas uzstādīšana','Plugin Installation'=>'Spraudņa uzstādīšana','Custom installation script.'=>'Pielāgots uzstādīšanas skripts.','Active Installations:'=>'Aktīvās instalācijas:','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>Iestatījumi</strong> &mdash; šī lapa uzskaita visus iestatījumus, kas saistīti ar šo vietni. Daži ir WordPress izveidoti, savukārt citus izveidojuši jūsu uzstādītie spraudņi. Ņemiet vērā, ka daži lauki ir pelēkā krāsā un norāda Sērijas dati. Šīs vērtības nevar tikt mainītas, balstoties uz veidu kādā tie tiek glabāti datu bāzē.','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong>Tēmas</strong> &mdash; šī daļa parāda tēmas, kuras nav iespējotas tīklā. Iespējojot tēmu šajā izvēlnē, tā tiek padarīta pieejama šai vietnei. Tas neaktivizē tēmu, bet ļauj to apskatīt vietnes sadaļā Izskats. Lai iespējotu tēmu visam tīklam, skatiet ekrānu <a href="%s">Tīkla tēmas</a>.','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong>Lietotāji</strong> &mdash; šis parāda ar vietni saistītos lietotājus. Jūs varat arī mainīt viņu lomas, atstatīt viņu paroles, vai noņemt tos no vietnes. Noņemot lietotāju no vietnes, tas netiks noņemts no tīkla.','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong>Informācija</strong> &mdash; Vietnes URL reti tiek mainīts, jo tas var izraisīt, ka vietne nedarbojas pareizi. Ir norādīts reģistrācijas un pēdējā atjauninājuma datums. Tīkla administratori var atzīmēt vietni, kā arhivētu, mēstuli, dzēstu un kā pieaugušiem paredzētu, lai noņemtu to no publiskas parādīšanas vai to atspējotu.','Unable to write to file.'=>'Nevarēja rakstīt failā.','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'Izvēlni izmanto, lai rediģētu ar konkrētu vietni saistītu informāciju, it īpaši, ja nav pieejams vietnes administratora apgabals.','Events and News dashboard widgethttps://wordpress.org/news/'=>'https://wordpress.org/news/','Your Recent Drafts'=>'Jūsu nesenie melnraksti','Your PHP code changes were not applied due to an error on line %1$s of file %2$s. Please fix and try saving again.'=>'Jūsu veiktās PHP koda izmaiņas tika atsauktas, jo %1$s. rindā failā %2$s pieļauta kļūda. Lūdzu, labojiet to un mēģiniet vēlreiz.','nameUnknown'=>'Nezināms','No description'=>'Nav apraksta','View posts by %s'=>'Skatīt autora %s ziņas','%s Active Installations'=>'%s aktīvas instalācijas','Theme installation failed.'=>'Uzstādīt tēmu neizdevās.','Plugin installation failed.'=>'Uzstādīt spraudni neizdevās.','Your scheduled changes just published'=>'Jūsu ieplānotas izmaiņas ir nopublicētas','Activate Plugin &amp; Go to Press This'=>'Aktivizēt spraudni un atgriezieties pie Press This','Allow link notifications from other blogs (pingbacks and trackbacks) on new posts'=>'Atļaut saišu paziņojumus no citām vietnēm (atsauces) par jauniem rakstiem.','Collapse Main menu'=>'Sakļaut galveno