>','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'Jūs varat atlasīt valodu, ko lietosiet WordPress administrēšanas ekrānā, neietekmējot valodu ko redz vietnes apmeklētāji.','Edit Filters'=>'Labot filtrus','Clear current filters'=>'Noņemt esošos filtrus','Select one or more Theme features to filter by'=>'Lai filtrētu, atlasiet vienu vai vairākas tēmu iezīmes','(%s ratings)'=>'(%s vērtējumi)','Current Background Image'=>'Pašreizējais fona attēls','Current Header Image'=>'Pašreizējais galvenes attēls','Set status'=>'Noteikt statusu','&#8220;%s&#8221; is locked'=>'&#8220;%s&#8221; tiek bloķēta','Sorry, you are not allowed to attach files to this post.'=>'Atvainojiet, jums nav atļauts pievienot failus šai ziņai.','Active plugin installationsLess Than 10'=>'Mazāk kā 10','https://wordpress.org/plugins/'=>'https://wordpress.org/plugins/','The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements. The Customizer is intended for use with non-block themes.'=>'Pielāgotājs ļauj priekšskatīt izmaiņas jūsu vietnē, pirms to publicēšanas. Priekšskatījuma laikā jūsu varat naviģēt uz dažādām vietnes lapām. Dažiem pielāgojamiem elementiem tiek rādīti īsinājumtaustiņi; klikšķiniet jebkurā priekšskatījumā vietā, lai ieslēgtu vai izslēgtu tos.','Customize New Changes'=>'Jauno izmaiņu pielāgošana','Background ScrollScroll'=>'Ritināt','Background RepeatRepeat'=>'Atkārtošana','<a href="https://wordpress.org/support/forums">Support</a>'=>'<a href="https://wordpress.org/support/forums">Atbalsts</a>','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'Atrast un instalēt jaunus spraudņus jūs varat nepametot šo spraudņu sadaļu.','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'Spraudņi paplašina WordPress iespējas ar pielāgotiem līdzekļiem. Spraudņus veido tūkstošiem programmētāju visā pasaulē, neatkarīgi no WordPress pamata programmas. Visi spraudņi oficiālajā <a href="%s">WordPress spraudņu direktorijā</a> ir saderīgi ar WordPress izmantoto licenci.','Search plugins by:'=>'Meklēt spraudņus:','Convert existing categories to tags or tags to categories, selectively.'=>'Selektīvi konvertēt esošās kategorijas par birkām vai birkas par kategorijām.','Import posts &amp; media from Tumblr using their API.'=>'Importēt ziņas un multivides failus no Tumblr, izmantot viņu API.','Import posts and comments from a Movable Type or TypePad blog.'=>'Importēt ziņas un komentāru no Movable Type vai TypePad blogiem.','Import posts from LiveJournal using their API.'=>'Importēt ziņas no LiveJournal izmantot viņu API.','Import posts from an RSS feed.'=>'Importēt ziņas no RSS plūsmas.','Import posts, pages, comments, custom fields, categories, and tags from a WordPress export file.'=>'Importēt ziņas, lapas, komentārus, pielāgotos laukus, kategorijas, un birkas no WordPress eksporta faila.','Import posts, comments, and users from a Blogger blog.'=>'Importēt ziņas, komentāru un lietotājus no Blogger emuāra.','pluginDeactivate %s'=>'Deaktivizēt %s','pluginDelete %s'=>'Dzēst: %s','pluginNetwork Deactivate %s'=>'Deaktivizēt tīklu %s','By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you do not want to send the new user a welcome email.'=>'Pēc noklusējuma jaunais lietotājs saņems e-pastu ar informāciju, ka viņš ir pievienots kā lietotājs šajā vietnē. Šajā e-pasta vēstulē ir iekļauta arī paroles atiestatīšanas saite. Ja nevēlaties jaunajam lietotājam nosūtīt sveiciena e-pasta vēstuli, noņemiet atzīmi no šīs rūtiņas.','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'Jaunajiem lietotājiem automātiski tiek piešķirta parole, kuru lietotājs var mainīt pēc pieteikšanās. Jūs varat apskatīt vai rediģēt piešķirto paroli, klikšķinot pogu Rādīt paroli. Pēc tam, kad lietotājs ir pievienots, lietotājvārdu mainīt nevar.','plugin%s was successfully deleted.'=>'%s ir veiksmīgi dzēsts.','The search for installed plugins will search for terms in their name, description, or author.'=>'Instalēto spraudņu meklēšana meklēs ievadīto vārdu nosaukumos, aprakstos vai kā autoru.','Custom Logo'=>'Pielāgots logotips','Sorry, you are not allowed to add users to this network.'=>'Atvainojiet, jums nav atļauts pievienot lietotājus šim tīklam.','Sorry, you are not allowed to edit this changeset.'=>'Atvainojiet, jums nav atļauts labot šo izmaiņu kopumu.','Sorry, you are not allowed to remove users.'=>'Atvainojiet, jums nav atļauts noņemt lietotājus.','New version available. <button class="button-link" type="button">Update now</button>'=>'Ir pieejama jauna versija. <button class="button-link" type="button">Atjauniniet tagad</button>','Sorry, you are not allowed to update themes for this site.'=>'Atvainojiet, jums nav atļauts jaunināt tēmas šajā vietnē.','Sorry, you are not allowed to update this site.'=>'Atvainojiet, jums nav atļauts jaunināt šo vietni.','The Theme Installer screen requires JavaScript.'=>'Tēmas instalēšanas ekrānam nepieciešams JavaScript.','Sorry, you are not allowed to edit templates for this site.'=>'Atvainojiet, jums nav atļauts labot šīs vietnes veidnes.','<strong>Error:</strong> "Table Prefix" is invalid.'=>'<strong>Kļūda</strong>: "Tabulas prefikss" ir nederīgs.','So