 Aizsargāt ar paroli ļauj jums iestatīt katrai ziņai brīvi izvēlētu paroli. Opciju Privāts paslēpj ziņu no visiem, izņemot redaktoru un administratoru. Publicēt (nekavējoties) ļauj noteikt nākotnes vai pagātnes datumu un laiku, tātad var ieplānot datumu, kad ziņa tiks publicēta vai mainīt tās publicēšanas datumu pagātnē.','Error while saving the new email address. Please try again.'=>'Saglabājot jaunu e-pasta adresi, radās kļūda. Lūdzu, mēģiniet vēlreiz.','There is a pending change of your email to %s.'=>'Jūsu e-pastā %s ir neapstiprinātas izmaiņas.','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'Jūs varat sašaurināt sarakstu pēc failu veida, statusa vai datuma, izmantojot nolaižamās izvēlnes virs multivides failu saraksta.','New theme activated.'=>'Jaunā tēma ir aktivizēta.','The following themes are installed but incomplete.'=>'Šīs tēmas ir uzstādītas nepilnīgi.','Settings saved and theme activated.'=>'Iestatījumi ir saglabāti un tēma aktivizēta.','The name of the database you want to use with WordPress.'=>'Datu bāzes nosaukums, kuru izmantosit WordPress.','Your database password.'=>'Jūsu datu bāzes parole.','Your database username.'=>'Jūsu datu bāzes lietotājvārds.','https://wordpress.org/themes/'=>'https://wordpress.org/themes/','Sorry, you are not allowed to delete that user.'=>'Atvainojiet, jums nav atļauts dzēst šo lietotāju.','plugin%1$s by %2$s'=>'%1$s %2$s','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s, izmantojot %2$s (tiks arī <strong>dzēsti tās dati</strong>)','There is a pending change of the admin email to %s.'=>'Administratora e-pastā %s ir izmaiņas, kas gaida apstiprinājumu.','Dismiss the welcome panel'=>'Nerādīt ielūguma paneli','The constant %s cannot be defined when installing WordPress.'=>'Konstanti %s nevar definēt, uzstādot WordPress.','WordPress has been installed. Thank you, and enjoy!'=>'WordPress ir instalēts. Paldies, izbaudiet!','Your %s file has an empty d