om URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'WordPress piedāvā jums iespēju izveidot pielāgotu URL struktūru paliekošām saitēm un arhīviem. Pielāgotas URL struktūras var uzlabot saišu estētiku, lietojamību un saderību nākotnē. <a href="%s">Ir pieejami vairāki tagi</a>, un tālāk ir sniegti daži piemēri, kā sākt darbu.','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'Paliekošās saites var saturēt noderīgu informāciju, kā ziņas datumu, nosaukumu, vai citus elementus. Jūs var izvēlēties jebkuru no piedāvātajiem paliekošo saišu formātiem, vai arī izveidot savu, ja izvēlieties Pielāgoto struktūru.','You can create the %s file manually and paste the following text into it.'=>'Jūs varat izveidot %s failu manuāli un ielīmēt tajā sekojošo tekstu.','You should be able to get this info from your web host, if %s does not work.'=>'Vajadzētu būt iespējai iegūt šo informāciju no jūsu vietnes uzturētāja, ja %s nestrādā.','If for any reason this automatic file creation does not work, do not worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.'=>'Ja kaut kāda iemesla dēļ šī automātiskā faila izveide nav notikusi, neuztraucieties. Jums manuāli konfigurācijas failā ir jāaizpilda informācija par datu bāzi. Vai arī, vienkārši atveriet %1$s failu teksta redaktorā, aizpildiet attiecīgo informāciju un saglabājiet to kā %2$s.','Default is %s'=>'Noklusējums ir %s','The theme is missing the %s stylesheet.'=>'Tēma ir pazudusi %s stila lapa.','The %s stylesheet does not contain a valid theme header.'=>'%s stila lapa nesatur derīgu tēmas galveni.','If you have mar