','Mystery Person'=>'Noslēpumaina persona','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'Lietotājvārdos var izmantot tikai burtciparu rakstzīmes, atstarpes, pasvītrojumus, pārnesumzīmes, punktus un @ simbolus.','You cannot delete a theme while it has an active child theme.'=>'Jūs nevarat dzēst tēmu, kamēr tai ir aktīva apakštēma.','Enable full-height editor and distraction-free functionality.'=>'Iespējot pilna augstuma redaktoru un netraucētas rakstīšanas funkcionalitāti.','Untested with your version of WordPress'=>'Nav pārbaudīts ar jūsu WordPress versiju','https://planet.wordpress.org/'=>'https://planet.wordpress.org/','https://planet.wordpress.org/feed/'=>'https://planet.wordpress.org/feed/','All categories'=>'Visas kategorijas','%s has been logged out.'=>'%s ir atteicies.','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong>Ziņas redaktors</strong> &mdash; ievadiet savas ziņu, tekstu. Ir divi rediģēšanas režīmi: vizuālais un teksta. Izvēlieties režīmu, klikšķinot attiecīgajā cilnē.','Could not log out user sessions. Please try again.'=>'Nevarēja atteikties no lietotāja sesijām. Lūdzu, mēģiniet vēlreiz.','Filter by comment type'=>'Filtrēt pēc komentāra tipa','This preview is unavailable in the editor.'=>'Šis priekšskatījums ir nepieejams redaktorā.','You are now logged out everywhere else.'=>'Tagad jūs esat atteicies visur citur.','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'Jūs varat ievietot multivides failus, klikšķinot uz pogas virs redaktora un sekojot norādījumiem. Jūs varat līdzināt vai rediģēt attēlus, izmantojot vizuālajā režīmā pieejamo iekļauto formatēšanas rīkjoslu.','You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.'=>'Jūs varat pārvaldīt un nekavējoties apskatīt pielāgotos fonus <a href="%s"> Pielāgotājā</a>.','You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.'=>'Jūs variet pārvaldīt un nekavējoties apskatīt Pielāgoto galveni <a href="%s"> Pielāgotājā</a>.','link nameName'=>'Nosaukums','Welcome panelWelcome'=>'Sveicināti','usersAll <span class="count">(%s)</span>'=>'Viss <span class="count">(%s)</span>' . "\0" . 'Visi <span class="count">(%s)</span>' . "\0" . 'Visi <span class="count">(%s)</span>','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'Ja vēlaties, šeit varat pielāgot URL struktūru savām kategorijām un birkām. Piemēram, izmantojot <code>temati</code> kā kategoriju bāzi, veidos jūsu kategoriju saites kā <code>%s/temati/nekategorizēts/</code>. Ja atstāsit to tukšu, tiks izmantoti noklusējumi.','Release Lead'=>'Laidiena vadītājs','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'Izmantojiet bultiņu pogas dialoga augšdaļā, vai pa kreisi un pa labi vērsto bultiņu taustiņus uz tastatūras, lai ātri pārvietotos multivides vienumos.','Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.'=>'Klikšķinot vienumu, tiek atvērts Pielikuma datu logs, kas ļauj priekšskatīt multivides failu un veikt meta datu labojumus. Pielikuma datu logā veiktās izmaiņas tiks saglabātas automātiski!','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'Lai režģa skatā dzēstu multivides vienumus, klikšķiniet pogu Lielapjoma atlase ekrāna augšpusē. Atlasiet dzēšamos vienumus un tad klikšķiniet pogu Dzēst iezīmētos. Klikšķinot pogu Atcelt iezīmēšanu, atgriezīsieties režģa skatā.','You can also delete individual items and access the extended edit screen from the details dialog.'=>'Varat arī dzēst atsevišķus vienumus un piekļūt paplašinātam rediģēšanas ekrānam no detalizētās informācijas dialoga.','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'Multivides failus iespējams skatīt vienkāršā režģī vai sarakstā ar slejām un papildus informāciju. Izmantojot ikonas saraksta rīkjoslas sākumā, iespējams skatus pārslēgt.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'Visi failus, ko esat augšupielādējis redzami multivides bibliotēkā, kurā jaunākie papildinājumi sarakstā ir pirmie.','Browse Plugins'=>'Pārlūkot spraudņus','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'Ja vienkārši vēlaties iegūt priekšstatu par to, kas jauns, izmantojiet saites Piedāvāti un Populāri, virs spraudņu saraksta. Informācija šajos sarakstos tiek regulāri atjaunota.','Add Plugins'=>'Pievienot spraudņus','Invalid translation type.'=>'Nederīga veida tulkojums.','The %1$s constant in your %2$s file is no longer needed.'=>'%1$s konstante jūsu failā %2$s vairs nav vajadzīga.','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'Laipni lūgti slavenajā WordPress piecu minūšu instalēšanas procesā! Vienkārši aizpildiet prasīto informāciju un sāciet savu ceļu ar pasaulē jaudīgāko un visvairāk paplašināmo personīgās publicēšanās platformu.','<strong>Compatible</strong> with your version of WordPress'=>'<strong>Saderīgs</strong> ar jūsu WordPress versiju','<strong>Incompatible</strong> with your version of WordPress'=>'<strong>Nav saderīgs</strong> ar jūsu WordPress versiju','%d star'=>'%d zvaigzne' . "\0" . '%d zvaigznes' . "\0" . '%d zvaigznes','Select bulk action'=>'Izvēlēties lielapjoma darbību','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'Multivides bibliotēkas režģa skatījumam nepieciešams JavaScript.<a href="%s">Pārslēgt uz saraksta skatu</a>.','Add the user without sending an email that requires their confirmation'=>'Pievienot lietotāju bez apstiprinājuma e-pasta nosūtīšanas','View details'=>'Apskatīt detaļas','%s failed to embed.'=>'%s neizdevās iegult.','Contributors'=>'Dalībnieki','Donate to this plugin &#187;'=>'Ziedojiet šī spraudņa autoram &#187;','More Details'=>'Vairāk detaļu','Number/count of itemsCount'=>'Skaits','Plugin InstallerBeta Testing'=>'Beta testēšana','Plugin installer group titlePerformance'=>'Veiktspēja','Plugin installer group titleSocial'=>'Sociāli','Plugin installer group titleTools'=>'Rīki','The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.'=>'WordPress komanda ir gatava jums palīdzēt. Nosūtiet šo vēstuli %s un mēs palīdzēsim jums, lai pārliecinātos, ka jūsu vietne darbojas.','themesRecently Updated'=>'Nesen jaunināts','Plugin installer section titleReviews'=>'Atsauksmes','Filtering by:'=>'Filtrēts pēc:','A red bar on the left means the comment is waiting for you to moderate it.'=>'Sarkana josla pa kreisi nozīmē, ka ir komentārs, kas gaida, lai jūs to pārvaldītu(moderētu).','Displayed on attachment pages.'=>'Attēlots uz pielikumu lapām.','Once you have made your selection, you can adjust it by entering the size in pixels. The minimum selection size is the thumbnail size as set in the Media settings.'=>'Kad esat iekadrējis apgriežamo daļu, jūs varat precizēt jaunā attēla izmērus pikseļos. Minimālais pieļaujamais izmērs ir sīktēla lielums, kas noteikts Mediju iestatījumos.','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'Skata koeficients ir attiecība starp platumu un augstumu. Varat saglabāt proporcijas, turot nospiestu taustiņu Shift, kamēr mainiet atlases izmērus. Izmantojiet malu attiecību lodziņu, lai norādītu proporcijas, piemēram, 1:1 (kvadrāts), 4:3, 16:9, utt.','To crop the image, click on it and drag to make your selection.'=>'Lai apgrieztu attēlu, klikšķiniet un tad velciet rāmīti, lai izvēlētos attēla daļu.','You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.'=>'Jūs varat rediģēt attēlu, vienlaikus saglabājot sīktēlu. Piemēram, jūs varat izvēlēties kvadrātveida sīktēlu, kas parādīs tikai daļu no attēla.','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'Varat mērogot proporcionāli sākotnējam attēlam. Lai iegūtu labāko rezultātu, vispirms mērogojiet un tikai tad apgrieziet, rotējiet vai apvērsiet to. Attēlus iespējams vienīgi samazināt, nevis palielināt.','Keyboard users: When you are working in the visual editor, you can use %s to access the toolbar.'=>'Tastatūras lietotāji: strādājot ar vizuālā redaktoru, jūs varat izmantot %s, lai piekļūtu rīkjoslai.','All comment types'=>'Visi komentāru tipi','themesLatest'=>'Jaunākās','themesFeatured'=>'Piedāvātās','themesPopular'=>'Populāras','Delete all content.'=>'Dzēst visu saturu.','<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong>Pārskats</strong> &mdash; rāda jūsu vietnes satura kopsavilkumu, instalēto WordPress versiju un jūs lietotās tēmas nosaukumu.','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong>Lauciņu vadīklas</strong> &mdash; klikšķiniet lauciņa virsraksta joslā, lai izvērstu vai sakļautu to. Lauciņi, kurus pievienojuši spraudņi, dažkārt var būt ar konfigurējamu saturu un ja jūsu kursors atradīsies virs to virsraksta joslas, parādīsies saite &#8220;Konfigurēt&#8221;.','Add Themes'=>'Pievienot tēmas','Attribute all content to:'=>'Attiecināt uz visu saturu:','Search Themes'=>'Meklēt tēmas','What should be done with content owned by this user?'=>'Kas būtu jādara ar saturu, kas pieder šiem lietotājiem?','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://wordpress.org/support/forum/how-to-and-troubleshooting','themeDetails &amp; Preview'=>'Detaļas un priekšskatījums','Sorry, you are not allowed to resume this theme.'=>'Diemžēl, jums nav atļauts atsāknēt šo tēmu.','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.'=>'Izmantojot <strong>Dzēst</strong>, tiek atvērts apstiprināšanas ekrāns Lietotāju dzēšana, kurā varat neatgriezeniski noņemt lietotāju no savas vietnes un dzēst tā saturu. Varat arī izdzēst vairākus lietotājus vienlaikus, izmantojot lielapjoma darbības.','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.'=>'Izmantojot <strong>Noņemt</strong>, varat noņemt lietotāju savā vietnē. Netiks dzēsts viņa veidotais saturs. Varat noņemt arī vairākus lietotājus vienlaikus, izmantojot lielapjoma darbības.','Edit status'=>'Labot statusu','Edit date and time'=>'Labot datumu un laiku','Browse revisions'=>'Pārlūkot labojumus','Edit visibility'=>'Labot redzamību','Thank you for creating with <a href="%s">WordPress</a>.'=>'Paldies, ka izmantojat <a href="%s">WordPress</a>.','<a href="https://wordpress.org/support/forum/multisite/">Support forums</a>'=>'<a href="https://wordpress.org/support/forum/multisite/">Atbalsta forums</a>','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong>Tulkojumi</strong> &mdash; WordPress tulkojumu faili iestatītajā valodā tiek atjaunināti ikreiz, kad parādās citi jauninājumi. Bet ja šie tulkojumi izskatās novecojuši, <strong>klikšķiniet pogu &#8220;Jaunināt tulkojumus&#8221;</strong>.','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'Ja būs pieejams jauninājums, jūs redzēsiet attiecīgu paziņojumu rīkjoslā un navigācijas izvēlnē.','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'Vairumā gadījumu apkopes un drošības jauninājumus WordPress instalēs automātiski.','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>WordPress</strong> &mdash; jaunināt jūsu WordPress instalāciju ir vienkārša, viena klikšķa procedūra: kad ir parādījies paziņojums, par jaunas versijas esamību <strong>klikšķiniet pogu &#8220;Instalēt tūlīt&#8221;</strong>.','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong>Tēmas un spraudņi</strong> &mdash; lai jauninātu atsevišķas tēmas vai spraudņus šajā ekrānā, izmantojiet izvēles rūtiņas lai veiktu atlasi, tad <strong>klikšķiniet atbilstošo pogu &#8220;Jaunināt&#8221;</strong>. Lai jauninātu visas tēmas vai spraudņus vienlaicīgi, jūs varat iezīmējot lodziņu <strong>Atlasīt visu</strong> sadaļas augšpusē un tad klikšķināt pogu Jaunināt.','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'Šajā ekrānā jūs varat jaunināt WordPress jaunāko versiju, kā arī jaunināt tēmas, spraudņus un tulkojumus no WordPress.org krātuvēm.','%1$s MB (%2$s%%) Space Used'=>'%1$s MB (%2$s%%) izmantotā vieta','%s MB Space Allowed'=>'%s MB pieejama brīvā vieta ','%s Page'=>'%s lapa' . "\0" . '%s lapas' . "\0" . '%s lapas','%s Post'=>'%s ziņa' . "\0" . '%s ziņas' . "\0" . '%s ziņas','M jS'=>'M jS','At a Glance'=>'Īsumā','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.'=>'Kad šis iestatījums ir spēkā, informācijas paneļa lodziņā Pārskats tiek parādīts atgādinājums, kurā teikts: “Meklētājprogrammas nav ieteicamas”, lai atgādinātu, ka esat norādījis meklētājprogrammām nemeklēt jūsu vietni.','themeActive:'=>'Aktīva:','Accessibility Ready'=>'Pieejamībai gatavs','This is a child theme of %s.'=>'Šī ir %s apakštēma.','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'Klikšķinot tēmas attēlu, atvērsiet jaunu logu kur būs apskatāms tēmas autors, nosaukums, versija, apraksts, birkas, kā arī tēmas dzēšanas poga','Hover or tap to see Activate and Live Preview buttons'=>'Turot kursoru virs neaktīvas tēmas attēla piekļūt tēmas informācijai, aktivizēt un priekšskatīt to ','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'Pieskarieties vai lidinieties ar kursoru virs jebkuras tēmas, tad klikšķiniet pogu Priekšskatīt, lai apskatītu šo tēmu un mainītu tēmas opcijas atsevišķā, pilnekrāna skatā. Pogu Priekšskatīt jūs varat atrast arī tēmas detaļu ekrāna apakšā. Šādā veidā var apskatīt un pielāgot jebkuru jūsu vietnē lejupielādētu tēmu.','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'Ja priekšstatāt lapu mazā monitorā, jūs varat lietot sakļaušanas ikonu kreisajā pusē, paneļa apakšā. Tā paslēps paneli, dodot vairāk vietas lai apskatītu jūsu vietnes jauno izskatu. Lai atkal atvērtu kreiso paneli, klikšķiniet sakļaušanas ikonu vēlreiz.','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.'=>'Priekšstatītā tēma ir pilnībā interaktīva &mdash; dodieties uz citām lapām, lai redzētu, kā tēma apietas ar ziņām, arhīviem un citām lapas veidnēm. Iestatījumi var atšķirties atkarībā no tā, kādus līdzekļus priekšstatītā tēma atbalsta. Lai apstiprinātu jaunos iestatījumus un aktivizēt tēmu vienā solī, izmantojiet pogu Saglabāt un aktivizēt virs izvēlnes.','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'Šis ekrāns tiek izmantots lejupielādēto tēmu pārvaldīšanai. WordPress instalācijas pakotnē parasti ir iekļautas 2-3 noklusējuma &mdash; WordPress komandas veidotās tēmas, kuras nosauktas pēc to izlaišanas gada.','Click Customize for the active theme or Live Preview for any other theme to see a live preview'=>'Klikšķiniet Pielāgot aktīvajai tēmai vai Priekšskatīt jebkurai neaktīvai tēmai un apskatiet tās tiešajā priekšskatījumā','The active theme is displayed highlighted as the first theme.'=>'Aktīvā tēma tiek parādīta izcelta kā pirmā tēma.','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'Lai aktivizētu logrīku, velciet to uz sānjoslu vai klikšķiniet to. Lai deaktivizētu logrīku un izdzēstu tā iestatījumus, velciet to atpakaļ.','%1$s rating based on %2$s rating'=>'%1$s vērtējums balstīts uz %2$s vērtējumu' . "\0" . '%1$s vērtējums balstīts uz %2$s vērtējumiem' . "\0" . '%1$s vērtējums balstīts uz %2$s vērtējumiem','%s rating'=>'%s vērtējums','This screen shows an individual user all of their sites in this network, and also allows that user to set a primary site. They can use the links under each site to visit either the front end or the dashboard for that site.'=>'Šis ekrāns rāda katram lietotājam visas viņa vietnes šajā tīklā, un arī ļauj lietotājam iestatīt primāro vietni. Izmantot saites zem katras vietnes, lietotājs var apmeklēt katru vietni vai šīs vietnes paneli.','Error: [%1$s] %2$s'=>'Kļūda: [%1$s] %2$s','Rollback Error: [%1$s] %2$s'=>'Atrites kļūda: [%1$s] %2$s','The following plugins failed to update:'=>'Jaunināšana neizdevās šādiem spraudņiem:','The following plugins were successfully updated:'=>'Tika veiksmīgi jaunināti šādi spraudņi:','The following themes failed to update:'=>'Jaunināšana neizdevās šādām tēmām:','The following themes were successfully updated:'=>'Tika veiksmīgi jauninātas šādas tēmas:','The following translations failed to update:'=>'Jaunināšana neizdevās šādiem tulkojumiem:','The following translations were successfully updated:'=>'Tika veiksmīgi jaunināti šādi tulkojumi:','Add New Theme'=>'Pievienot jaunu tēmu','Add Widget'=>'Pievienot logdaļu','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'Vai tiešām vēlaties dzēst šo tēmu? 

Klikšķiniet uz \'Atcelt\', lai atgrieztos, \'Labi\', lai apstiprinātu dzēšanu.','Show next theme'=>'Rādīt nākošo tēmu','Show previous theme'=>'Rādīt iepriekšējo tēmu','Unable to submit this form, please refresh and try again.'=>'Nevar iesniegt šo formu, lūdzu, atsvaidziniet un mēģiniet vēlreiz.','Update Available'=>'Pieejams jauninājums','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong>Aktivitāte</strong> &mdash; rāda ieplānotās nākamās ziņas, nesen publicētās ziņas un jaunākos komentārus jūsu ziņai un ļauj tos pārvaldīt.','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong>Ātrais melnraksts</strong> &mdash; ļauj izveidot jaunu ziņu un saglabāt to kā melnrakstu. Parāda arī saites uz 3 pēdējām sāktajām melnraksta ziņām.','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong>Ekrāna opcijas</strong> &mdash; izmantojiet ekrāna opciju cilni, lai izvēlētos, kurus informācijas paneļa lodziņus rādīt.','Activity'=>'Aktivitāte','FAILED: %s'=>'NEIZDEVĀS: %s','FAILED: WordPress failed to update to %s'=>'NEIZDEVĀS: WordPress neizdevās atjaunināt kā %s','Manage Uploads'=>'Pārvaldīt augšupielādi','No activity yet!'=>'Vēl nav aktivitātes!','Popular Plugin'=>'Populārs spraudnis','Publishing Soon'=>'Nākošās publikācijas','Quick Draft'=>'Ātrais melnraksts','Recently Published'=>'Nesen publicēts','SUCCESS: %s'=>'IZDEVĀS: %s','Tomorrow'=>'Rīt','What&#8217;s on your mind?'=>'Par ko rakstam?','WordPress %1$s running %2$s theme.'=>'WordPress %1$s darbojas ar %2$s tēmu.','WordPress site: %s'=>'WordPress vietne: %s','SUCCESS: WordPress was successfully updated to %s'=>'IZDEVĀS: WordPress tika veiksmīgi jaunināts uz %s','The update cannot be installed because your site is unable to copy some files. This is usually due to inconsistent file permissions.'=>'Atjauninājumu nevar instalēt, jo atsevišķus failus nav iespējams kopēt. Parastais iemesls - nepietiekamas atļaujas darbam ar failiem.','WordPress %s is also now available.'=>'Arī WordPress %s pašreiz ir pieejams.','Your site at %1$s experienced a critical failure while trying to update WordPress to version %2$s.'=>'Jūsu vietnē %1$s, mēģinot jaunināt uz jaunāko WordPress %2$s versiju, radās kritiska kļūme. ','Your site was running version %s.'=>'Jūsu vietne izmantoja %s versiju.','Error code: %s'=>'Kļūdas kods: %s','For more on version %s, see the About WordPress screen:'=>'Vairāk par %s versiju, skatiet ekrānā Par WordPress:','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'Sveicināti! Jūsu vietne %1$s ir automātiski jaunināta uz WordPress %2$s.','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'Ja jums rodas kādi jautājumi vai ir nepieciešams atbalsts, jums varētu palīdzēt brīvprātīgie no WordPress.org atbalsta foruma.','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'Rūpes par jūsu vietnes jaunināšanu ir svarīgas no drošība viedokļa. Tās arī padara interneta par drošāku vietu jums un jūsu lasītājiem.','No further action is needed on your part.'=>'Nav nepieciešama turpmāka rīcība no jūsu puses.','Please check out your site now. It\'s possible that everything is working. If it says you need to update, you should do so:'=>'Lūdzu, tagad pārbaudiet savu vietni. Iespējams, ka viss darbosies. Ja būs paziņojums par jaunināšanu, veiciet to:','Please update your site at %1$s to WordPress %2$s.'=>'Lūdzu, jauniniet savu vietni %1$s uz WordPress 2$s.','The WordPress Team'=>'WordPress komanda','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'Tas nozīmē, ka vietne, iespējams, ir bezsaistē vai ir bojāta. Nekrītiet panikā, to var labot.','Translations'=>'Tulkojumi','Translations for %s'=>'%s tulkojumi','Update Translations'=>'Jaunināt tulkojumus','Updating is easy and only takes a few moments:'=>'Jaunināšana ir vienkārša un aizņems pavisam nedaudz laika:','Updating translations for %1$s (%2$s)&#8230;'=>'Jaunina tulkojumus %1$s (%2$s)&#8230;','You also have some plugins or themes with updates available. Update them now:'=>'Dažiem spraudņiem vai tēmām jūsu vietnē ir pieejamas jaunākas versijas. Lūdzu, jauniniet:','Your hosting company, support forum volunteers, or a friendly developer may be able to use this information to help you:'=>'Jūsu hostinga uzņēmums, atbalsta foruma brīvprātīgie vai draudzīgs izstrādātājs, iespējams, var izmantot šo informāciju, lai palīdzētu jums:','Your site at %1$s experienced a critical failure while trying to update to the latest version of WordPress, %2$s.'=>'Jūsu vietnē %1$s, mēģinot jaunināt uz jaunāko WordPress versiju, %2$s, radās kritiska kļūme. ','Your translations are all up to date.'=>'Jums ir jaunākie tulkojumi.','[%1$s] URGENT: Your site may be down due to a failed update'=>'[%1$s] STEIDZAMI: Jūsu vietne iespējams, nedarbojas, jo jaunināšana bija neveiksmīga','[%1$s] WordPress %2$s is available. Please update!'=>'[%1$s] WordPress %2$s ir pieejams. Aicinām jaunināt!','[%1$s] Your site has updated to WordPress %2$s'=>'[%1$s] Jūsu vietne jaunināta uz WordPress %2$s','Background updates'=>'Fona atjauninājumi','There is not enough free disk space to complete the update.'=>'Nav pietiekami daudz brīvas vietas, lai pabeigtu jauninājumu.','Translation update failed.'=>'Tulkojuma jaunināšana neizdevās.','Translation updated successfully.'=>'Tulkojuma jaunināšana veiksmīgi pabeigta.','Updating plugin: %s'=>'Atjaunina spraudni %s...','Updating theme: %s'=>'Atjaunina tēmu %s...','Some of your translations need updating. Sit tight for a few more seconds while they are updated as well.'=>'Daži jūsu tulkojumi ir jāatjaunina. Paciešaties vēl dažas sekundes, kamēr mēs jauninām arī tos.','Comment must be manually approved'=>'to manuāli jāapstiprina','Create a brand new user and add them to this site.'=>'Veidojiet pilnīgi jaunu lietotāju un pievienojiet to šai vietnei.','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'Zemāk uzskaitītie lielumi nosaka maksimālos izmērus pikseļos attēliem, kas tiks ievietoti multivides bibliotēkā.','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'Jebkuras šeit veiktās izmaiņas tēmas failos tiks pārrakstītas tēmas jaunināšanas gadījumā. Lai novērstu šo problēmu, apsveriet iespēju labojumus veikt <a href="%s"> apakštēmā</a>.','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'<strong>Klikšķinot uz bultiņas pa labi no jebkuras izvēlnes vienuma</strong> redaktorā parādīsies standarta iestatījumu grupa. Papildu iestatījumus, piemēram, saites mērķi (jauna lapa), CSS klases, saites attiecības un saites aprakstu var iespējot un atspējot, izmantojot cilni Šī ekrāna opcijas.','Copying the required files&#8230;'=>'Nepieciešamo failu kopēšana&#8230;','Due to an error during updating, WordPress has been restored to your previous version.'=>'Kļūdas dēļ, kas radās atjaunošanas gaitā, WordPress ir atgriezts atpakaļ iepriekšējā versijā.','Please provide a valid username.'=>'Lūdzu, norādiet derīgu lietotājvārdu.','Preparing to install the latest version&#8230;'=>'Gatavojas instalēt jaunāko versiju&#8230;','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'Faila kontrolsumma (%1$s) neatbilst paredzamajai kontrolsummas vērtībai (%2$s).','The username you provided has invalid characters.'=>'Jūsu lietotājvārdā ir nederīgs rakstzīmes.','This password will not be stored on the server.'=>'Šī parole netiks saglabāta uz servera.','Updating to WordPress %s'=>'Jaunināt uz WordPress %s','WordPress %s'=>'WordPress %s','You must provide an email address.'=>'Jums ir jānorāda e-pasta adrese.','Your passwords do not match. Please try again.'=>'Paroles nesakrīt. Lūdzu, mēģiniet vēlreiz.','Looking for %1$s in %2$s'=>'Meklēt %1$s, %2$s','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'Jūsu tēma, būtībā neatbalsta izvēlnes, bet jūs tās var izmantot sānjoslās, pievienojot &#8220;Pielāgotās izvēlnes&#8221; logrīku <a href="%s">Logrīku</a> ekrānā.','Sorry, that is not a valid email address. Email addresses look like <code>username@example.com</code>.'=>'Atvainojiet, šī nav derīga e-pasta adrese. E-pasta adreses izskatās apmēram šādi <code>lietotajavards@piemers.com</code>.','Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%1$s">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, %2$s and %3$s, do), you can learn about adding this support by following the documentation link to the side.'=>'Izvēlnes var atrasties jūsu tēmas noteiktajās vietās, arī sānjoslās, ja pievienosiet logrīku “Pielāgota izvēlne”, ekrānā <a href="%1$s">Logdaļas</a>. Ja jūsu tēma neatbalsta pielāgoto izvēlņu iespēju (noklusējuma tēmas %2$s un %3$s to atbalsta), variet uzzināt vairāk par to, kā pievienot šo atbalstu sekojot dokumentācijas saitei sānā.','%s page moved to the Trash.'=>'%s lapa pārvietota uz atkritni.' . "\0" . '%s lapas pārvietotas uz atkritni.' . "\0" . '%s lapas pārvietotas uz atkritni.','%s page not updated, somebody is editing it.'=>'%s lapa netika atjaunināta, kāds to labo.' . "\0" . '%s lapas netika atjauninātas, kāds tās labo.' . "\0" . '%s lapas netika atjauninātas, kāds tās labo.','%s page permanently deleted.'=>'%s lapa ir neatgriezeniski dzēsta.' . "\0" . '%s lapas ir neatgriezeniski dzēstas.' . "\0" . '%s lapas ir neatgriezeniski dzēstas.','%s page restored from the Trash.'=>'%s lapa atjaunota no atkritnes.' . "\0" . '%s lapas atjaunotas no atkritnes.' . "\0" . '%s lapas atjaunotas no atkritnes.','%s page updated.'=>'%s lapa atjaunināta.' . "\0" . '%s lapas atjauninātas.' . "\0" . '%s lapas atjauninātas.','%s post moved to the Trash.'=>'%s ziņa pārvietota uz atkritni.' . "\0" . '%s ziņas pārvietotas uz atkritni.' . "\0" . '%s ziņas pārvietotas uz atkritni.','%s post not updated, somebody is editing it.'=>'%s ziņa netika atjaunota, kāds to rediģē.' . "\0" . '%s ziņas netika atjaunotas, kāds tās rediģē.' . "\0" . '%s ziņas netika atjaunotas, kāds tās rediģē.','%s post permanently deleted.'=>'%s ziņa neatgriezeniski dzēsta.' . "\0" . '%s ziņas neatgriezeniski dzēstas.' . "\0" . '%s ziņas neatgriezeniski dzēstas.','%s post restored from the Trash.'=>'%s ziņa atjaunota no atkritnes.' . "\0" . '%s ziņas atjaunotas no atkritnes.' . "\0" . '%s ziņas atjaunotas no atkritnes.','Categories deleted.'=>'Kategorijas dzēstas.','Category added.'=>'Kategorija pievienota.','Category deleted.'=>'Kategorija dzēsta.','Category not added.'=>'Kategorija netika pievienota.','Category not updated.'=>'Kategorija netika atjaunināta.','Category updated.'=>'Kategorija atjaunināta.','Tag added.'=>'Birka pievienota.','Tag deleted.'=>'Birka dzēsta.','Tag not added.'=>'Birka netika pievienota.','Tag not updated.'=>'Birka netika atjaunināta.','Tag updated.'=>'Birka atjaunināta.','Tags deleted.'=>'Birkas dzēstas.','Compare two different revisions by <strong>selecting the &#8220;Compare any two revisions&#8221; box</strong> to the side.'=>'Salīdzināt divus dažādus labojumus, <strong>atlasot &#8220;Salīdzināt jebkurus divus labojumus&#8221;</strong> rūtiņu malā.','Compare any two revisions'=>'Salīdzināt jebkurus divus labojumus','"%1$s" by %2$s.'=>'"%1$s" %2$s.','"%1$s" from %2$s by %3$s.'=>'"%1$s" no %2$s %3$s.','"%1$s" from %2$s.'=>'"%1$s" no %2$s.','"%s".'=>'"%s".','Autosave by %s'=>'Automātiskā saglabāšana pēc %s','Current Revision by %s'=>'Pašreizējais labojums %s','Restore This Autosave'=>'Atjaunot automātiski saglabāto','Revisions: %s'=>'Labojumi: %s','revisionsBrowse'=>'Pārlūkot','Revision by %s'=>'Labojums %s','<strong>Connection lost.</strong> Saving has been disabled until you are reconnected.'=>'<strong>Savienojums zaudēts</strong>. Saglabāšana ir atspējota, līdz atkal tiksiet savienots.','Sorry, something went wrong. The requested comparison could not be loaded.'=>'Atvainojiet, kaut kas nogājis greizi. Pieprasīto salīdzinājums nevar ielādēt.','Repeat New Password'=>'Atkārtojiet jauno paroli','Repeat Password'=>'Atkārtojiet paroli','Add menu items from the column on the left.'=>'Pievienojiet izvēlnes elementus kreisajā slejā.','Plugins extend and expand the functionality of WordPress. You may install plugins in the <a href="%s">WordPress Plugin Directory</a> right from here, or upload a plugin in .zip format by clicking the button at the top of this page.'=>'Spraudņi paplašina un izvērš WordPress iespējas. Variet automātiski uzstādīt spraudņus no <a href="%s">WordPress spraudņu kataloga</a> tieši no šejienes vai augšupielādēt spraudni .zip formātā, izmantojot pogu, kura redzama šīs lapas augšpusē.','http://wordpress.org/plugins/hello-dolly/'=>'http://wordpress.org/plugins/hello-dolly/','The package contains no files.'=>'Paketē nav failu!','The theme contains no files.'=>'Tēmā nav failu!','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'Lai pārskatītu labojumus, <strong>velciet slīdni pa labi vai pa kreisi</strong> vai <strong>izmantojiet pogas Iepriekšējais vai Nākamais </strong>.','Loading&hellip;'=>'Ielāde&hellip;','The item you are trying to move to the Trash no longer exists.'=>'Vienums, kuru mēģiniet pārvietot uz atkritni vairs nepastāv.','The item you are trying to restore from the Trash no longer exists.'=>'Vienums, kuru mēģiniet izņemt no atkritnes, vairs nepastāv.','This item has already been deleted.'=>'Šis vienums jau ir dzēsts.','Drag the items into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'Velciet un sakārtojiet vienumus vēlamajā secībā. Noklikšķiniet uz bultiņas vienuma labajā pusē, lai redzētu papildus iestatījumus.','If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'Ja vēl neesat izveidojis nevienu izvēlni, lai sāktu<strong>klikšķiniet &#8217;Jaunas izvēlnes izveidošana&#8217; </strong>. ','From this screen you can review, compare, and restore revisions:'=>'Šajā ekrānā jūs varat pārskatīt, salīdzināt un atjaunot labojumus:','Revisions are saved copies of your post or page, which are periodically created as you update your content. The red text on the left shows the content that was removed. The green text on the right shows the content that was added.'=>'Labojumi ir saglabātas jūsu ziņas vai lapas kopijas, kas periodiski tiek radītas, kad jūs atjauniniet vai labojiet tekstu. Sarkanais teksts kreisajā pusē rāda to, kas tika noņemts. Zaļais teksts labajā pusē rāda to, kas tika pievienots.','This screen is used for managing your content revisions.'=>'Šo ekrānu lieto, lai pārvaldītu jūsu satura labojumus.','To restore a revision, <strong>click Restore This Revision</strong>.'=>'Lai atgūtu labojuma versiju, klikšķiniet <strong>Atjaunot šo labojumu</strong>.','Followed by post revision infoTo:'=>'Kam:','Followed by post revision infoFrom:'=>'No:','Button label for a next revisionNext'=>'Nākamais','Button label for a previous revisionPrevious'=>'Iepriekšējais','%1$s by %2$s.'=>'%1$s no %2$s','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'Pievienojiet vienu vai vairākus ierakstus vienlaikus, <strong>atzīmējot izvēles rūtiņu blakus katram vienumam un klikšķinot Pievienot izvēlnei</strong>','Add, organize, and modify individual menu items'=>'Pievienot, pārkārtot un pārveidot atsevišķus izvēlnes vienumus','Assigned Menu'=>'Piešķirtā izvēlne','Audio Codec:'=>'Audio kodeks','Audio Format:'=>'Audio formāts:','Create, edit, and delete menus'=>'Kopēt, rediģēt un dzēst izvēlnes','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'Izvēlnes vienuma dzēš <strong>atverot to un klikšķinot saiti Noņemt</strong>','Edit Menus'=>'Labot izvēlnes','Editing Menus'=>'Labot izvēlnes','From this screen you can:'=>'Šajā ekrānā jūs varat:','Genre: %s.'=>'Žanrs: %s','Manage Locations'=>'Pārvaldīt atrašanās vietas','Menu Management'=>'Izvēlņu pārvaldība','Menu locations updated.'=>'Atjauninātas izvēlņu atrašanās vietas.','Released: %d.'=>'Izlaists: %d.','Select a Menu'=>'Atlasiet izvēlni','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'Izvēlnes vadības lodziņu ekrāna augšdaļā izmanto, lai kontrolētu, kura izvēlne tiek atvērta redaktorā.','Theme Location'=>'Atrašanās vietas tēmā','This screen is used for globally assigning menus to locations defined by your theme.'=>'Šo ekrānu lieto, lai globāli piešķirtu izvēlnes vietās, kas definētas jūsu aktīvajā tēmā.','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'Ja vēlaties pievienotu jaunu izvēlne tā vietā lai piešķirtu esošo, <strong>klikšķiniet saiti &#8217;Lietot jaunu izvēlnes saiti &#8217;</strong>. Jūsu jaunā izvēlne tiks automātiski pievienota attiecīgajā tēma vietā.','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'Lai rediģētu izvēlni, kas piešķirta tēmas atrašanās vietai, klikšķiniet līdzās esošo saiti <strong>Labot</strong>','To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong>'=>'Lai rediģētu esošu izvēlni, <strong>izvēlieties kādu no nolaižamā saraksta un noklikšķiniet uz Izvēlieties</strong>','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'Lai pārkārtotu izvēlnes vienumus, <strong>pārvelciet tos ar peli vai lietojot tastatūru</strong>. Velciet vai pārvietojiet izvēlnes elementu mazliet pa labi, lai padarītu to par apakšizvēlni.','Track %1$s of %2$s.'=>'%1$s celiņš no %2$s.','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'Atsevišķām izvēlnēm varat piešķirt atrašanās vietu tēmā<strong>atzīmējot vēlamos iestatījumus</strong> izvēlnes redaktoru apakšā. Lai piešķirtu izvēlnes visu tēmu vietās uzreiz, <strong>atveriet cilni Pārvaldīt atrašanās vietas</strong> ekrāna augšpusē.','Your latest changes were saved as a revision.'=>'Jūsu pēdējās veiktās izmaiņas ir saglabātas kā labojums.','menuEdit'=>'Rediģēt','menuUse new menu'=>'Lietot jauno izvēlni','This screen is used for managing your navigation menus.'=>'Šo ekrānu lieto, lai pārvaldītu jūsu navigācijas izvēlnes.','Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.'=>'Katra navigācijas izvēlna var saturēt apkopojumu no dažādām saitēm uz lapām, kategorijām, pielāgotām saitēm vai citu satura veidu. Izvēlnes saites tiek pievienotas, izvēloties vienumus no atveramajiem lodziņiem kreisajā pusē.','To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s dropdown</strong>. When you are finished, <strong>click Save Changes</strong>'=>'Lai piešķirtu izvēlnes vienā vai vairākās tēmas vietās, <strong>atlasiet izvēlni katras atrašanās vietas nolaižamajā sarakstā</strong>. Kad esat beidzis, klikšķiniet <strong>Saglabāt izmaiņas</strong>.','Restore This Revision'=>'Atjaunot šo labojumu','Capabilities'=>'Iespējas','Denied: %s'=>'Liegts: %s','Move'=>'Pārvietot','Down one'=>'Lejup par vienu','Menu Settings'=>'Izvēlnes iestatījumi','To the top'=>'Uz pašu augšu','Up one'=>'Augšup par vienu','Menu structure'=>'Izvēlnes struktūra','Draft created on %1$s at %2$s'=>'Melnraksts veidots %1$s plkst. %2$s.','%s has taken over and is currently editing.'=>'%s ir pārņēmis un pašlaik rediģē.','You cannot move this item to the Trash. %s is currently editing.'=>'Jūs nevarat pārvietot šo vienums uz atkritni. %s šobrīd to labo.','Select a menu to edit:'=>'Atlasiet izvēlni, kuru rediģēt:','Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.'=>'Paldies par jaunināšanu. Lūdzu, apmeklējiet lapu <a href="%s">Tīkla jaunināšana </a>, lai atjauninātu visas jūsu vietnes.','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'Visi pareizi! Jūs esat pabeiguši šo instalācijas daļu. WordPress tagad var sazināties ar jūsu datu bāzi. Ja esat gatavs, laiks doties;&hellip;','Client version'=>'Klienta versija','Auto add pages'=>'Automātiski pievienot lapas','Give your menu a name, then click Create Menu.'=>'Nosauciet savu izvēlni, un pēc tam klikšķiniet Izveidot izvēlni.','Selected menus have been successfully deleted.'=>'Atlasītās izvēlnes ir veiksmīgi dzēstas.','Edit your default menu by adding or removing items. Drag the items into the order you prefer. Click Create Menu to save your changes.'=>'Rediģējiet noklusēto izvēlni, pievienojot vai noņemot vienumus. Velciet katru vienumu un novietojiet to secībā, kādā vēlaties. Noklikšķiniet uz Izveidot izvēlni, lai saglabātu veiktās izmaiņas.','Look Up'=>'Apskatīt','For PHP files, you can use the documentation dropdown to select from functions recognized in that file. Look Up takes you to a web page with reference material about that particular function.'=>'PHP failiem jūs varat izmantot dokumentācijas nolaižamo izvēlni, lai atlasītu kādu no failā atpazītajām funkcijām. Poga Apskatīt aizvedīs jūs uz vietni ar uzziņas materiālu (angļu valodā) par šo konkrēto funkciju.','The documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.'=>'Dokumentācijas izvēlnē zem redaktora uzskaitītas spraudņa failā atpazītās PHP funkcijas. Klikšķinot Apskatīt, jūs nonāksiet tīmekļa lapā, kur ir aprakstīta šī konkrētā funkcija.','%s is currently editing'=>'%s šobrīd labo','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'Augšupielādētus multivides failus (attēlus, audio, dokumentus, u.c.) jūs varat ievietot klikšķinot pogu Pievienot failu. Jūs varat izvēlēties attēlus un failus no jau augšupielādēto multivides failu bibliotēkas vai augšupielādēt jaunu multivides failu, ko pievienot savai lapai vai ziņai. Lai izveidotu attēlu galeriju, izvēlieties pievienojamos attēlus un klikšķiniet izvēlni &#8220;Izveidot jaunu galeriju&#8221;.','Image rotation is not supported by your web host.'=>'Attēls pagriešanu neatbalsta jūsu vietnes uzturētājs.','If you are looking to use the link manager, please install the <a href="%s">Link Manager plugin</a>.'=>'Ja vēlaties izmantot saišu pārvaldnieku, lūdzu, instalējiet spraudni<a href="%s">Saišu pārvaldnieks</a> s.','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>Pamata termins</strong> &mdash; kategorijām, atšķirībā no birkām, var būt hierarhija. Jums varētu būt kategorija &#8217;koki&#8217;, un zem tās apakškategorijas &#8217;ozoli&#8217; un &#8217;liepas&#8217;. Tomēr, hierarhija nav obligāta. Lai izveidotu apakškategoriju, vienkārši izvēlieties par pamatkategoriju, kādu no nolaižamā saraksta.','Several boxes on this screen contain settings for how your content will be published, including:'=>'Vairāki lodziņi šajā ekrānā satur iestatījumus tam, kā jūsu saturs tiks publicēta, ieskaitot:','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'Virsraksta lauks un lielais ziņu rediģēšanas apgabals ir fiksēti, bet visus pārējos lauciņus var pārvietot pārvelkot. Jūs var arī minimizēt vai paplašināt tos, klikšķinot uz katra lodziņa nosaukuma joslas. Izmantojiet Ekrāna opciju cilni, lai parādītu vairākus lodziņus (Izraksts, Sūtīt atsauces notifikācijas, Pielāgotie lauki, Diskusijas, Taka, Autors) vai izvēlaties šī ekrāna 1 vai 2 sleju izkārtojumu.','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'Lai izmantotu fona attēlu, vienkārši augšupielādējiet to vai izvēlieties kādu, kas jau ir augšupielādēts multivides bibliotēkā, klikšķinot pogu "Izvēlēties attēlu". Attēlu varat parādīt vienu, vai flīzēt to, lai aizpildītu visu ekrānu. Jūsu fona attēls var būt fiksēts savā vietā un jūsu vietnes saturs kustēsies tam pāri, vai varat ritināt attēlu kopā ar vietnes saturu.','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'Mainot tēmas, nereti ir atšķirības logrīku apgabaliem un skaitam sānjoslās un reizēm šo konfliktu rezultātā pāreja norit mazāk gludi. Ja esat mainījis tēmām un, jums šķiet, kā trūkst logrīki, ritiniet uz leju šajā ekrānā uz Neaktīvo logrīku apgabalu, kur visi jūsu logrīki un to iestatījumi tiek saglabāti.','Inserting Media'=>'Multivides faila ievietošana','Do not forget to click &#8220;Save Changes&#8221; when you are done!'=>'Neaizmirstiet klikšķināt pogu &#8220;Saglabāt izmaiņas&#8220;, kad esat pabeidzis!','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'Jūs izmantojat vairāku failu augšupielādi. Ja rodas sarežģījumi, pamēģiniet <a href="%1$s" %2$s>pārlūkprogrammas augšupielādes</a> veidu.','media itemEdit'=>'Rediģēt','colorDefault: %s'=>'Pēc noklusējuma: %s','column nameUploaded to'=>'Augšupielādēts','The uploaded file is not a valid image. Please try again.'=>'Augšupielādēts fails nav derīgs attēls. Mēģiniet kādu citu.','Choose a Background Image'=>'Izvēlēties fona attēlu','Choose a Custom Header'=>'Izvēlēties pielāgotu galveni','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Fona krāsu jūs varat izvēlēties klikšķinot pogu Atlasīt krāsas un tad ierakstīt HTML heksadecimālo vērtību, piem. &#8220;#ff0000&#8221; sarkanai krāsai, vai izvēlēties krāsu, izmantojot krāsu paleti.','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'Fona krāsu jūs varat izvēlēties klikšķinot pogu Atlasīt krāsas un vai nu rakstīt HTML heksadecimālo vērtību, piem. &#8220;#ff0000&#8221; sarkanai krāsai, vai izvēlēties krāsu, izmantojot krāsu paleti.','In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'Slejā <strong>Atbildot uz</strong> ir trīs elementi. Teksts ir ziņa, kas iedvesmoja, komentārus un saite uz ziņas rediģēšanu. Apskatīt ziņu ir saite ziņas aplūkošanai vietnē. Nelielais burbulis ar skaitli tajā, parāda apstiprināto komentāru skaitu, ko ziņa ir saņēmusi. Ja ziņai ir gaidoši komentāri, to skaitu redzēsiet sarkanā aplī. Klikšķinot sarkano paziņojuma aplīti, filtrs atlasīs vienīgi šīs ziņas neapstiprinātos komentārus.','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1$s: %2$s <strong> pašreizējais lietotājs netiks dzēsts</strong>.','Used: %1$s%% of %2$s'=>'Izlietoti: %1$s no %2$s','Please select an option.'=>'Lūdzu, atlasiet opciju.','Allow search engines to index this site'=>'Ļaut meklētājprogrammām indeksēt šo vietni','Discourage search engines from indexing this site'=>'atturēt meklētājprogrammas indeksēt šo vietni','Get Favorites'=>'Rādīt favorītus','If you have marked plugins as favorites on WordPress.org, you can browse them here.'=>'Ja WordPress.org esat atzīmējis spraudņu izlasi(favorites), varat pārlūkot tos šeit.','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'Ja vēlaties instalēt spraudni, ko lejupielādējāt citā vietā, klikšķiniet pogu Augšupielādēt spraudni virs spraudņu saraksta. Jums tiks piedāvāts augšupielādēt .zip pakotni un tad varēsiet aktivizēt jauno spraudni.','It is up to search engines to honor this request.'=>'Šīs prasības godīga ievērošana ir atkarīga no konkrētas meklētājprogrammas.','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'Laipni lūdzam WordPress %1$s. Jūs tiksiet novirzīts uz ekrānu Par WordPress. Ja tā nenotiek, klikšķiniet <a href="%2$s">šeit</a>.','Welcome to WordPress!'=>'Laipni lūdzam WordPress!','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'Varat pārlūkot arī savus iecienītākos spraudņus, izmantojot sarakstu Favorīti un ievadot savu WordPress.org lietotājvārdu, ja tas tiek prasīts.','Your WordPress.org username:'=>'Jūsu WordPress.org lietotājvārds:','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'Kad esat to izdarījis, klikšķiniet &#8220;Sākt uzstādīšanu&#8221;.','Search engine visibility'=>'Redzamība meklētājprogrammās ','Search engines discouraged'=>'Meklētājprogrammu piekļuve ir apturēta','If you know what you are looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.'=>'Ja zināt, ko meklējat, vislabākā izvēle ir Meklēšana. Meklēšanas ekrānā ir iespējas meklēt WordPress spraudņu direktorijā pēc konkrēta termina, autora vai birkas. Katalogā var meklēt arī, izvēloties populāras birkas. Lielāka burta birkas nozīmē, ka ar šo birku ir marķēti vairāk spraudņu.','Plugin InstallerFavorites'=>'Favorīti','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'Šai <a href="%1$s"> apakštēmai</a> ir nepieciešama tās pamattēma, %2$s.','Search by author'=>'Meklēt pēc autora','Contextual Help Tab'=>'Kontekstuālas palīdzība cilne','Screen Options Tab'=>'Ekrāna opciju cilne','Search by keyword'=>'Meklēšana pēc atslēgvārdu','Search by tag'=>'Meklēt pēc birkas','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'Lai instalētu tēmu un varētu to priekšskatīt ar jūsu vietnes saturu, kā arī lai pielāgotu tēmas iespējas, klikšķiniet pogu "Instalēt" tēmas sīktēla apakšpusē vai Detaļu un priekšskatījuma ekrāna kreisās malas augšpusē. Tēmas faili tiks automātiski lejupielādēti jūsu vietnē. Kad tas būs pabeigts, tēma būs pieejama aktivizācijai. Dodieties uz ekrānu Tēmas un klikšķiniet pogas Aktivizēt vai Priekšskats zem instalētās tēmas sīktēla.','Type of search'=>'Meklēšanas tips','widgetAdd'=>'Pievienot','widgetEdit'=>'Labot','Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.'=>'Lapu veidošana ir ļoti līdzīga ziņu veidošanai. Arī ekrāna izskatu var pielāgot tāpat, izmantojot ekrāna opciju cilni, pārvelkot un ja nepieciešams, izvēršot vai sakļaujot lodziņus. Arī šajā ekrānā ir netraucētas rakstīšanas iespēja, pieejama ar netraucētas rakstīšanas pogu gan vizuālajā, gan teksta režīmā. Lapas redaktors visumā darbojas tāpat kā ziņu redaktors, vienīgi te ir daži, lapām raksturīgi līdzekļi, lapas atribūtu lodziņā.','Select comment'=>'Izvēlieties komentāru','Skip to main content'=>'Pārietu uz galveno saturu','Tags can be selectively converted to categories using the <a href="%s">tag to category converter</a>.'=>'Birkas var selektīvi pārvērsts kategorijās, izmantojot <a href="%s">birku-kategoriju pārveidotāju</a>.','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'Jūs varat dzēst Saišu kategorijas izmantojot Lielapjoma darbību nolaižamo sarakstu, bet šī darbība neizdzēsīs saites kategorijā. Tā vietā, tās tiks pārvietotas uz noklusējuma saišu kategoriju.','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'Attēlu, kas tiek rādīts jūsu vietnes augšdaļā, varat augšupielādēt no datora vai izvēlēties no multivides bibliotēkas. Pēc attēla izvēles, to varat kadrēt apgriežot.','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'Vietnei varat iestatīt pielāgotu galvenes attēlu. Vienkārši augšupielādējiet attēlu un kadrējiet to, un jaunais attēls uzreiz būs redzams. Varat arī izmantot attēlu, kas jau atrodas jūsu multivides bibliotēkā, klikšķinot pogu &#8221;Izvēlēties attēlu&#8220;.','Skip Cropping, Publish Image as Is'=>'Izlaist apgriešanu, publicēt attēlu bez izmaiņām','Or choose an image from your media library:'=>'Vai izvēlēties attēlu no jūsu multivides bibliotēkas:','Select Image'=>'Izvēlies attēlu','Choose Image'=>'Izvēlēties attēlu','Collapse'=>'Sakļaut','If you do not want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.'=>'Ja nevēlaties, lai galvenes attēls vispār netiktu rādīts jūsu vietnē, noklikšķiniet uz pogas &#8220;Noņemt galvenes attēlu&#8221;, kas atrodas šīs lapas sadaļas Header Image apakšā. Ja vēlāk vēlaties atkal aktivizēt galvenes attēlu, jums tikai jāizvēlas kāda no citām attēlu opcijām un jānoklikšķina &#8220;Saglabāt izmaiņas&#8221;.','This theme is already installed and is up to date'=>'Ir instalēta šīs tēmas jaunākā versija','pluginInstalled'=>'Instalēti','Previewing and Customizing'=>'Priekšskatīt un pielāgot','Previewing and Installing'=>'Priekšskatīt un instalēt','Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you are interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.'=>'Kad esat izveidojis tēmu sarakstu, varat veikt priekšskatījumu un instalēt jebkuru no tām. Noklikšķiniet uz tās tēmas sīktēla, kuru vēlaties apskatīt. Tā atvērsies pilnekrāna priekšskatījuma lapā, lai gūtu labāku priekšstatu par to, kā šī tēma izskatīsies.','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'Jūs izmantojat pārlūka iebūvēto failu augšupielādi. Ar WordPress augšupielādētāju var atlasīt vairākus failu vienlaicīgi un izmantot pārvilkšanas iespēju. <a href="#">Pārslēdzieties uz daudzfailu augšupielādi</a>.','Preview %s'=>'Priekšskatījums %s','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'Kategorijām ir hierarhija, tas nozīmē, ka tām var būt apakškategorijas. Birkām hierarhiju nav. Dažkārt, lietojot kategoriju vai birku, tikai pēc zināma laika redzam, ka būtu bijis labāk, ja birka būtu kategorija vai otrādāk.','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'Kategorijas un birku pārveidotāja saite šajā ekrānā jūs aizvedīs uz Importa ekrānu, kur šis pārveidotājs ir viens no spraudņiem, ko iespējams instalēt. Pēc instalēšanas un aktivizēšanas šis spraudnis jūs aizvedīs uz ekrānu kur jūs varēsiet atlasīt vienumus, lai pārvērstu birkas kategorijās vai otrādi.','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'Ja jūsu tēmā ir vairāk par vienu noklusējuma galvenes attēlu, vai arī esat augšupielādējis vairāk nekā vienu galvene attēlu, jūs ir iespēja likt WordPress parādīt nejaušā secībā kādu no attēliem katrā lapā jūsu vietnē. Aizzīmējiet &#8220;Random&#8221; radio pogu blakus Augšupielādēt attēlu vai ari varat iespējot šo līdzekli noklusējuma sadaļā.','This screen is used to customize the header section of your theme.'=>'Šajā ekrānā varat pielāgot jūsu tēmas galvenes sadaļu.','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'Jūs varat izvēlēties no tēmas noklusējuma galvenes attēliem, vai arī izmantot pats savu. Varat arī pielāgot jūsu vietnes virsrakstu un devīzi.','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.'=>'Lielākajai daļai tēmu galvenes teksts ir jūsu vietnes virsraksts un devīze, kas definēti sadaļā <a href="%s">Vispārīgie iestatījumi</a>.','Some themes come with additional header images bundled. If you see multiple images displayed, select the one you would like and click the &#8220;Save Changes&#8221; button.'=>'Dažas tēmas piedāvā papildu galvenes attēlus. Ja tēmā redzat vairākus attēlus, izvēlieties to, kas jums patīk un klikšķiniet pogu &#8220;Saglabāt izmaiņas&#8221;.','Configuration Error'=>'Konfigurācija kļūda','Revert to the <strong>Browser Uploader</strong> by clicking the link below the drag and drop box.'=>'Lai atgrieztos pie <strong>pārlūka augšupielādētāja</strong>, klikšķiniet saiti zem pārvilkšanas lodziņa.','User deleted.'=>'Lietotājs dzēsts.','Could not copy files. You may have run out of disk space.'=>'Failus nevarēja kopēt. Iespējams, vairs nav brīvas vietas.','Find a theme based on specific features.'=>'Atrodiet tēmu, pamatojoties uz īpašās iezīmēm.','Search for themes by keyword.'=>'Meklēt tēmu pēc atslēgvārda.','In all likelihood, these items were supplied to you by your web host. If you do not have this information, then you will need to contact them before you can continue. If you are ready&hellip;'=>'Visticamāk, šos vienumus jums piegādāja vietnes uzturētājs. Ja šīs informācijas jums nav, lai varētu turpināt, ir jāsazinās ar servera administratoru. Ja esat gatavs&hellip;','This theme is broken.'=>'Šī tēma ir sabojāta','Set as background'=>'Iestatīt kā fonu','Set as header'=>'Iestatīt kā galveni','Customize &#8220;%s&#8221;'=>'Pielāgot &#8220;%s&#8221;','Plugin'=>'Spraudnis','(required)'=>'(obligāts)','All'=>'Visi','Edit Link'=>'Rediģēt saiti','Edit comment'=>'Rediģēt komentāru','Enter a link URL or click above for presets.'=>'Ievadiet saites URL vai klikšķiniet virs sākotnējiem iestatījumiem.','Link URL'=>'Saites URL','No comments yet.'=>'Vēl nav komentāru.','Select All'=>'Iezīmēt visu','Version:'=>'Versija:','Word count: %s'=>'Vārdu skaits: %s','Collapse Sidebar'=>'Sakļaut sānjoslu','Preview:'=>'Priekšskatīt:','<strong>Error:</strong> Please enter a nickname.'=>'<strong>Kļūda</strong>: Lūdzu ievadiet savu segvārdu.','https://wordpress.org/about/'=>'https://lv.wordpress.org/about/','Public, Sticky'=>'Publisks, piesprausts','Privately Published'=>'Publicēts privāti ','Save as Pending'=>'Saglabāt kā gaidošu','<strong>Error:</strong> This email is already registered. Please choose another one.'=>'<strong>Kļūda</strong>: Šis e-pasts jau ir reģistrēts. Lūdzu, izvēlieties citu.','E-mail'=>'E-pasts','Preparing to install <strong>%1$s %2$s</strong>&#8230;'=>'Gatavojas instalēt <strong>%1$s %2$s</strong>&#8230;','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'Veiksmīgi instalēta pamattēma <strong>%1$s %2$s</strong>.','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'Pašlaik ir instalēta pamattēma <strong>%1$s %2$s</strong>.','This theme requires a parent theme. Checking if it is installed&#8230;'=>'Šai tēmai ir nepieciešama pamattēma. Pārbaudiet, vai tā ir uzstādīta &#8230;','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong>Pamattēma nav atrodama</strong>. Jums vajadzēs uzstādīt pamattēmu %s, pirms varēsiet lietot šo apakštēmu.','Header Text'=>'Galvenes teksts','Show header text with your image.'=>'Rādīt attēla virsraksta tekstu.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'Ir pieejama jauna %1$s versija. <a href="%2$s" %3$s> Skatīt versijas %4$s detaļas</a> vai <a href="%5$s" %6$s> tūlīt jaunināt</a>.','By %s.'=>'%s','Add Comment'=>'Pievienot komentāru','Add New Comment'=>'Pievienot jaunu komentāru','Hello Dolly'=>'Hello Dolly','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'Tas nav tikai spraudnis, tas simbolizē veselas paaudzes cerības un entuziasmu apkopotu divos vārdos, kas vislabāk pazīstami Lūisa Ārmstronga izpildītajā Hello, Dolly. Kad spraudnis ir aktivizēts, jūs katrā administratora ekrāna lappuses augšējā labajā stūrī redzēsiet kādu no <cite> Hello, Dolly </ cite> lirikas rindiņām.','http://ma.tt/'=>'http://ma.tt/','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>Laipni lūdzam</strong> &mdash; šeit ir redzamas saites uz dažiem parastajiem uzdevumiem, kas veicami, veidojot jaunu vietni.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'Ir pieejama jauna %1$s versija. <a href="%2$s" %3$s>Skatīt versijas %4$s detaļas</a>. <em>Automātiska jaunināšana šai tēmai nav pieejama.</em>','HowdyWelcome'=>'Sveicināti','Delete My Site Permanently'=>'Neatgriezeniski dzēst manu vietni','Remember, once deleted your site cannot be restored.'=>'Atcerieties, jūsu vietne reiz izdzēsta, nevarēs tikt atjaunota.','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'Paldies, ka izmantojāt %s, jūsu vietne ir dzēsta. Laimīgu ceļu, lai līdz nākamajai reizei.','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'Paldies. Lūdzu, pārbaudiet savu e-pastu, lai apstiprinātu savu rīcību. Jūsu vietne netiks dzēsta, kamēr vietnes dzēšanas netiks apstiprināta.','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'Ja jūs vairs nevēlaties izmantot savu %s vietni, to varat dzēst, izmantojot zemāk esošo formu. Noklikšķinot uz <strong>Neatgriezeniski dzēst manu vietni</strong> un jums tiks nosūtīts e-pasts ar saiti tajā. Noklikšķinot uz atsūtītās saites, jūsu vietne tiks dzēsta.','Sorry, the link you clicked is stale. Please select another option.'=>'Atvainojiet, saite, uz kuras jūs noklikšķinājāt ir novecojusi. Lūdzu, atlasiet citu opciju.','I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.'=>'Es esmu pārliecināts, ka vēlos neatgriezeniski dzēst savu vietni, un es apzinos, ka nekad vairs nevarēšu to atgūt vai lietot %s.','View Site'=>'Skatīt lapu','American English'=>'Amerikāņu angļu','British English'=>'Britu angļu','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>'Ja jūs esat nonācis šajā ekrānā nejauši, domājot apmeklēt kādu no savām vietnēm, piedāvājam dažas saīsnes, kas palīdzēs jums atrast ceļu.','MB (Leave blank for network default)'=>'MB (atstājiet tukšu tīkla noklusējumam)','Primary Site'=>'Primārā vietne','Visit Dashboard'=>'Apmeklēt paneli','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'Jūs mēģinājāt piekļūt "%1$s" panelim, bet jums pašlaik nav privilēģiju šajā vietnē. Ja jūs uzskatāt, ka jums vajadzētu būt iespējai piekļūt "%1$s" panelim, lūdzu, sazinieties ar tīkla administratoru.','Your Sites'=>'Jūsu vietnes','[%s] New Admin Email Address'=>'[%s] Jaunā Admin e-pasta adrese','Disabled'=>'Atspējots','Paused <span class="count">(%s)</span>'=>'Apturēts <span class="count">(%s)</span>' . "\0" . 'Apturēti <span class="count">(%s)</span>' . "\0" . 'Apturēti <span class="count">(%s)</span>','Global Settings'=>'Globālie iestatījumi','The primary site you chose does not exist.'=>'Primārā vietne, kuru esat izvēlējies, neeksistē.','You must be a member of at least one site to use this page.'=>'Jums jābūt dalībniekam vismaz vienā vietnē, lai izmantotu šo lapu.','Database name'=>'Datu bāzes nosaukums','Database username'=>'Datu bāzes lietotājvārds','Database password'=>'Datu bāzes parole','Database Name'=>'Datu bāzes nosaukums','Database Host'=>'Datu bāzes resursdators','Database host'=>'Datu bāzes resursdators','Let&#8217;s go!'=>'Ejam!','Table Prefix'=>'Tabulu prefikss','Table prefix (if you want to run more than one WordPress in a single database)'=>'Tabulas prefikss (ja vēlaties lietot vairākas WordPress instalācijas vienā datu bāzē)','WordPress &rsaquo; Setup Configuration File'=>'WordPress &rsaquo; iestatījumu konfigurācijas fails','example passwordpassword'=>'parole','example usernameusername'=>'lietotājvārds','Sorry, I need a %s file to work from. Please re-upload this file to your WordPress installation.'=>'Atvainojiet, ir nepieciešams %s fails ar kuru darboties. Lūdzu, augšupielādējiet atkārtoti šo failu jūsu WordPress instalācijas vietnē.','The file %1$s already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'Fails %1$s jau eksistē vienu līmeni augstāk virs jūsu WordPress instalācijas. Ja jums nepieciešams atiestatīt kādus konfigurācijas vienumus šajā failā, to vispirms jādzēš. Un tad jāmēģina <a href="%2$s">instalēt no jauna</a>.','The file %1$s already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s datne jau eksistē. Ja jums nepieciešams atiestatīt kādus konfigurācijas vienumus šajā datnē, lūdzu pirms tam to nodzēsiet. Jūs variet mēģināt <a href="%2$s">uzstādīt tagad</a>.','If you want to run multiple WordPress installations in a single database, change this.'=>'Ja plānojat izmantot vairākas WordPress instalācijas vienā datubāzē, mainiet šo iestatījumu.','Below you should enter your database connection details. If you are not sure about these, contact your host.'=>'Zemāk jāievada datu bāzes savienojuma informācija. Ja neesat pārliecināts par šiem jautājumiem, sazinieties ar vietnes uzturētāju.','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'Šī lapa veikts automātisku datu bāzes problēmu novēršanu. Lūdzu, pievienojiet šādu rindiņu %s failam. Kad šī rinda būs pievienota, jūsu konfigurācijas fails šo lapu ielādēs no jauna.','No comments awaiting moderation.'=>'Neviens komentārs negaida pārbaudi.','Plugin installer section titleChangelog'=>'Izmaiņu žurnāls','Plugin installer section titleDescription'=>'Apraksts','Plugin installer section titleFAQ'=>'BIEŽĀK UZDOTIE JAUTĀJUMI','Plugin installer section titleInstallation'=>'Uzstādīšana','Plugin installer section titleOther Notes'=>'Citas piezīmes','Plugin installer section titleScreenshots'=>'Ekrānuzņēmumi','Plugin Homepage &#187;'=>'Spraudņa mājas lapa &#187;','Failed to repair the %1$s table. Error: %2$s'=>'Neizdevās salabot tabulu %1$s. Kļūda: %2$s','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'Varat eksportēt failu ar jūsu vietnes saturu, lai to importētu citā instalācijā vai platformā. Eksporta fails būs XML faila formātā, ko sauc par WXR. Ziņas, lapas, komentāri, pielāgotie lauki, kategorijas un birkas var tikt iekļautas. Varat izvēlēties WXR failā iekļautu tikai noteiktas ziņas vai lapas, iestatot nolaižamajā sarakstā filtrus, lai ierobežotu eksportu pēc kategorijas, autora, datuma diapazona mēnešos, vai publicēšanas statusa.','New users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain their password. Check the box if you do not want the user to receive a welcome email.'=>'Jaunais lietotājs saņems e-pastu ar informāciju par to, ka viņš ir pievienots kā lietotājs šajā vietnē. E-pasta vēstulē būs arī viņa parole. Aizzīmējiet rūtiņu, ja nevēlaties, lai lietotājs saņem šo sveiciena e-pastu.','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'Iepriekšējās WordPress versijās visi importētāji bija iebūvēti. Nu tie pārvērsti par spraudņiem, jo vairums cilvēku tos lieto reti vai tikai vienreiz.','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'Ir nesaglabātas izmaiņas, kas tiks zaudētas. \'Labi\', lai turpinātu \'Atcelt\', lai atgrieztos attēlu redaktorā.','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'Jūs varat filtrēt sarakstu pēc lietotāja lomas, izmantojot teksta saites virs lietotāju saraksts, lai parādītu Visus, Administratorus, Redaktorus, Autorus, Līdzstrādniekus vai Abonētājus. Noklusējumā rāda visus lietotājus. Saites uz neizmantotām lietotāju lomām netiek rādītās.','Post via email settings allow you to send your WordPress installation an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.'=>'Publicēt ar e-pastu, iestatījumi ļauj jums instalēt e-pasta saņemšanu ar jūsu ziņu WordPress. Lai to lietotu, jums jāizveido slepens e-pasta konts ar POP3 un jebkura e-pasta vēstule nosūtīta uz šo adresi tiks publicēta. Tāpēc šai adresei jābūt ļoti slepenai.','Enter the email address of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'Uzaiciniet šajā tīklā esošu lietotāju uz šo vietni, ievadot e-pasta adresi. Šai personai tiks nosūtīts e-pasts ar lūgumu apstiprināt uzaicinājumu.','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'Uzaiciniet šajā tīklā esošu lietotāju uz šo vietni, ievadot e-pasta adresi vai lietotājvārdu. Šai personai tiks nosūtīts e-pasts ar lūgumu apstiprināt uzaicinājumu.','Image could not be processed. Please go back and try again.'=>'Attēlu nevarēja apstrādāt. Lūdzu, atgriezieties un mēģiniet vēlreiz.','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'Labošana pabeigta. Lūdzu dzēsiet sekojošo rindiņu no wp-config.php lai neļautu neautorizētiem lietotājiem izmanto šo lapu.','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'%1$s tabula nav kārtībā. Ir noteikta šāda kļūda: %2$s. WordPress mēģinās labot šo tabulu&hellip;','The active theme is broken. Reverting to the default theme.'=>'Aktīva tēma ir bojāta. Atstata noklusējuma tēmu.','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'Šai ziņai nav pieejama jaunāka, automātiski saglabāta versija par to, kas redzama zemāk. <a href="%s">Skatīt automātiski saglabāto</a>','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'WordPress var mēģināt optimizēt datu bāzi. Tas uzlabo veiktspēju, dažās situācijās. Datu bāzes labošana un optimizēšana var aizņemt daudz laika un šai laikā datu bāze nebūs pieejama.','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'WordPress var automātiski meklēt dažas bieži sastopamās datu bāzu problēmas un veikt to novēršanu. Labojumi var aizņemt kādu laiku, tāpēc, lūdzu, esiet pacietīgi.','Show Toolbar when viewing site'=>'Skatot vietni(es) rādīt rīkjoslu','For more information, see <a href="%s">the release notes</a>.'=>'Vairāk informāciju skatīt <a href="%s">Laidiena piezīmes</a>.','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong>Versijā %1$s</strong> ir izlabota %2$s kļūda.' . "\0" . '<strong>Versijā %1$s</strong> ir izlabotas %2$s kļūdas.' . "\0" . '<strong>Versijā %1$s</strong> ir izlabotas %2$s kļūdas.','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong>Versijā %1$s</strong> tika risinātas drošības problēmas un izlabotas %2$s kļūdas.' . "\0" . '<strong>Versijā %1$s</strong> tika risinātas drošības problēmas un izlabotas %2$s kļūdas.' . "\0" . '<strong>Versijā %1$s</strong> tika risinātas drošības problēmas un izlabotas %2$s kļūdas.','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong>Versijā %1$s</strong> ir atrisinātas dažas drošības problēmas un 
izlabotas %2$s kļūdas.' . "\0" . '<strong>Versijā %1$s</strong> ir atrisinātas dažas drošības problēmas un 
izlabota %2$s kļūda.' . "\0" . '<strong>Versijā %1$s</strong> ir atrisinātas dažas drošības problēmas un 
izlabotas %2$s kļūdas.','Maintenance Release'=>'Apkopes laidiens','Maintenance and Security Release'=>'Apkopes un drošības laidiens','Security Release'=>'Drošības laidiens','What&#8217;s New'=>'Kas jauns?','<strong>Version %s</strong> addressed some security issues.'=>'<strong>Versijā %s</strong> atrisinātas dažas drošības problēmas.','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'Šis ekrāns ļauj jums izvēlēties jūsu vietnes paliekošo saišu struktūru. Jūs var izvēlēties kādu no piedāvātajiem iestatījumiem vai izveidot pielāgotu URL struktūru.','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'Laipni lūdzam WordPress! %1$s. <a href="%2$s">Uzziniet vairāk</a>.','Adding Categories'=>'Pievienot kategorijas','Adding Tags'=>'Pievienot birkas','Troubleshooting'=>'Problēmu novēršana','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'Jūs var augšupielādēt multivides failus, pirms tam neizveidojot ziņu. Tas ļauj jums augšupielādēt failus, kurus vēlāk izmantosiet ziņām vai arī iegūt konkrēta faila saiti, ar kuru varat dalīties. Pastāv trīs iespējas, kā augšupielādēt failus:','Adding Plugins'=>'Pievienot spraudņus','Adding Themes'=>'Pievienot tēmas','Attaching Files'=>'Failu pievienošana','Authors can publish and manage their own posts, and are able to upload files.'=>'Autori var publicēt un pārvaldīt savas ziņas, un var augšupielādēt failus.','Available Actions'=>'Pieejamās darbības','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'Šeit ir īss pārskats par dažādām lietotāju lomām un atļaujām, kas piešķirtas katrai no tām:','How to Update'=>'Kā jaunināt','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'Ja jums nepieciešams importētājs nav sarakstā <a href="%s"> meklējiet spraudņu direktorijā</a>, lai redzētu, vai tāds importētājs ir pieejams.','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'Ja vēlaties pārvērst jūsu kategorijas birkās (vai otrādi), izmantojiet <a href="%s"> Kategoriju un birku pārveidotāju</a>, kas pieejams importēšanas ekrānā.','Moderating Comments'=>'Komentāru moderācija','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'Kad būsiet saglabājis lejupielādēto failu, varēsiet to izmantot Importēšanas darbībai citā WordPress instalācijā lai importētu šīs vietnes saturu.','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'Atcerieties, kad esat beidzis ievadīt tekstu, klikšķiniet pogu Pievienot jaunu lietotāju šī ekrāna apakšā.','Screen Content'=>'Ekrāna saturs','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'Šis ekrāns nodrošina piekļuvi visām jūsu ziņām. Varat pielāgot šo ekrānu, lai tas atbilstu jūsu darba stilam.','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'Lai pievienotu jaunu lietotāju jūsu vietnē, aizpildiet formu šajā ekrānā, un klikšķiniet pogu Pievienot jaunu lietotāju, ekrāna apakšā.','User Roles'=>'Lietotāju lomas','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.'=>'Jūs varat vienlaikus rediģēt vai pārvietot  uz atkritni arī vairākas ziņas. Izmantojot izvēles rūtiņas, atlasiet ziņas, ar kurām vēlaties rīkoties, pēc tam izvēlnē Lielapjoma darbības atlasiet darbību, kuru vēlaties veikt, un noklikšķiniet uz Piemērot.','Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.'=>'Abonenti var lasīt komentārus, komentēt, saņemt biļetenus utt., bet nevar izveidot regulāru vietnes saturu.','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'Satura attēlojumu šajā ekrānā varat pielāgot vairākos veidos:','Common Settings'=>'Vispārējie iestatījumi','Custom Structures'=>'Pielāgotās struktūras','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'Paliekošā saites ir pastāvīgi URL uz atsevišķām lapām un emuāra ziņām, kā arī uz jūsu kategorijām un arhīviem. Paliekošā saites ir Web adrese, ko izmanto, lai izveidotu saiti uz jūsu saturu. URL uz katru ziņu ir jābūt paliekošam &mdash; nekad nav jāmainās, tāpēc arī nosaukums ir paliekošā saite.','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'Failu augšupielādē iespējams izvēlēties ceļu un mapi augšupielādēto failu glabāšanai.','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'Jūs varat iesniegt saturu dažādos veidos; šajā ekrānā atrodami iestatījumi tiem visiem. Augšējā sadaļa kontrolē paneļa redaktoru, bet pārējie iestatījumi attiecas uz ārējām publicēšanas metodēm. Lai iegūtu vairāk informācijas par šīm metodēm, izmantojiet dokumentācijas saites.','Installing themes on Multisite can only be done from the Network Admin section.'=>'Tēmu instalēšanu Multivietnē veic tīkla administrēšanas sadaļā.','If desired, WordPress will automatically alert various services of your new posts.'=>'Ja vēlaties, WordPress automātiski brīdinās dažādus pakalpojumus par jūsu jaunāko ziņu.','Post Via Email'=>'Publicēt ar e-pastu','This screen provides many options for controlling the management and display of comments and links to your posts/pages. So many, in fact, they will not all fit here! :) Use the documentation links to get information on what each discussion setting does.'=>'Šis ekrāns sniedz daudzas opcijas vadības un attēlojuma kontrolei par komentāriem un saitēm jūsu ziņās un lapās. To ir tik daudz, ka skaidrojumi par visām pat neietilpst šeit! :) Lūdzu, izmantojiet dokumentāciju saites, lai iegūtu informāciju par to, ko dara katrs diskusiju iestatījums.','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'Jūs varat mainīt savu paroli, ieslēgt tastatūras saīsnes, mainīt jūsu WordPress administrēšanas ekrānu krāsu shēmu, un izslēgt vizuālo (WYSIWYG) redaktoru. Varat paslēpt rīkjoslu (agrāk saukta par Admin joslu) vietnes apmeklētāju skatā (front end), taču to nevar atspējot administrēšanas ekrāniem.','Inactive Sidebar (not used)'=>'Neaktīva sānjosla (neizmantota)','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'Šis sānjosla nav vairs pieejama un netiek rādīta jūsu vietnē. Lai pilnībā noņemtu šis neaktīvo sānjoslu, noņemt visus logrīkus.','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'<strong>Pārvilkt</strong> failus uz laukumu zemāk. To iespējamas darīt ar vairākiem failiem vienlaikus.','Clicking <strong>Select Files</strong> opens a navigation window showing you files in your operating system. Selecting <strong>Open</strong> after clicking on the file you want activates a progress bar on the uploader screen.'=>'Klikšķinot pogu <strong>Izvēlieties failu</strong> atvērsiet navigācijas logu, kurā būs redzami faili jūsu operētājsistēmā (datorā). Izvēloties un iezīmējot vajadzīgo failu un klikšķinot <strong>Open</strong> sāksies faila augšupielāde un tiks aktivizēta progresa josla augšupielādes ekrānā.','Missing Widgets'=>'Trūkstošas logdaļas','Removing and Reusing'=>'Noņemšana un atkārtota izmantošana','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'Saites iespējams apvienot grupās, izmantojot saišu kategorijas. Saišu kategorijas nosaukumam jābūt unikālam un Saišu kategorijas ir nodalītas no kategorijām, ko izmantojat ziņās.','You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there is no relationship from one tag to another.'=>'Jūs varat piešķirt atslēgas vārdus savām ziņām, izmantojot <strong>birkas</strong>. Atšķirībā no kategorijām, birkām nav hierarhijas, kas nozīmē, ka tās nevar apvienot grupās vai citādi savstarpēji saistīt.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'Visi augšupielādētie faili ir redzami multivides bibliotēkā, kurā jaunākie papildinājumi sarakstā ir pirmie. Ekrāna izskatu varat pielāgot, izmantot šī ekrāna opcijas.','Deleting Links'=>'Saišu dzēšana ','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'Ja multivides fails nav ievietots vai pievienots nevienai ziņai, tas būs redzams slejā Augšupielādēts un klikšķinot saiti Piesaistīt, tiks atvērts uznirstošais logs ar visu ziņu sarakstu, kurā failu varēsiet piesaistīt.','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'Saites ekrāna augšdaļas rīkjoslā ļauj jums apskatīt vietni kā apmeklētājam, nodrošina piekļuvi jūsu profilam un arī noderīgai informācijai par WordPress.','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'Lapu pārvaldīšana ļoti līdzinās ziņu pārvaldīšanai, arī ekrānu var pielāgot tādā pašā veidā.','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'Daudzi cilvēki izmanto tastatūras saīsnes, lai ātrāk pārvaldītu komentārus. Lai uzzinātu vairāk, izmantojiet saiti ekrāna malā.','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'Lapas ir līdzīgas ziņām, ar virsrakstu, pamattekstu un saistītajiem metadatiem, taču atšķirībā no ziņām, tās nav daļa no hronoloģiskās emuāru plūsmas. Lapām nevar pievienot birkas un kategorijas, bet tās var būt hierarhijā viena pret otru. Lapas var pakļaut vienu zem otras, liekot pirmo kā &#8220;pamata lapu&#8221; un veidojot lapu grupu.','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.'=>'Varat arī veikt līdzīgas darbības, kā ierobežot sarakstu, izmantojot filtrus, strādāt ar lapām, izmantojot saites, kas parādās, kad kursors atrodas virs lapu nosaukuma sarakstā vai izmantot lielapjoma darbību izvēlni, lai rediģētu meta datus vairākās lapas uzreiz.','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.'=>'Komentārus savā vietnē jūs varat pārvaldīt līdzīgi tam, kā pārvalda ziņas un pārējo saturu. Šis ekrāns ir pielāgojams tāpat kā citi pārvaldības ekrāni un darbojoties ar komentāriem varat izmantojot saites, katram atsevišķam komentāram vai lielapjoma darbības visiem vienlaicīgi.','In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and site URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.'=>'Slejā <strong>Autors</strong> papildus autora vārdam, e-pasta adresei un vietnes URL tiek norādīta arī komentētāja IP adrese. Noklikšķinot uz šīs saites, tiks parādīti visi komentāri, kas izteikti no šīs IP adreses.','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'Saites var apvienot Saišu kategorijās; Tās ir savādākas nekā kategorijas, ko lieto ziņām.','<a href="%1$s">Learn more about WordPress %2$s</a>.'=>'<a href="%1$s">Uzziniet vairāk par WordPress %2$s</a>.','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>Rediģēt</strong>, aizvedīs jūs uz ziņas rediģēšanas ekrānu. Jūs to varat sasniegt arī klikšķinot uz ziņas nosaukumu.','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong>Ātrā labošana</strong> atver ziņas metadatu iestatījumus un ļauj mainīt tos, neatstājot šo ekrānu. Izmaiņu saglabāšanai spiediet pogu Atjaunināt.','Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:'=>'Turot kursoru virs lietotājā sarakstā tiek parādīts darbību saites, kas ļauj pārvaldīt lietotāju. Jūs varat veikt šādas darbības:','Managing Pages'=>'Lapu pārvaldība','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'Jūs var slēpt vai rādīt slejas atbilstoši jūsu vajadzībām un izlemt, cik lietotāju parādīt vienā ekrānā, izmantojot cilni Šī ekrāna opcijas.','You can view all posts made by a user by clicking on the number under the Posts column.'=>'Jūs var skatīt visas ziņas ko veidojis lietotājs klikšķinot uz numuru zem ziņas slejas.','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'Poga <strong>Rediģēt</strong> aizvedīs jūs uz konkrētā lietotāja profila rediģēšanas ekrānu. Jūs tur varat nonākt arī klikšķinot uz lietotājvārda.','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong>Atkritne</strong> noņem jūsu ziņu no šī saraksta un ievieto atkritnē, no kuras variet to dzēst neatgriezeniski.','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong>Priekšskatījums</strong> parādīs, kā ziņas melnraksts izskatīsies tad, ja tiks publicēts. Priekšskatījums parādīs jums ziņu vietnes apmeklētāja skatījumā. Kuras saites būs pieejamas, ir atkarīgas no jūsu ziņas statusa.','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'Tā kā šī ir Multivietnes instalēšana, jūs varat pievienot kontus, kas jau pastāv jūsu tīklā, ievadot lietotājvārdu vai e-pastu, un piešķirot lomu. Plašākām iespējām, piemēram, paroles piešķiršanai, jums ir jābūt tīkla administratoram. Tad jūs varat izmantot saiti lidinoties ar kursoru virs lietotājvārda, lai rediģētu lietotāja profilu: Tīkla administrators > Visi lietotāji.','Welcome to WordPress %s'=>'Sveicināti WordPress %s.','Go to Dashboard &rarr; Home'=>'Atvērt sadaļu &rarr; Sākumlapa','Go to Dashboard &rarr; Updates'=>'Atvērt sadaļu &rarr; Jauninājumi','Profile updated.'=>'Profils atjaunināts.','Hi,

