izvēlētā lodziņa virsraksta joslā un pārvelciet to, līdz redzat pelēku, punktotas līnijas taisnstūri vietā, kurā lodziņš tiks ievietots.','The left-hand navigation menu provides links to all of the WordPress administration screens, with submenu items displayed on hover. You can minimize this menu to a narrow icon strip by clicking on the Collapse Menu arrow at the bottom.'=>'Izvēlnē kreisajā pusē ir saites uz visiem WordPress administrācijas ekrāniem ar apakšizvēlnēm, kas parādīsies, ja novietosiet kursoru virs saites. Sānu izvēlni var sakļaut šaurā ikonu joslā, noklikšķinot uz bultiņas izvēlnes apakšā.','You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.'=>'Varat izmantot šādas vadīklas, lai sakārtotu paneļa ekrānu, atbilstoši jūsu darbplūsmai. Šīs iespējas ir izmantojamas lielākajā daļā pārējo administrēšanas ekrānu.','For more information:'=>'Papildus informācija:','Caution:'=>'Uzmanību:','Plugins %s'=>'Spraudņi %s','Version %s'=>'Versija %s','Add Existing User'=>'Pievienot esošu lietotāju','Add New User'=>'Pievienot jaunu lietotāju','All Users'=>'Visi lietotāji','Changed roles.'=>'Mainīt lomas.','Confirm Deletion'=>'Apstiprināt noņemšanu','Deactivate'=>'Deaktivizēt','Delete Site'=>'Dzēst vietni','Installed Plugins'=>'Uzstādītie spraudņi','Role'=>'Loma','Search Users'=>'Meklēt lietotājus','Settings saved.'=>'Iestatījumi saglabāti.','Super Admin'=>'Super administrators','Updates %s'=>'Jauninājumi %s','User added.'=>'Lietotājs pievienots.','User removed from this site.'=>'Lietotājs noņemts no šīs vietnes.','Update Available <span class="count">(%s)</span>'=>'Pieejams <span class="count">%s</span> atjauninājums' . "\0" . 'Pieejami <span class="count">%s</span> atjauninājumi' . "\0" . 'Pieejami <span class="count">%s</span> atjauninājumu','About Pages'=>'Par lapām','Customizing This Display'=>'Šī ekrāna pielāgošana','Title and Post Editor'=>'Virsraksts un ziņas redaktors','Note: Neither of these options blocks access to your site &mdash; it is up to search engines to honor your request.'=>'Piezīme: neviena no šīm opcijām nebloķē piekļuvi jūsu vietnei &mdash; meklētājprogrammu ziņā ir cienīt šo pieprasījumu vai nē.','Post name'=>'Ziņas nosaukums','sample permalink basearchives'=>'arhīvi','sample permalink structuresample-post'=>'zina-paraugs','This importer is not installed. Please install importers from <a href="%s">the main site</a>.'=>'Importētājs nav instalēts. Lūdzu, instalējiet importētāju no <a href="%s"> galvenās vietnes</a>.','Site Language'=>'Vietnes valoda:','Attempt to notify any blogs linked to from the post'=>'Mēģināt informēt jebkuru emuāru, kad kādā no ziņām ir ievietota saite uz to.','Hi,
