%%s','Featured Images'=>'Raksturojoši attēli','Full Width Template'=>'Pilna platuma veidne','Post Formats'=>'Ziņu formāti','Featured Image Header'=>'Raksturojoša attēla galvene','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'Izskatās, ka jūs izmantojat senu %s pārlūka versiju. Lai saņemtu vairāk iespēju lietojot WordPress, lūdzu, atjauniniet savu pārlūkprogrammu.','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'Izskatās, ka jūs izmantojat nedrošu %s pārlūka versiju. Novecojušu pārlūkprogrammu lietošana padara jūsu datoru nedrošu. Lai saņemtu vairāk iespēju lietojot WordPress, lūdzu, atjauniniet savu pārlūkprogrammu.','There are some invalid menu items. Please check or delete them.'=>'Šeit ir daži nederīgi izvēlnes vienumi. Lūdzu, pārbaudiet vai dzēst tos.','term nameName'=>'Nosaukums','meta nameName'=>'Nosaukums','theme nameName'=>'Nosaukums','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'Jaunas tēmas savai vietne jūs varat atrast, izmantojot tēmu pārlūku un instalētāju šajā ekrānā, kas rāda tēmas no <a href="%s">WordPress tēmu direktorija</a>. Šīs tēmas, ko radījuši citi izstrādātāji, ir pieejamas bez maksas un ir saderīgi ar licenci, ko izmanto WordPress.','The uploaded file exceeds the %s directive that was specified in the HTML form.'=>'Augšupielādētais datne pārsniedz %s direktīvu, kas norādīta HTML formā.','External Libraries'=>'Ārējās bibliotēkas','Available Tools'=>'Pieejamie rīki','Network Setup'=>'Tīkla iestatīšana','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'Tulkotāji','Every plugin and theme in WordPress.org&#8217;s directory is 100%% GPL or a similarly free and compatible license, so you can feel safe finding <a href="%1$s">plugins</a> and <a href="%2$s">themes</a> there. If you get a plugin or theme from another source, make sure to <a href="%3$s">ask them if it&#8217;s GPL</a> first. If they do not respect the WordPress license, it is not recommended to use them.'=>'Katrs spraudnis un tēma WordPress.org vietnē ir 100%% GPL vai ar līdzīgu un saderīgu bezmaksas licenci, lai jūs varētu justies droši meklējot tur <a href="%1$s">spraudņus</a> un <a href="%2$s">tēmas</a>. Ja esat ieguvis spraudni vai tēmu no cita avota, vispirms pārliecinieties, ka <a href="%3$s">tā ir GPL</a>. Ja viņi neievēro WordPress licenci, mēs neiesakām tos izmantot.','WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We are flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.'=>'WordPress aug, kad tādi cilvēki kā jūs stāsta par to saviem draugiem, un tūkstošiem uzņēmumu un pakalpojumu, kas izveidoti uz un ap WordPress, šo faktu dara zināmu saviem lietotājiem. Mums glaimo katra reize, kad kāds izplata labu ziņu, vienīgi vispirms pārliecinieties, ka <a href="%s">esat iepazinies ar mūsu preču zīmju lietošanas norādījumiem</a>.','All Comments'=>'Visi komentāri','Lead Developer'=>'Galvenais izstrādātājs','Cofounder, Project Lead'=>'Līdzdibinātājs, projekta vadītājs','Core Contributors to WordPress %s'=>'WordPress %s kodola veidošanas atbalstītāji','Credits'=>'Dalībnieki','Project Leaders'=>'Projekta vadītāji','removing-widgetDeactivate'=>'Deaktivizēt','Your browser is out of date!'=>'Jūsu pārlūkprogramma ir novecojusi!','You are using an insecure browser!'=>'Jūs lietojat nedrošu pārlūkprogrammu!','Freedoms'=>'Brīvības','You can choose one of your previously uploaded headers, or show a random one.'=>'Var izmantot vienu no jūsu iepriekš augšupielādētajām galvenēm vai kādu parādīt izlases veidā.','You can use one of these cool headers or show a random one on each page.'=>'Var izmantot vienu no lieliskajām galvenēm vai parādīt izlases veidā pa viena katrā lapā.','If you do not want to upload your own image, you can use one of these cool headers, or show a random one.'=>'Ja nevēlaties augšupielādēt savu attēlu, izmantojiet kādu no šīm lieliskajām galvenēm vai parādiet vienu nejaušā secībā.','Collapse menu'=>'Sakļaut izvēlni','<strong>Random:</strong> Show a different image on each page.'=>'<strong>Nejauši:</strong> parādīt attēlu katrā lappusē, nejaušā secībā.','Uploaded Images'=>'Augšupielādēt attēlus','You have specified this user for deletion:'=>'Jūs esat norādījis šo lietotāju dzēšanai:','%s Page Template'=>'%s Lapas veidne','This plugin may be active on other sites in the network.'=>'Šis spraudnis var būt aktīvas citās tīkla vietnēs.','You cannot delete a plugin while it is active on the main site.'=>'Jūs nevarat izdzēst spraudni kamēr tas darbojas galvenajā vietnē.','Default Post Format'=>'Ziņas noklusējuma formāts','Any edits to files from this screen will be reflected on all sites in the network.'=>'Katrs failu labojums šajā ekrānā tiks atspoguļots visās tīkla vietnēs.','The boxes on your Dashboard screen are:'=>'Šajā ekrānā esošie lodziņi:','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'Šajā ekrānā ir redzami visi esošie vietnes lietotāji. Katram no tiem ir viena no piecām definētajām lomām kuru piešķīris vietnes administrators: vietnes administrators, redaktors, autors, atbalstītājs vai abonents. Lietotājiem ar lomām, kas nav administrators, būs pieejamas mazāks skaits navigācijas paneļa opciju.','If you want to make changes but do not want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.'=>'Ja vēlaties veikt izmaiņas, bet nevēlaties, lai tās tiktu pārrakstītas, kad spraudnis tiek atjaunināts, iespējams, esat gatavs domāt par sava spraudņa rakstīšanu. Lai iegūtu informāciju par to, kā rediģēt spraudņus, rakstīt savus no nulles vai vienkārši labāk izprast to anatomiju, skatiet tālāk sniegtās saites.','Sample Page'=>'Parauga lapa','sample-page'=>'paraug-lapa','Retro (Generated)'=>'Retro (tiks ģenerēts)','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'Šajā saitē jums ir iespējota tikai viena tēma. Apmeklējiet Tīkla Administratoru, lai<a href="%1$s">iespējotu</a> vai <a href="%2$s"> instalētu </a> vairāk tēmu.','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'Jūs esat iespējojis tikai vienu tēmu šai lapai. Apmeklējiet Tīkla Administrēšanu, lai <a href="%s">iespējotu</a> vairāk.','Super admin privileges cannot be removed because this user has the network admin email.'=>'Super administratora privilēģijas nevar noņemt, jo šim lietotājam ir tīkla administratora e-pasta adrese.','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'Jums pašlaik ir instalēta tikai viena tēma. Garlaicīgi! Jebkurā brīdī jūs varat izvēlēties no vairāk nekā 1000 bezmaksas tēmām WordPress tēmu direktorijā: vienkārši klikšķinot augšpusē esošajā cilnē <a href="%s"> Instalēt tēmas</a>.','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'Nav pieejamas viena vai vairākās datu bāzes tabulas. Lai ļautu WordPress mēģināt šīs tabulas salabot, spiediet pogu &#8220;Labot datubāzi&#8221;. Lūdzu, esiet pacietīgi, labošana var ieilgt.','Visual Editor RTL Stylesheet'=>'Vizuālā redaktora RTL stila lapa','This child theme inherits templates from a parent theme, %s.'=>'Šis apakštēma manto veidnes no pamattēmas %s.','This is a file in your current parent theme.'=>'Šis ir fails no jūsu pašreizējās pamattēmas.','Network Enable'=>'Iespējot tīklu','Database Update Required'=>'Nepieciešama datu bāzes jaunināšana.','No Update Required'=>'Jauninājums nav nepieciešams','The database update process may take a little while, so please be patient.'=>'Datu bāzes jaunināšanas procedūra var aizņemt kādu laiku, tāpēc lūdzu nedaudz pacietības.','Update Complete'=>'Jaunināšana pabeigta.','Update WordPress Database'=>'Jaunināt WordPress datu bāzi','WordPress &rsaquo; Update'=>'WordPress &rsaquo; jaunināt','You are about to install WordPress %s <strong>in English (US)</strong>. There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.'=>'Jūs gatavojaties instalēt WordPress %s <strong>angļu (ASV) valodā</strong>. Pastāv iespēja, ka šis jauninājums sabojās jūsu tulkojumu. Ir iespēja nogaidīt un dot priekšroku lokalizētas versijas laidienam.','Your WordPress database has been successfully updated!'=>'Jūsu WordPress datu bāze tika veiksmīgi jaunināta!','Update Plugin'=>'Atjaunot spraudni','Plugin update failed.'=>'Spraudņa jaunināšana neizdevās.','Plugin updated successfully.'=>'Spraudnis ir veiksmīgi jaunināts.','Theme update failed.'=>'Tēmas jaunināšana neizdevās.','Theme updated successfully.'=>'Tēma veiksmīgi jaunināta.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'Ir pieejama jauna %1$s versija. <a href="%2$s" %3$s> Skatīt versijas %4$s detaļas</a>. <Em>Šim spraudnim automātiska jaunināšana nav pieejama.</em>','Update Theme'=>'Atjaunināt tēmu','Update package not available.'=>'Atjaunošanas pakotne nav pieejama.','Authors:'=>'Autori:','All content'=>'Visas saturs','Choose what to export'=>'Izvēlēties ko eksportēt','Date range:'=>'Datumu diapazons:','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'Fails saturēs visas ziņas, lapas, komentārus, pielāgotos laukus, terminus, navigācijas izvēlnes un pielāgotās ziņas. Tas nesaturēs multimediju bibliotēku, bet tikai šo failu URL.','commentsMine <span class="count">(%s)</span>'=>'Mani <span class="count">(%s)</span>' . "\0" . 'Mani <span class="count">(%s)</span>' . "\0" . 'Mani <span class="count">(%s)</span>','%s &#8212; WordPress'=>'%s &#8212; WordPress','column nameIn Response To'=>'Atbildot uz','For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.'=>'Vienīgi attēliem varat klikšķināt pogu Labot attēlu, lai atvērtu vienkāršu attēlu redaktoru ar ikonām: apgriešana, rotēšana un apvēršana kā arī darbību atcelšana. Lodziņos pa labi no attēla ir vairāk iespēju mērogot to, apgriezt attēlu, ievadot precīzus apgriešanas izmērus. Klikšķinot uz ikonām &mdash; jautājuma zīmēm atvērsiet papildu informāciju.','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'Ņemiet vērā, lai apgrieziet attēlu, tas jāiezīmē ar kursoru (apgriešanas ikona kļūst aktīva) un velkot apgriešanas rāmi veiciet vajadzīgo attēla daļas atlasi. Pēc tam saglabājiet apgriešanu klikšķinot pogu Saglabāt.','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'Pieejamo logrīku sadaļā ir visi jums pieejamie logrīki. Kad ievelkat logrīku lauciņa Sānjosla, to var atvērta un konfigurēt iestatījumus. Ja logrīka iestatījumi jūs apmierina, klikšķiniet pogu Saglabāt un logrīks kļūs redzams jūsu vietnē. Ja klikšķināt pogu Dzēst, logrīks tiks noņemts.','This screen allows you to edit fields for metadata in a file within the media library.'=>'Šajā ekrānā iespējams rediģēt meta datu laukus datnēm, kuras pieejamas multivides bibliotēkā.','Remember to click Update to save metadata entered or changed.'=>'Neaizmirstiet saglabāt ievadītos vai mainītos meta datus klikšķinot pogu Atjaunot.','Email or Username'=>'E-pasta adrese vai lietotājvārds.','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong>Lūdzu, ņemiet vērā:</strong> visi pielāgojumi , kurus būsiet veicis tēmas failos tiks zaudēti. Modifikācijām iesakām izmantot <a href="%s">apakštēmu</a>.','postsSticky <span class="count">(%s)</span>'=>'Piespraustas<span class="count">(%s)</span>' . "\0" . 'Piesprausti <span class="count">(%s)</span>' . "\0" . 'Piesprausti <span class="count">(%s)</span>','Last checked on %1$s at %2$s.'=>'Pēdējo reizi tika pārbaudīts %1$s plkst. %2$s.','Please select one or more plugins to update.'=>'Lūdzu izvēlieties vienu vai vairākus spraudņus atjaunošanai.','Please select one or more themes to update.'=>'Lūdzu izvēlieties vienu vai vairākas tēmas atjaunošanai.','Check again.'=>'Pārbaudīt vēlreiz','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'Tiek sākts atjaunošanas process. Pie dažiem mitinātājiem tas var prasīt zināmu laiku, tāpēc lūdzu, esiet pacietīgi.','Apply Filters'=>'Lietot filtrus','Editor Style'=>'Redaktora stils','Sorry, you are not allowed to edit users.'=>'Atvainojiet, bet jums nav atļauts labot lietotājus.','To perform the requested action, WordPress needs to access your web server.'=>'WordPress ir nepieciešama piekļuve jūsu tīmekļa serverim, lai veiktu pieprasīto darbību.','Current Page'=>'Pašreizējā lapa','No themes match your request.'=>'Neviena tēma neatbilst jūsu prasībām','Create a New User'=>'Izveidot jaunu lietotāju','%s site'=>'%s vietne' . "\0" . '%s vietnes' . "\0" . '%s vietnes','%s user'=>'%s lietotājs' . "\0" . '%s lietotāji' . "\0" . '%s lietotāji','Search Sites'=>'Meklēt vietnes','You have %1$s and %2$s.'=>'Jums ir %1$s un %2$s','https://wordpress.org/news/'=>'https://wordpress.org/news/','https://wordpress.org/news/feed/'=>'https://wordpress.org/news/feed/','(Signup has been disabled. Only members of this site can comment.)'=>'(Reģistrācija ir atspējota. Komentārus drīkst iesniegt tikai šīs vietnes lietotāji.)','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'Ir pieejama jauna %1$s versija. <a href="%2$s" %3$s>Skatīt versijas %4$s detaļas</a>.','Go to Plugins page'=>'Atvērt spraudņu lapu','Go to WordPress Updates page'=>'Atvērt WordPress Jauninājumu lapu','Go to Themes page'=>'Atvērt tēmu lapu','Click Save Menu to make pending menu items public.'=>'Klikšķiniet Saglabāt izvēlni, lai publiskotu izvēlnes elementus.','Storage Space'=>'Krātuves vieta','Create a New Site'=>'Izveidot jaunu vietni','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'Attēli, kuru izmērs ir <strong>%1$d x %2$d pikseļi</strong>, tiks izmantoti tādi, kādi tie ir.','Crop and Publish'=>'Apgriezt un publicēt','XFN stands for <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'XFN nozīmē <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, tas nav obligāts. WordPress ļauj ģenerēt XFN atribūtus, lai parādītu, kā jūs esat saistītas ar autoriem vai īpašniekiem, ar kuriem jūs veidojat saites.','FTP Password'=>'FTP parole','FTP Username'=>'FTP lietotājvārds','FTP/SSH Password'=>'FTP/SSH parole','FTP/SSH Username'=>'FTP/SSH |lietotājvārds','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'Daudz tēmas parāda kādu sānjoslas logrīku pēc noklusējuma līdz brīdim, kad jūs sākat rediģēt lapas sānjoslu. Tomē tie netiek automātiski parādīti jūsu sānjoslu pārvaldības rīkos. Pēc tam, kad būsiet veikuši pirmo logrīku labojumu vai maiņu, jūs var atkārtoti pievienot noklusējums logrīkus no Pieejamo logrīku apgabala.','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'Papildus lauki ļauj pielāgot &#8220;kategorijas&#8221; un &#8220;birkas&#8221; bāzes nosaukumu, kas parādīsies arhīva URL. Piemēram, lapā ar visu &#8220;Nekategorizēto&#8221; ziņu sarakstu, kategorija varētu būt <code>temats/nekategorizēts</code> nevis <code>kategorija/nekategorizēts</code>.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.'=>'Jūs varat izvēlēties, kas būs redzams jūsu vietnes sākuma lapā. Tās var būt ziņas apgrieztā hronoloģiskā secībā (klasiskais blogs) vai nemainīga - statiska lapa. Lai iestatītu statisku mājas lapu, jums vispirms nepieciešams izveidot divas <a href="%s">lapas</a>. Viena kļūs par sākumlapu un otra būs tā, kurā tiks parādītas jūsu ziņas.','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'Visiem iestatījumiem, izņemot Parasto, saites ceļš ar struktūras birkām (terminiem, ko ieskauj %s) tiks rādīts arī lauciņā Pielāgota struktūra, kur to, vajadzības gadījumā, ir iespējams modificēt.','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'Piešķirot vairākas kategorijas vai birkas ziņai, vienīgā, kas tiks parādīta pastāvīgajā saitē būs kategorija ar mazāko skaitli. Tas attiecas uz pielāgoto struktūru ja ceļā būs ietverta %1$s vai %2$s.','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'Ja vēlaties noņemt logrīku, bet saglabāt tā iestatījumus lietošanai nākotnē, vienkārši ievelciet to uz neaktīvo logrīku apgabalu. Tās tos jebkurā laikā varēsiet pievienot atpakaļ no turienes. Tas ir īpaši noderīgi, pārslēdzoties uz tēmu ar savādāk izvietotiem logrīku apgabaliem.','Most themes show the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. Many themes also show the tagline.'=>'Lielākā daļa tēmu vietnes nosaukumu parāda katras lapas augšpusē, pārlūka virsrakstu joslā un kā identificējošu nosaukumu sindicētās plūsmās. Daudzas tēmas parāda arī devīzi.','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'Var iestatīt maksimālos izmērus attēliem kas tiek ievietoti tekstā bet varat arī ievietot attēlu pilnā izmērā.','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'<strong>Secība</strong> &mdash; lapas parasti ir sakārtotas alfabētiskā secībā, bet jūs varat izveidot savu secību, ievadot atbilstošu skaitli šajā lodziņā: 1 pirmajai, utt.','Please enter your FTP or SSH credentials to proceed.'=>'Lūdzu ievadiet savus FTP vai SSH lietotāja datus, lai turpinātu.','Please enter your FTP credentials to proceed.'=>'Lūdzu ievadiet savus FTP lietotāja datus, lai turpinātu.','If you do not remember your credentials, you should contact your web host.'=>'Ja jūs neatceraties savus akreditācijas datus, jums vajadzētu sazināties ar savas vietnes uzturētāju.','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'Jūs varat augšupielādēt tēmu manuāli, ja tā ir arhivēta ar paplašinājumu ZIP un atrodas jūsu datorā (pārliecinieties, vai tā nāk no uzticama un oriģināla avota). Jūs varat darīt to arī vecmodīgā veidā, kopējot lejupielādēto, nearhivēto tēmu ar FTP jūsu %s direktorijā.','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'Jūsu profils satur informāciju par jums (jūsu konts), kā arī dažas jūsu WordPress lietošanas opcijas.','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong>Sūtīt atsauces paziņojumus</strong> &mdash; atsauces paziņojumi ir veids, kā informēt senākas emuāru sistēmas, ka jūs esat ievietojis saiti uz tām. Lodziņā ievadiet URL, uz kuru vēlaties nosūtīt atsauces paziņojumu. Ja ievietojat saiti uz citu WordPress vietni, paziņojums tiks nosūtīts automātiski, izmantojot atbalss paziņojumu, un aizpildīt šo lauku nav nepieciešams.','Administrators have access to all the administration features.'=>'Administratoriem ir piekļuve visām administrēšanas funkcijām.','Contributors can write and manage their posts but not publish posts or upload media files.'=>'Atbalstītāji var rakstīt un pārvaldīt savas ziņas, bet nevar ziņas publicēt vai augšupielādēt multivides failus.','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'Dzēšot saiti, tā tiks neatgriezeniski noņemta, jo saitēm vēl nav atkritnes funkcijas.','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'Lai pievienotu saites, kas tiks parādītas jūsu vietnē, parasti izmanto <a href="%s">logrīku</a>. Saites uz vairākām vietnēm WordPress kopienā, pēc noklusējuma, ir iekļautas kā piemēri.','You can use the plugin file editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'Varat izmantot spraudņa faila redaktoru, lai veiktu izmaiņas jebkurā spraudņa PHP failā. Ņemiet vērā, ka, veicot izmaiņas, spraudņu jauninājumi pārrakstīs jūsu pielāgojumus.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong>Taka</strong> &mdash; URL-draudzīga nosaukuma versija. Tajā parasti nav lielo burtu un to veido no burtiem, cipariem un defisēm.','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'Ziņu varat izveidot arī, izmantojot sīklietotni <a href="%s">Spied šo!</a>.','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'Jūsu varat pielāgot vietnes izskatu, izmantojot pielāgotu fonu un nemainot tēmas kodu. Lapas fons var būt attēls vai krāsa.','Do not forget to click on the Save Changes button when you are finished.'=>'Neaizmirstiet noklikšķināt pogu Saglabāt izmaiņas, kad esat beidzis.','Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.'=>'Redaktori var publicēt ziņas, pārvaldīt ziņas kā arī pārvaldīt citu personu ziņas, utt.','Remember to click the Update Profile button when you are finished.'=>'Atcerieties, kad esat pabeidzis, klikšķiniet pogu Atjaunināt profilu.','Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.'=>'Nepieciešamie lauki ir norādīti, pārējie nav obligāti. Profila informācija tiks parādīta tikai tad, ja jūsu tēma ir iestatīta, to darīt.','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'Jūsu lietotājvārdu mainīt nevar, bet var izmantot citus laukus, lai ievadītu savu īsto vārdu vai segvārdu, un tad norādīt, kurš no minētajiem tiks parādīts kā autora vārds jūsu ziņām.','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'Jūs var pārvaldīt komentārus arī no šī ekrāna izmantojot Statusa lodziņu. Tur jūs var mainīt arī komentāra laikspiedolu.','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'Ja nepieciešams, jūs varat rediģēt komentārā rakstīto tekstu. Bieži vien tas ir noderīgi, ja pamanāt, ka komentētājs ir pieļāvis drukas kļūdu.','The fields on this screen determine some of the basics of your site setup.'=>'Šī ekrāna lauki nosaka dažus jūsu vietnes pamata iestatījumus.','This screen contains the settings that affect the display of your content.'=>'Šai ekrānā ir iestatījumi, kas ietekmēs jūsu satura parādīšanu.','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'<em>Neaizmirstiet saglabāt veiktās izmaiņas klikšķinot pogu ekrāna apakšā!</em>','You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or an excerpt. <a href="%s">Learn more about feeds</a>.'=>'Jūs varat arī kontrolēt saturu, ko rādīs RSS plūsmas, ieskaitot maksimālo parādīto rakstu skaitu un to, vai rādīt pilnu tekstu vai tā kopsavilkumu. <a href="%s">Uzzināt vairāk par plūsmām</a>.','UTC means Coordinated Universal Time.'=>'UTC — Koordinētais universālais laiks. Garais un īsais pieraksts latviski: Pielāgots > l\\a, Y. \\g\\a\\d\\a j. F >  Y. \\g. j. F ','The boxes for link name, web address, and description have fixed positions, while the others may be repositioned using drag and drop. You can also hide boxes you do not use in the Screen Options tab, or minimize boxes by clicking on the title bar of the box.'=>'Lodziņi ar saites nosaukumu, tīmekļa adresi un aprakstu ir fiksētās pozīcijās, kamēr pārējos var pārkārtot pārvelkot. Jūs var arī paslēpt neizmantotos lodziņus Ekrāna opciju cilnē, vai samazināt tos klikšķinot lodziņa virsraksta joslā.','You have the latest version of WordPress.'=>'Jums ir jaunākā WordPress versija.','Your plugins are all up to date.'=>'Visi jūsu spraudņi jau ir atjaunināti.','Your themes are all up to date.'=>'Visas jūsu tēmas jau ir atjauninātas.','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.'=>'Kamēr jūsu vietne tiek atjaunināta, tā būs apkopes režīmā. Tiklīdz jauninājumi būs veikti, šis režīms tiks deaktivizēts.','An updated version of WordPress is available.'=>'Ir pieejama jauna WordPress versija.','Function Name&hellip;'=>'Funkcijas nosaukums&hellip;','Activate Plugin &amp; Run Importer'=>'Aktivizēt spraudni un palaist importētāju','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'Var pievienot vai rediģēt saites šajā ekrānā, ievadot informāciju katrā no laukiem. Nepieciešamie lauki ir saites tīmekļa adrese un nosaukums (teksts, ko vēlaties rādīt jūsu vietnē, kā saites nosaukumu).','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'Kategorijas var selektīvi pārvērsts birkās, izmantojot <a href="%s">kategoriju-birku pārveidotāju</a>.','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'Pēc tam, kad tiks ģenerēts jūsu WXR fails, to varēs importēt citā WordPress vietnē vai citā platformā, kurai būs saprotams šis formāts.','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'Šajā ekrānā ir saites uz spraudņiem, lai importētu datus no citām blogošanas un satura pārvaldības platformām. Izvēlieties platformu, no kuru vēlaties importēt, un klikšķiniet saiti Instalēt. Ja jūsu platformas sarakstā nav, klikšķiniet saiti, lai spraudņu direktorijā meklētu citus importētājus, kas būtu piemērojami jūsu platformai.','You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.'=>'Jūs varat pielāgot ekrāna attēlojumu, izmantojot ekrāna opciju cilni vai nolaižamā saraksta filtrus virs saišu tabulas.','Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Do not forget to save your changes (Update File) when you are finished.'=>'Lai rediģētu spraudni, izvēlieties to nolaižamajā izvēlnē un pēc tam klikšķiniet pogu Izvēlēties. Vienreiz noklikšķiniet uz faila nosaukuma, lai to ielādētu redaktorā un veiciet izmaiņas. Kad esat beidzis, neaizmirstiet saglabāt veiktās izmaiņas spiežot Saglabāt izmaiņas.','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'Parasti spraudņi labi saprotas ar WordPress kodolu un pārējiem spraudņiem. Tomēr dažreiz viena spraudņa kods var traucēt citam spraudnim, izraisot saderības problēmas. Ja jūsu vietne sāk uzvesties dīvaini, tad tā var būt šī problēma. Mēģiniet deaktivizēt visus spraudņus un atkārtoti aktivizējot tos dažādās kombinācijās līdz noskaidrosiet, tieši kurš spraudnis rada problēmas.','<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.'=>'<strong>Padoms:</strong> labojot tēmu, kas pašlaik ir aktīva un tiek lietota, rūpīgi apsveriet savas vietnes avārijas iespējamību.','After typing in your edits, click Update File.'=>'Lai saglabātu savus labojumus, klikšķiniet Atjaunināt failu.','Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme&#8217;s template files. Clicking once on any file name causes the file to appear in the large Editor box.'=>'Sāciet, izvēloties nolaižamajā izvēlnē tēmu, ko rediģēt un klikšķinot pogu Izvēlieties. Tad parādīsies saraksta tēmas veidņu failiem. Vienreiz klikšķinot uz jebkura faila nosaukuma, tas tiks atvērts redaktora logā.','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'Izmantojot Pieejamības režīmu, iespējams pārvilkšanas vietā lietot pogas Pievienot un Rediģēt.','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'Logdaļas ir neatkarīgi lapas satura moduļi, kas var tikt novietoti katrā vietā, kas tam paredzēta jūsu tēmā (parasti sānu malās). Lai papildinātu sānjoslas &mdash; logrīku apgabalus ar atsevišķiem logrīkiem, velciet tos aiz virsraksta joslas un novietojiet vēlamajā vietā. Pēc noklusējuma, tikai pirmā logrīka apgabals ir izvērsts. Lai atvēru citu logrīku apgabalus, klikšķiniet to virsrakstu joslās.','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'Logrīkus var izmantot daudzkārt. Jūs varat dot katram logrīki nosaukumu, lai tas būtu redzams jūsu vietnē, bet to darīt nav obligāti.','You can use the theme file editor to edit the individual CSS and PHP files which make up your theme.'=>'Varat izmantot tēmas failu redaktoru, lai rediģētu atsevišķus CSS un PHP failus, kas veido jūsu tēmu.','(no parent)'=>'(nav padota)','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong>Hierarhija</strong> &mdash; jūs varat organizēt jūsu lapu hierarhiju. Piemēram, jums varētu būt lapa &#8220;Par mani&#8221;, zem kuras ir lapas &#8220;Dzīves stāsts&#8221; un &#8220;Mans suns&#8221;. Nav nekādu ierobežojumu, cik apakšlīmeņos jūs variet ligzdot lapas.','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong>Veidne</strong> &mdash; dažām tēmām ir pielāgotas veidnes, ko var izmantot noteiktām lapām, kurām varētu būt papildu līdzekļi vai pielāgoti izkārtojumi. Ja tādi ir arī šai tēmai, jūs tos redzēsiet šajā nolaižamajā izvēlnē.','All updates have been completed.'=>'Visi jauninājumi ir paveikti.','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong>Apraksts</strong> &mdash; apraksts nav obligāts, tomēr dažas tēmas to var parādīt.','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong>Vārds</strong> &mdash; jūsu vietnē redzamais nosaukums.','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'Pievienojot jaunas kategorijas šajā ekrānā jūs aizpildiet šādus laukus:','When adding a new tag on this screen, you&#8217;ll fill in the following fields:'=>'Pievienojot jaunu birka šajā ekrānā, jūs aizpildīt šādus laukus:','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'Kāda ir atšķirība starp kategorijām un birkām? Parasti, birkas ir speciāli atslēgvārdi, kuri apzīmē svarīgu informāciju jūsu ziņā (vārdi, priekšmeti, utt.). Birkas var atkārtoties vairākās ziņās, bet kategorijas ir iepriekš noteiktu sadaļu virsraksti. Lietojot analoģiju ar grāmatu, kategorijas ir kā satura rādītājs bet birkas &mdash; termini indeksa rādītājā.','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'Jūs var mainīt šo ekrānu, izmantojot Šī ekrāna opciju cilni. Varat noteikt, cik daudzi elementu jārāda vienā ekrānā un parādīt vai slēpt slejas tabulā.','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'Jūs varat izmantot kategorijas, lai definētu jūsu vietnes sadaļas un grupētu saistītas ziņas. Noklusējuma kategorija ir &#8220;Nekategorizēts&#8221; līdz jūs to nomaināt savos <a href="%s">rakstīšanas iestatījumos</a>.','Text Color'=>'Teksta krāsa','Default Images'=>'Noklusētie attēli','Image Upload Error'=>'Attēla augšupielādes kļūda','Crop Header Image'=>'Apgriezt galvenes attēlu','Remove Header Image'=>'Noņemt galvenes attēlu','Reset Image'=>'Atiestatīt attēlu','Restore Original Header Image'=>'Atjaunot sākotnējo galvenes attēlu','This will remove the header image. You will not be able to restore any customizations.'=>'Šis noņems galvenes attēlu. Jums nebūs iespējams atjaunot savus pielāgojumus.','This will restore the original header image. You will not be able to restore any customizations.'=>'Šis atjaunos sākotnējo galvenes attēlu. Izmaiņas, ja tādas būs bijušas, netiks atjaunotas.','You need JavaScript to choose a part of the image.'=>'Jums nepieciešams JavaScript, lai izvēlētos attēla daļu.','Delete this comment permanently'=>'Neatgriezeniski dzēst šo komentāru','Restore this comment from the Trash'=>'Atjaunot šo komentāru no atkritnes','Allow comments'=>'Atļaut komentārus','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong>%s</strong> &mdash; tas ļauj saistīt attēlu ar ziņu, neievietojot to. Tas noder vienīgi tad, ja jūsu tēma izmanto attēlu kā ziņas sīktēlu mājas lapā, pielāgotajā galvenē, utt.','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong>Diskusijas</strong> &mdash; jūs var ieslēgt vai izslēgt komentārus un atbalsis, un ja ziņai ir komentāri, jūs var apskatīt un pārvaldīt tos šeit.','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong>Virsraksts</strong> &mdash; ierakstiet jūsu ziņas nosaukumu. Kad virsraksts būs ierakstīts, lodziņā zem rediģēšanas loga jūs redzēsiet paliekošo saiti, kuru varēs rediģēt.','Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:'=>'Turot kursoru virs saraksta rindas parāda darbību saites, kas ļauj jums pārvaldīt ziņas. Jūs var veikt šādas darbības:','You can customize the display of this screen in a number of ways:'=>'Jūs varat pielāgot šī ekrānu satura attēlošanu vairākos veidos:','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'Jūs var slēpt vai rādīt slejas atbilstoši jūsu vajadzībām un izlemt, cik ziņu parādīt vienā ekrānā, izmantojot cilni Šī ekrāna opcijas.','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'Sarakstu var precizēt, lai rādītu tikai noteiktas kategorijas ziņas vai noteikta mēneša ziņas, izmantojot nolaižamās izvēlnes virs ziņu saraksta. Pēc atlases veikšanas noklikšķiniet uz pogas Filtrs. Sarakstu var arī precizēt, ziņu sarakstā klikšķinot uz ziņu autora, kategorijas vai atzīmes.','Your theme supports one menu. Select which menu you would like to use.'=>'Jūsu tēma atbalsta vienu izvēlni. Atlasiet to izvēlni, kuru gribat izmantot.','Your theme does not support navigation menus or widgets.'=>'Jūsu tēma neatbalsta navigācijas izvēlnēm vai logrīkus.','Categories and Tags Converter'=>'Kategoriju un birku pārveidotājs','Most Recent'=>'Visjaunākie','Start date:'=>'Sākuma datums:','Theme InstallerTag'=>'Birka','Plugin InstallerTag'=>'Birka','verbClear'=>'Notīrīt','commentMark as spam'=>'Apzīmēt kā mēstuli','Remove Background Image'=>'Noņemt fona attēlu','Comments on &#8220;%s&#8221;'=>'Komentāri par &#8220;%s&#8221;','Show advanced menu properties'=>'Rādīt papildu izvēlnes iestatījumus','You have version %1$s installed. Update to %2$s.'=>'Jums ir instalēta %1$s versija. Jaunināt uz %2$s.','Enabled'=>'Iespējots','commentNot Spam'=>'Nav mēstule','This will restore the original background image. You will not be able to restore any customizations.'=>'Šis atjaunos oriģinālo fona attēlu. Jūs nevarēsiet atjaunot jebkādus pielāgojumus.','WordPress Blog'=>'WordPress blogs','Remove Users from Site'=>'Dzēst vietnes lietotājus','&mdash; No role for this site &mdash;'=>'&mdash; Nekādu lomu šai vietnei &mdash;','New WordPress Site'=>'Jauna WordPress vietne','Custom site deleted message.'=>'Pielāgotā vietnē dzēsts ziņojums.','Custom site inactive message.'=>'Pielāgotā vietnē neaktīvs ziņojums.','Custom site suspended message.'=>'Pielāgotā vietnē aizturēts ziņojums.','My Site'=>'Mana vietne','Sorry, you are not allowed to create pages on this site.'=>'Atvainojiet, jums nav atļauts veidot lapas šajā vietnē.','Sorry, you are not allowed to create posts or drafts on this site.'=>'Atvainojiet, jums nav atļauts veidot ziņas vai melnrakstus šajā vietne.','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'Ja jums ir ziņas vai komentāri citu sistēmu vietnēs, WordPress var importēt tos no šīm vietnēm. Lai sāktu, izvēlēties sistēmu no kuras importēt un instalējiet attiecīgo rīku:','No items.'=>'Nav ierakstu.','The installer attempted to contact a random hostname (%s) on your domain.'=>'Instalēšanas programma mēģināja sazināties ar nejaušu resursdatora nosaukumu (%s) jūsu domēnā.','To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.'=>'Lai izmantotu apakšdomēna konfigurāciju, jums jūsu DNS ir jābūt ierakstam ar aizstājējzīmi. To parasti dara pievienojot %s resursdatora nosaukuma ierakstu, kas norāda uz jūsu tīmekļa serveri, jūsu DNS konfigurācijas rīkā.','The menu item has been successfully deleted.'=>'Izvēlnes vienums tika veiksmīgi dzēsts.','Please provide a custom field name.'=>'Lūdzu, norādiet pielāgotā lauka nosaukumu.','Display Options'=>'Displeja opcijas','Remove Image'=>'Noņemt attēlu','Confirm Removal'=>'Apstiprināt noņemšanu','Other users have been removed.'=>'Citi lietotāji ir noņemti.','There are no valid users selected for removal.'=>'Nav izvēlēti noņemšanai derīgi lietotāji.','User deletion is not allowed from this screen.'=>'Lietotājs dzēšana nav atļauta no šī ekrāna.','You have specified these users for removal:'=>'Jūs esat norādījis šos