tore any customizations.'=>'Tas noņems fona attēlu. Nebūs iespējams atjaunot nekādus pielāgojumus.','Only the active theme is available to you. Contact the %s administrator for information about accessing additional themes.'=>'Jums ir pieejama tikai pašreizējā tēma. Papildinformācijai par piekļuvi citām tēmas, sazinieties ar %s administratoru.','Author Template'=>'Autora veidne','Tag Template'=>'Birkas veidne','Visual Editor Stylesheet'=>'Vizuālā reduktora stila lapa','Page saved.'=>'Lapa saglabāta.','More information about %s'=>'Plašāka informācija par %s','Grant this user super admin privileges for the Network.'=>'Piešķirt šim lietotājam tīkla Super administratora privilēģijas.','Important:'=>'Svarīgi:','This user has super admin privileges.'=>'Šim lietotājam ir Super administratora privilēģijas.','Update to version %s'=>'Atjaunināt uz %s versiju','<strong>Error:</strong> "Table Prefix" can only contain numbers, letters, and underscores.'=>'<strong>Kļūda</strong>: "Datubāzes tabulas prefikss" var saturēt tikai ciparus, burtus un pasvītrojuma simbolus.','Usernames cannot be changed.'=>'Lietotājvārdus mainīt nav iespējams!','items'=>'jaunākos vienumus','The menu has been successfully deleted.'=>'Izvēlne tika veiksmīgi dzēsta.','Site visibility'=>'Vietnes redzamība','Save Menu'=>'Saglabāt izvēlni','CSS Classes (optional)'=>'CSS klases (neobligāts)','Link Target'=>'Saites mērķis','Updating Theme %1$s (%2$d/%3$d)'=>'Tēmas %1$s (%2$d/%3$d) jaunināšana','The network already exists.'=>'Tīkls jau pastāv.','This resulted in an error message: %s'=>'Tas izraisīja kļūdas ziņojums: %s','You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.'=>'Jūs joprojām varat izmantot savu vietni, bet no jauna izveidotais apakšdomēns var nebūt pieejams. Ja jūs zināt ka jūsu DNS ir pareizs, ignorējiet šo ziņojumu.','You must provide a domain name.'=>'Jums ir jānorāda domēna nosaukums.','You must provide a name for 